const data=[{"count":523,"next":"https://wger.de/api/v2/exercise/?page=6","previous":"https://wger.de/api/v2/exercise/?page=4","results":[{"id":273,"license_author":"colinp23","status":"1","description":"<p>Biking</p>","name":"Biking","name_original":"Biking","creation_date":"2014-09-13","uuid":"27a0b190-0e72-4aa5-9d7b-c7b7e3c345ec","license":1,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":531,"license_author":"https://dynamicclinic.com/","status":"1","description":"<p> </p>\n<p> </p>\n<p>This is a great exercise for patients who DON’T suffer from lumbar disc injuries…  this exercise is great when you are looking to strengthen the low back.   </p>\n<p> </p>\n<p>Get on all fours, knees behind the hips.  Engager the Kegel muscles (the muscles you use to stop peeing) and raise your opposite arm and leg, while maintaining the contraction of the Kegel muscles.  If at any time you cannot maintain the muscle contraction, begin over.   Perform this exercise for at least 10 times per side, increasing the number as you get stronger.  </p>\n<p> </p>\n<p> </p>","name":"Bird Dog","name_original":"Bird Dog","creation_date":"2017-12-15","uuid":"dea7c5ba-3b43-4748-9da1-b01b04b36782","license":3,"category":10,"language":2,"muscles":[2,8,9],"muscles_secondary":[4],"equipment":[1]},{"id":530,"license_author":"slhannah","status":"1","description":"<p> </p>\n<p>Kneel on floor with your hands placed about shoulder width apart.</p>\n<p> </p>\n<p>Point one arm out straight in front and extend the opposite leg to the rear. The shoulders and the hips should be parallel.</p>\n<p> </p>\n<p>Hold for 10 seconds and return to ground position.</p>\n<p> </p>\n<p>Start with 5 reps on alternate hands and knees, 10  in total. Add up to 3 sets of 10.</p>\n<p> </p>\n<p>As a variation, you can do several bird dogs with one side and then do a set with just the other side.</p>\n<p> </p>\n<p>Keep the abs engaged while you change sides. Work to minimize any extra motion during the weight shift.</p>\n<p> </p>","name":"Bird Dog","name_original":"Bird Dog","creation_date":"2017-12-15","uuid":"7b9b9e82-570d-4a0b-8727-054ed1cbc995","license":3,"category":10,"language":2,"muscles":[2,8,9],"muscles_secondary":[4],"equipment":[1]},{"id":3,"license_author":"wger.de","status":"2","description":"<p>Stelle dich gerade etwa 30 - 40 cm. vor dem Kabel hin, die Füße sind fest auf dem Boden. Nehme die Stange in die Hände und hebe das Gewicht mit einer schnellen Bewegung. Lassie die Stange wie bei den KH Curls kontrolliert wieder runter.</p>","name":"Bizeps am Kabel","name_original":"Bizeps am Kabel","creation_date":null,"uuid":"ef487de3-f071-41bf-85a6-6e76afe9c732","license":1,"category":8,"language":1,"muscles":[1],"muscles_secondary":[],"equipment":[]},{"id":231,"license_author":"wger.de","status":"2","description":"<p>Wie \"Bizeps am Kabel\", nur mit einer ß-Stange</p>","name":"Bizeps am Kabel, ß-Stange","name_original":"Bizeps am Kabel, ß-Stange","creation_date":"2014-03-09","uuid":"1ea6774c-083a-4141-89cf-4c0e973ede12","license":2,"category":8,"language":1,"muscles":[1],"muscles_secondary":[],"equipment":[]},{"id":44,"license_author":"wger.de","status":"2","description":"<p>Halte die Hantel mit etwa schulterbreitem Griff, die Arme sind ausgestreckt. Beuge die Arme und brige die Hantel mit einer schnellen Bewegung nach oben. Ohne Pause wird das Gewicht nun kontrolliert nach unten gebracht. Beachte, dass die Bewegung nach oben schneller ist als nach unten.</p>\n<p>Während des Bewegungablaufs darf der Körper nicht mitschwingen. Die Ellenbogen bleiben dabei immer an der Stelle.</p>","name":"Bizeps Curls Mit ß-Stange ","name_original":"Bizeps Curls mit ß-Stange ","creation_date":null,"uuid":"8277124a-9ef2-442a-9824-7ab4439a5f1f","license":1,"category":8,"language":1,"muscles":[1],"muscles_secondary":[13],"equipment":[2]},{"id":26,"license_author":"wger.de","status":"2","description":"<p>Halte zwei Kurzhantel mit ausgestreckten Armen neben dem Körper, die Handflächen zeigen nach innen. Beuge die Arme und brige die Hanteln mit einer schnellen Bewegung nach oben wobei sie gleichzeitig um 90 Grad gedreht werden. Am höchsten Punkt kann man die Hanteln ganz leicht weiter nach außen drehen. Ohne Pause wird das Gewicht nun kontrolliert nach unten gebracht. Beachte, dass die Bewegung nach oben schneller ist als nach unten.</p>\n<p>Während des Bewegungablaufs darf der Körper nicht mitschwingen. Die Ellenbogen bleiben dabei immer an der Stelle.</p>","name":"Bizeps KH-Curls","name_original":"Bizeps KH-Curls","creation_date":null,"uuid":"8cbbffcc-1989-43de-9200-03869480398c","license":1,"category":8,"language":1,"muscles":[1],"muscles_secondary":[13],"equipment":[3]},{"id":242,"license_author":"Konsumopfer","status":"2","description":"<p>Sitz auf einer ca. 45° nach hinten geneigten Schrägbank; Oberkörper und Kopf an die Rückenlehne angelehnt.</p>\n<p>Rumpfmuskulatur anspannen, Rücken bleibt gerade, Blick geradeaus.</p>\n<p>Die Kurzhanteln werden jeweils im neutralen Hammergriff gefasst (Handinnenflächen zeigen zueinander). Die Arme hängen, leicht gebeugt, seitlich herab. Durch die Neigung der Rückenlehne befinden sich die leicht gebeugten Arme hinter der Körperachse.</p>\n<p>Handgelenke in Verlängerung des Unterarms.</p>\n<p>Beugen und Strecken im Ellbogengelenk in einer gleichmäßigen, parallelen Bewegung nah am Körper vorbei; Dabei zeigt der Oberarm weiter nahezu unverändert senkrecht nach unten.</p>\n<p>Die Unterarme während der Beugephase entweder auswärts drehen (Supination), so dass in der Endposition die Handinnenfläche zum Körper hin zeigt bzw. die Kurzhantel im Untergriff gehalten wird oder ohne Auswärtsdrehung der Unterarme beugen, so dass in der Endposition der Daumen zum Körper zeigt bzw. die Kurzhantel im neutralen Hammergriff gehalten wird.</p>\n<p>Die Arme weder maximal beugen noch ganz durchstrecken.</p>\n<p>Bei der Spuinationsvariante werden die Unterarme in der Abwärtsbewegung wieder nac innen zurückgedreht.</p>\n<p>Richtige Atmung: Beim Beugen ausatmen, beim Strecken einatmen.</p>","name":"Bizeps KH-Curls Schrägbank","name_original":"Bizeps KH-Curls Schrägbank","creation_date":"2014-04-08","uuid":"0842e81e-7b90-4d68-8e6b-e9a7c0186b54","license":1,"category":8,"language":1,"muscles":[1,13],"muscles_secondary":[],"equipment":[3]},{"id":24,"license_author":"wger.de","status":"2","description":"<p>Halte die Hantel mit etwa schulterbreitem Griff, die Arme sind ausgestreckt. Beuge die Arme und brige die Hantel mit einer schnellen Bewegung nach oben. Ohne Pause wird das Gewicht nun kontrolliert nach unten gebracht. Beachte, dass die Bewegung nach oben schneller ist als nach unten.</p>\n<p>Während des Bewegungablaufs sollte der Körper nicht mitschwingen. Die Ellenbogen bleiben dabei immer an der Stelle.</p>","name":"Bizeps LH-Curls","name_original":"Bizeps LH-Curls","creation_date":null,"uuid":"2e3fa138-3894-4f61-959a-d8966804a1a3","license":1,"category":8,"language":1,"muscles":[1],"muscles_secondary":[13],"equipment":[1]},{"id":316,"license_author":"vince63","status":"1","description":"<p>6 Second Reps Max 15 Reps</p>\n<p>6 Second Reps Max 15 Reps</p>","name":"Body Squats","name_original":"Body Squats","creation_date":"2015-03-07","uuid":"b99bc37b-c1a9-4321-a695-57e1cefe1d60","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":341,"license_author":"cal.zabel","status":"2","description":"<ol>\n<li>Assume a plank position on the ground. You should be supporting your bodyweight on your toes and forearms, keeping your torso straight. Your forearms should be shoulder-width apart. This will be your starting position.</li>\n<li>Pressing your palms firmly into the ground, extend through the elbows to raise your body from the ground. Keep your torso rigid as you perform the movement.</li>\n<li>Slowly lower your forearms back to the ground by allowing the elbows to flex.</li>\n<li>Repeat as needed.</li>\n</ol>","name":"Body-Ups","name_original":"Body-Ups","creation_date":"2015-07-21","uuid":"4e15a410-5530-4b86-964f-8af26e118e2b","license":2,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[7]},{"id":514,"license_author":"Bonniechica","status":"1","description":"<p>Bewegung eines Bogenschützens mit Tube</p>","name":"Bogenschütze","name_original":"Bogenschütze","creation_date":"2017-11-17","uuid":"50c974d2-1a0a-44c0-b93c-dbbd63591675","license":2,"category":13,"language":1,"muscles":[13,3,9],"muscles_secondary":[12],"equipment":[]},{"id":486,"license_author":"Bonnie","status":"1","description":"<p>Im aufrechten Stand unter Körperspannung - Bauch und Po -\"Bogenspann-Bewegung\" mit dem Theraband ausführen</p>","name":"Bogenschütze Mit TB","name_original":"Bogenschütze mit TB","creation_date":"2017-10-20","uuid":"b387c004-b160-49a3-bb3c-4051f8a74720","license":2,"category":12,"language":1,"muscles":[1,12,5],"muscles_secondary":[3],"equipment":[]},{"id":489,"license_author":"Bonniechica","status":"1","description":"<p>Mit dem Theraband Bogenschützbewegung ausführen</p>","name":"Bogenschütze TB","name_original":"Bogenschütze TB","creation_date":"2017-11-04","uuid":"60e7791e-3cff-4cee-af2e-895655f4a3c9","license":2,"category":12,"language":1,"muscles":[3,15],"muscles_secondary":[1],"equipment":[]},{"id":452,"license_author":"JS","status":"1","description":"<p>Create a circuit on an overhanging bouldering wall. The circuit should be between 20 and 60 moves depending on the type of climb you are training for. The difficulty should be at a level that you are failing near the end or only just finishing the circuit on your final lap. Ideally the moves are sustained (so no hard crux, unless that is specific to your goal climb) and on similar style of holds to your goal climb.</p>","name":"Boulder Circuit","name_original":"Boulder circuit","creation_date":"2017-02-27","uuid":"28150a9f-5533-473f-8072-ddfce3581503","license":2,"category":8,"language":2,"muscles":[1,11,12],"muscles_secondary":[7,15],"equipment":[]},{"id":526,"license_author":"knackers","status":"1","description":"<p>Couldn[t find any boxing exercise so ading one here.....</p>","name":"Boxing","name_original":"Boxing","creation_date":"2017-12-01","uuid":"142c407e-756e-4e23-b56d-6ac8ab7a7e79","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[7]},{"id":342,"license_author":"sevae","status":"2","description":"<p>Stand with feet slightly wider than shoulder-width apart, while standing as tall as you can.</p>\n<p>Grab a weight plate and hold it out in front of your body with arms straight out. Keep your core tight and stand with a natural arch in your back.</p>\n<p>Now, push hips back and bend knees down into a squat as far as you can. Hold for a few moments and bring yourself back up to the starting position.</p>","name":"Braced Squat","name_original":"Braced Squat","creation_date":"2015-07-23","uuid":"5bd3ba00-8f4e-4935-a682-87b150d830c8","license":2,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8],"equipment":[]},{"id":525,"license_author":"amirvahid","status":"1","description":"<p>asdasdddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddsaddddddddd</p>","name":"Brent","name_original":"brent","creation_date":"2017-12-01","uuid":"d82ba68b-f687-4512-9db6-bd054d3adc0d","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":199,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Brustpresse","name_original":"Brustpresse","creation_date":"2013-11-09","uuid":"61f77ca6-0e8d-42c7-b01f-aa83a0d7b386","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[],"equipment":[]},{"id":346,"license_author":"OM6oxA3bCOvamJntbRi5S0RCDrQ","status":"2","description":"<p>Rest back foot on an elevated surface with sole pointing up. keep your weight over your front leg as you lower yourself</p>","name":"Bulgarian Split Squat","name_original":"Bulgarian Split Squat","creation_date":"2015-08-19","uuid":"1d90f3a8-56e4-4c15-a4b4-94fc0e114e8c","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=2","previous":null,"results":[{"id":536,"license_author":"Metin","status":"1","description":"One does not accumulate but eliminate .  It is not daily increase but daily  decrease. The height of cultivation  always runs to simplicity.","name":"","name_original":"","creation_date":"2018-01-15","uuid":"65a42fef-cf6d-4a96-9ab8-7d99cb5cb8b9","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":475,"license_author":"lotd","status":"1","description":"Dolor dolor quia molestiae accusantium libero et dolores voluptatem. Quis molestiae non quam tempora ab veritatis totam. Reprehenderit enim dolore aut ipsa repudiandae possimus aspernatur. Eligendi tempore beatae labore id aut. Dolorem iusto est odio.","name":"","name_original":"","creation_date":"2017-07-16","uuid":"1d00cd6f-f59d-4c84-aedf-b8440043552d","license":2,"category":14,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":538,"license_author":"Metin","status":"1","description":"Get onto all fours and prop yourself up on your forearms. \"Turn your palms up toward the sky, keeping your thumbs on the ground, and form a straight line from your head to your heels,\" Dunham says. Squeeze your glutes and quads, which will draw your knees up and prevent sagging. \"Brace your core as if you were expecting a kick to the stomach, and press your forearms into the ground,\" he adds. Once you feel everything tighten, squeeze even harder and take big, deliberate breaths as you plank. To increase the challenge, squeeze harder and exhale more air with each breath as you hold the position.","name":"","name_original":"","creation_date":"2018-01-15","uuid":"9b898763-ad9c-4a7e-b5ff-4ceeee5fb26d","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":453,"license_author":"Voman85","status":"1","description":"This exercise entails anything involving soccer, including any exercises that are soccer-related.","name":"","name_original":"","creation_date":"2017-03-06","uuid":"3096c0f2-db79-4ba0-bcfe-f550097f2122","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":535,"license_author":"Metin","status":"1","description":"5 minutes Set a time limit for however long you have to exercise. Complete as many reps as you can of your exercise of choice in that time, then work to do more reps the next time you repeat the routine.","name":"","name_original":"","creation_date":"2018-01-15","uuid":"07069f6e-4984-4d65-847b-4d7973e6eea4","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":539,"license_author":"Metin","status":"1","description":"The plank is one of the most common core exercises, ever, but most guys get it wrong. Creating tension in your abs primes your body to maximally contract all of its muscles. \"This is a very useful ability when sprinting, jumping, and lifting weights,\" Dunham says","name":"","name_original":"","creation_date":"2018-01-15","uuid":"c553c81c-aad3-4f6a-b3ad-4e5c7cd28d3c","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":436,"license_author":"Andrew Carothers","status":"1","description":"<p>1 Minute for each exercise</p>\n<ol>\n<li>Hold feet 6 inches off ground</li>\n<li>Crunches</li>\n<li>Side Crunches (L)</li>\n<li>Side Crunches (R)</li>\n<li>Heel Touches</li>\n<li>Plank Crunch</li>\n<li>Scissor Kicks</li>\n<li>Swim Kicks</li>\n<li>V Crunches</li>\n<li>Hold feet 6 in off ground</li>\n</ol>\n<p>Exercises can be substituted to vary workout</p>","name":"10 Min Abs","name_original":"10 Min Abs","creation_date":"2016-12-09","uuid":"3c5f6e1c-cb22-4a9f-a13e-d14afeb29175","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":345,"license_author":"deusinvictus","status":"2","description":"<p>Two Handed Russian Style Kettlebell swing</p>","name":"2 Handed Kettlebell Swing","name_original":"2 Handed Kettlebell swing","creation_date":"2015-08-03","uuid":"c788d643-150a-4ac7-97ef-84643c6419bf","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[10]},{"id":449,"license_author":"HansAndFrans","status":"1","description":"With a deck of cards, pick a card and do push ups relating to the number value on the card. For example if a Jack of Hearts is picked, do 10 pushups.","name":"52","name_original":"52","creation_date":"2017-02-17","uuid":"56f2ca98-74dc-4b6f-a189-cefaab66d2ac","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":350,"license_author":"Magenta","status":"1","description":"<p></p>\n<p>60 secondi per ogni stazione, ripetere tutto 2 volte</p>\n<p>1. gambe alte ferme, cercando di portare i glutei più vicino possibile al muro</p>\n<p>2. portare la gamba destra \"ad ore 3\", quanto più largo possibile; la gamba sinistra è ferma in alto</p>\n<p>3. portare la gamba sinistra \"ad ore 9\", quanto più largo possibile; la gamba destra è ferma in alto</p>\n<p>4. partendo da posizione base, allargare entrabe le gambe il più possibile (per raggiungere le \"10 e 10\")</p>\n<p>5. gambe piegate a rana e piedi appoggiati al muro (il lato destro del piede destro, per capirci, tocca il muro, viceversa per il sinistro): spingere con le mani in zona ginocchia verso il muro per avvicinarle</p>","name":"Aalex Gambe Alte al Muro","name_original":"Aalex Gambe alte al muro","creation_date":"2015-10-12","uuid":"c6601887-047b-4964-a629-f0b912c838ca","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":174,"license_author":"flori","status":"2","description":"<ul>\n<li>in eine aufrechte Position setzen, bei der die Beine hüftbreit geöffnet sind</li>\n<li>den Rücken, die Knie und die Oberschenkelaußenseite an die jeweiligen Polster pressen</li>\n<li>mit den Händen an den Griffen festhalten</li>\n<li>die Oberschenkel bis zum Anschlagpunkt der Hebelarme auseinander drücken</li>\n<li>danach die Beine wieder zusammen führen</li>\n<li>das Gesäß nicht vom Sitz abheben</li>\n<li>beim Auseinanderdrücken der Hebelarme aus- und beim Zusammenführen einatmen</li>\n</ul>","name":"Abduktoren-Maschine","name_original":"Abduktoren-Maschine","creation_date":"2013-07-19","uuid":"99881bdd-43d7-4c3b-82ed-9c187d0455b7","license":1,"category":9,"language":1,"muscles":[8,6],"muscles_secondary":[11],"equipment":[]},{"id":560,"license_author":"gustavo","status":"1","description":"Get Ripped Abs Get Ripped Abs Get Ripped Abs Get Ripped AbsGet Ripped AbsGet Ripped Abs Get Ripped Absv Get Ripped Abs vGet Ripped AbsGet Ripped AbsGet Ripped AbsGet Ripped Abs","name":"Abs","name_original":"Abs","creation_date":"2018-03-30","uuid":"11fdac20-572c-4d6d-9fc3-78e4298b62b2","license":2,"category":10,"language":4,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":223,"license_author":"Marius","status":"2","description":"<p>Oberschenkel Innenseite!</p>","name":"Adduktoren Maschine","name_original":"Adduktoren Maschine","creation_date":"2014-02-26","uuid":"e56d0a17-b1b8-427d-991e-97c530c7db6a","license":1,"category":9,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":410,"license_author":"spacetowaste","status":"1","description":"<p>Opposite of hollow hold. Lie on stomach with arms and legs extended. See https://www.youtube.com/watch?v=44ScXWFaVBs&amp;feature=youtu.be&amp;t=7m51s</p>","name":"Arch Hold","name_original":"Arch Hold","creation_date":"2016-07-31","uuid":"3ec8f0a8-339b-419f-b03d-f9e215834a63","license":3,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":434,"license_author":"johndoe","status":"1","description":"<p>Hallå du gamle indian, mår du bra?</p>","name":"Armhävning","name_original":"Armhävning","creation_date":"2016-11-13","uuid":"3019297c-7a14-4657-81bc-0a7478c41fb8","license":2,"category":11,"language":10,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":433,"license_author":"johndoe","status":"1","description":"<p>Armhävning, inte så jäkla komplicerat</p>","name":"Armhävning","name_original":"Armhävning","creation_date":"2016-11-13","uuid":"bc9e4d85-d7e5-4194-8489-26fc1560c1d2","license":2,"category":11,"language":10,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":478,"license_author":"admintest123","status":"1","description":"<p>Arms exercise sdfg asdg asf sdfg sdfg sdfgsdf gsdf g sgsdf gsdfg sdfg alk fl;asdf ;ansd;kf na;klsdnfla nsd l;knalksdf adsfadsf a</p>","name":"Arms","name_original":"Arms","creation_date":"2017-08-15","uuid":"a93b478f-9fc4-413d-837d-3676187a457c","license":2,"category":8,"language":2,"muscles":[1,11,8,14,4],"muscles_secondary":[11,12,10],"equipment":[1,8,4]},{"id":228,"license_author":"bloody_disgrace","status":"2","description":"<p>Zwei Kurzhanteln mit den Handflächen nach innen vor der Brust halten, Ellbogen unterhalb der Handgelenke.</p>\n<p>Ellbogen nach außen bringen und Hanteln über den Kopf heben. Drehung kommt aus dem Ellbogen, nicht aus den Armen!</p>\n<p>Wenn die Arme durchgestreckt sind, die gleiche Bewegung rückwärts ausführen.</p>","name":"Arnold Press","name_original":"Arnold Press","creation_date":"2014-03-09","uuid":"880bff63-6798-4ffc-a818-b2a1ccfec0f7","license":3,"category":13,"language":1,"muscles":[2],"muscles_secondary":[3,9,5],"equipment":[3]},{"id":227,"license_author":"trzr23","status":"2","description":"<p>Very common shoulder exercise.</p>\n<p> </p>\n<p>As shown here: https://www.youtube.com/watch?v=vj2w851ZHRM</p>","name":"Arnold Shoulder Press","name_original":"Arnold Shoulder Press","creation_date":"2014-03-09","uuid":"53ca25b3-61d9-4f72-bfdb-492b83484ff5","license":1,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[3]},{"id":352,"license_author":"Tetsuhiko Asai","status":"3","description":"<ol>\n<li>single leg sit and stand</li>\n</ol>","name":"Asai Squad","name_original":"Asai Squad","creation_date":"2015-10-22","uuid":"bad296f4-35a5-4125-ae3f-0187f45945e2","license":2,"category":9,"language":7,"muscles":[10],"muscles_secondary":[8],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=7","previous":"https://wger.de/api/v2/exercise/?page=5","results":[{"id":354,"license_author":"er0355","status":"2","description":"<p>Jump, lay down on your chest, do a pushup then jump, repeat</p>","name":"Burpees","name_original":"Burpees","creation_date":"2015-11-01","uuid":"6335de72-146f-4f38-886d-6b8a27db62ff","license":2,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":98,"license_author":"wger.de","status":"2","description":"<p>Sit on the butterfly machine, the feet have a good contact with the floor, the upper arms are parallel to the floor. Press your arms together till the handles are practically together (but aren't!). Go slowly back. The weights should stay all the time in the air.</p>","name":"Butterfly","name_original":"Butterfly","creation_date":null,"uuid":"3c3857f8-d224-4d5a-8cc1-f4e7982d3475","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[2],"equipment":[]},{"id":30,"license_author":"wger.de","status":"2","description":"<p>Setzte dich auf den Sitz der Butterflymaschine, die Füße sollen dabei guten Kontakt mit dem Boden machen, die Oberarme sind waagerecht zum Boden. Drücke nun die Gewichte zusammen, wobei die Griffe sich nicht berühren sollen. Gehe nun wieder zurück, das Trainingsgewicht darf dabei nicht abgelegt werden.</p>","name":"Butterfly","name_original":"Butterfly","creation_date":null,"uuid":"9df24c6f-016b-4623-8878-f71c235c50fa","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[2],"equipment":[]},{"id":52,"license_author":"wger.de","status":"2","description":"<p>Setzte dich auf den Sitz der Butterflymaschine, die Füße sollen dabei guten Kontakt mit dem Boden machen, die Ellenbogen machen etwa einen Rechten Winkel, die Oberarme sind waagerecht zum Boden. Drücke nun die Gewichte zusammen, wobei die Griffe sich nicht berühren sollen. Gehe nun wieder zurück, das Trainingsgewicht darf dabei nicht abgelegt werden.</p>","name":"Butterfly Eng","name_original":"Butterfly eng","creation_date":null,"uuid":"44b0d79a-5c5b-43df-bf62-3e67148f1c33","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[],"equipment":[]},{"id":99,"license_author":"wger.de","status":"2","description":"<p>The movement is the same as with a regular butterfly, only that the grip is narrow:</p>\n<p>Sit on the butterfly machine, the feet have a good contact with the floor, the upper arms are parallel to the floor. Press your arms together till the handles are practically together (but aren't!). Go slowly back. The weights should stay all the time in the air.</p>","name":"Butterfly Narrow Grip","name_original":"Butterfly narrow grip","creation_date":null,"uuid":"08637e04-d995-4c07-b021-a20f26b6fd97","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[]},{"id":21,"license_author":"wger.de","status":"2","description":"","name":"Butterfly Reverse","name_original":"Butterfly reverse","creation_date":null,"uuid":"605b4a25-bc1d-4604-bd93-c85b2aaf84ae","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":124,"license_author":"wger.de","status":"2","description":"","name":"Butterfly Reverse","name_original":"Butterfly reverse","creation_date":null,"uuid":"8715a96e-c8a2-458a-b023-4ea7d82fdab8","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":207,"license_author":"tuckerm","status":"2","description":"<p>Begin with cables at about shoulder height, one in each hand. Take a step forward so that one foot is in front of the other, for stability, and so that there is tension on the cables. Bring hands together in front of you. Try to make your hands overlap (so that the cables cross) a few inches.</p>","name":"Cable Cross-over","name_original":"Cable cross-over","creation_date":"2014-01-15","uuid":"1b9ed9da-46d1-4484-8acc-236379ee823c","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[]},{"id":265,"license_author":"lauroernesto","status":"2","description":"<p>Steps:</p>\n<ol>\n<li>Start off placing an extension band around a post or in a secure position where it will not release and is at elbow level.</li>\n<li>Position yourself to the side of the band and with your hand that is opposite of the band, reach out and grab the handle.</li>\n<li>Bring the band to your chest keeping your elbow bent in a 90 degree angle then slowly rotate your arm in a backhand motion so that the band externally rotates out</li>\n<li>Continue out as far as possible so that you feel a stretch in your shoulders, hold for a count and then return back to the starting position.</li>\n<li>Repeat for as many reps and sets as desired.</li>\n</ol>","name":"Cable External Rotation","name_original":"Cable External Rotation","creation_date":"2014-07-27","uuid":"a7e15f4f-a7e6-4c0c-9bcb-ef3de90201aa","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":428,"license_author":"exrx.net","status":"1","description":"\nFace high pulley and grasp rope attachment with clinched hands side by side (palms in). Position elbows to side.\n\n\nExtend arms down. Turn palms down at bottom. Return until forearm is close to upper arm and hands are in original position. Repeat.\n","name":"Cable Pushdown (with Rope Attachment)","name_original":"Cable pushdown (with rope attachment)","creation_date":"2016-10-25","uuid":"e34b8c35-ef08-453f-93e9-088a9a7134c2","license":2,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":563,"license_author":"justtestingwger","status":"1","description":"<p>Standard shoulder shrug using the cable system.</p>","name":"Cable Shrug","name_original":"Cable Shrug","creation_date":"2018-04-01","uuid":"df2dc04f-e7e0-4eb9-9db0-efc63f0ba95d","license":2,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":167,"license_author":"robhoyt","status":"2","description":"<p>Set cable pulley slightly lower than chest height. Keep body facing forward with hips stable.  Grab the pulley handle, fully extend your arms and bring your arms forward and across your body. Hold for 1 second at the end of the movement and slowly return to starting position.</p>","name":"Cable Woodchoppers","name_original":"Cable Woodchoppers","creation_date":"2013-06-23","uuid":"c376346a-1923-4468-9320-b0f480c46b1e","license":1,"category":10,"language":2,"muscles":[14],"muscles_secondary":[],"equipment":[]},{"id":308,"license_author":"nate303303","status":"2","description":"<p>Put  the balls of your feet on an extended leg press pad.  Use your calves to press the weight by flexing your feet/toes into a pointed position, and releasing back into a relaxed position.</p>\n<p>This exercise builds mass and strength in the Gastrocnemius and Soleus muscles as well, if not better, than any calf exercise.</p>","name":"Calf Press Using Leg Press Machine","name_original":"Calf Press using Leg Press Machine","creation_date":"2015-02-06","uuid":"074530d6-801a-404b-b3b7-adc207be69be","license":2,"category":14,"language":2,"muscles":[7,15],"muscles_secondary":[],"equipment":[]},{"id":104,"license_author":"wger.de","status":"2","description":"<p>Place yourself on the machine with your back firmly against the backrest, the feet are on the platform for calf raises. Check that the feet are half free and that you can completely stretch the calf muscles down.</p>\n<p>With straight knees pull up your weight as much as you can. Go with a fluid movement down till the calves are completely stretched. Repeat.</p>","name":"Calf Raises on Hackenschmitt Machine","name_original":"Calf raises on Hackenschmitt machine","creation_date":null,"uuid":"e7677699-5e4f-49e6-a645-e8915a203c4d","license":1,"category":14,"language":2,"muscles":[7],"muscles_secondary":[15],"equipment":[]},{"id":290,"license_author":"GrosseHund","status":"1","description":"<p>Place car in neutral (with partner to apply breaks if necessary) and drive with legs to push car</p>","name":"Car Push","name_original":"car push","creation_date":"2014-11-02","uuid":"09961ef0-6dbb-4473-b100-43a9b2ba98f8","license":1,"category":14,"language":2,"muscles":[7,15],"muscles_secondary":[10],"equipment":[]},{"id":490,"license_author":"mujtabaaslam","status":"1","description":"<p>https://www.youtube.com/watch?v=P5SKBRXAR1Q</p>","name":"Cherry Pickers","name_original":"Cherry Pickers","creation_date":"2017-11-04","uuid":"39d9791a-626c-49be-8998-b151e8e4fe94","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[7]},{"id":181,"license_author":"oliser67","status":"2","description":"<p>Like pull-ups but with a reverse grip</p>","name":"Chin-ups","name_original":"Chin-ups","creation_date":"2013-07-24","uuid":"f6c4e2fa-226d-46e8-87dc-75fc8cd628bd","license":1,"category":12,"language":2,"muscles":[1,12],"muscles_secondary":[],"equipment":[6]},{"id":157,"license_author":"Vl2V2sP42RNfDng1zCSZB7fZqlo","status":"1","description":"<p>Pull up</p>","name":"Chin Ups","name_original":"Chin ups","creation_date":"2013-05-17","uuid":"079c2147-1030-4c7d-9cb5-e4f17e7768c8","license":1,"category":12,"language":2,"muscles":[2],"muscles_secondary":[1],"equipment":[]},{"id":437,"license_author":"acarothers","status":"1","description":"<p>Circuit of the 4 exercises</p>\n<ol>\n<li>Pullups x 20 (assisted if needed)</li>\n<li>Pushups x 30</li>\n<li>Crunches x 40</li>\n<li>Air Squats x 50</li>\n</ol>\n<p>Repeat entire circuit 5 times with a 3 min break in between each set</p>","name":"Circuit - Pullups, Pushups, Crunches, Air Squats","name_original":"Circuit - Pullups, Pushups, Crunches, Air Squats","creation_date":"2016-12-09","uuid":"8b7ed43f-461b-48b9-b541-6f028fbca801","license":3,"category":9,"language":2,"muscles":[2,4,10,6],"muscles_secondary":[8],"equipment":[]},{"id":217,"license_author":"tuckerm","status":"2","description":"<p>Perform a typical bench press, but hold the bar with your hands approximately shoulder-width apart and keep your elbows close to your body.</p>","name":"Close-grip Bench Press","name_original":"Close-grip bench press","creation_date":"2014-02-01","uuid":"6cc54626-d5ef-4013-9184-010ac96de20a","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[4],"equipment":[1,8]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=5","previous":"https://wger.de/api/v2/exercise/?page=3","results":[{"id":247,"license_author":"Topi88","status":"1","description":"<p>Klupa</p>","name":"Bendž","name_original":"Bendž","creation_date":"2014-04-12","uuid":"09c5ac50-89cb-4988-8608-8b703e44adb7","license":1,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":268,"license_author":"lakerbeezel","status":"2","description":"<p>Bend over slightly while holding two dumbbells.  Pull the dumbbells up to your chest, keeping your elbows as high as you can.</p>","name":"Bent High Pulls","name_original":"Bent High Pulls","creation_date":"2014-09-01","uuid":"34ce7ec5-12a1-4bf8-b4f1-94544c3f1cfc","license":1,"category":13,"language":2,"muscles":[9],"muscles_secondary":[],"equipment":[3]},{"id":412,"license_author":"warchildmd","status":"2","description":"<ol>\n<li>Holding a barbell with a pronated grip (palms facing down), bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Tip: Make sure that you keep the head up. The barbell should hang directly in front of you as your arms hang perpendicular to the floor and your torso. This is your starting position.</li>\n<li>Now, while keeping the torso stationary, breathe out and lift the barbell to you. Keep the elbows close to the body and only use the forearms to hold the weight. At the top contracted position, squeeze the back muscles and hold for a brief pause.</li>\n<li>Then inhale and slowly lower the barbell back to the starting position.</li>\n<li>Repeat for the recommended amount of repetitions.</li>\n</ol>","name":"Bent Over Barbell Row","name_original":"Bent Over Barbell Row","creation_date":"2016-08-15","uuid":"b8466ace-ebc7-42bb-941c-39e0e7e67a4f","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]},{"id":362,"license_author":"sebk","status":"2","description":"<p>With dumbbells in hand, bend at the hip until hands hang just below the knees (similar to straight-legged-deadlift starting position). Keep upper body angle constant while contracting your lats to pull you ellbows back pinching the shoulder blades at the top. Try not to stand up with every rep, check hands go below knees on every rep.</p>","name":"Bentover Dumbbell Rows","name_original":"Bentover Dumbbell Rows","creation_date":"2016-01-05","uuid":"f866fd75-c18d-4419-84b9-1b9ccd22adba","license":2,"category":12,"language":2,"muscles":[12],"muscles_secondary":[1,11,13],"equipment":[3]},{"id":421,"license_author":"apeschel","status":"2","description":"<p>Sit on bench while holding weights. Bend forward as far as possible, with arms slightly bent at the elbow. Perform a lateral raise while maintaining the bend in your elbow.</p>","name":"Bent-over Lateral Raises","name_original":"Bent-over Lateral Raises","creation_date":"2016-09-29","uuid":"170cc52f-345f-41b3-bdae-8a5e0c9aa449","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[8,3]},{"id":109,"license_author":"wger.de","status":"2","description":"<p>Grab the barbell with a wide grip (slightly more than shoulder wide) and lean forward. Your upper body is not quite parallel to the floor, but forms a slight angle. The chest's out during the whole exercise.</p>\n<p>Pull now the barbell with a fast movement towards your belly button, not further up. Go slowly down to the initial position. Don't swing with your body and keep your arms next to your body.</p>","name":"Bent Over Rowing","name_original":"Bent over rowing","creation_date":null,"uuid":"f82c579e-c069-4dc7-8e36-a3266dfd8e4a","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[2,1],"equipment":[1]},{"id":110,"license_author":"wger.de","status":"2","description":"<p>The same as <em>regular</em> rowing, but holding a reversed grip (your palms pointing forwards):</p>\n<p>Grab the barbell with a wide grIp (slightly more than shoulder wide) and lean forward. Your upper body is not quite parallel to the floor, but forms a slight angle. The chest's out during the whole exercise.</p>\n<p>Pull now the barbell with a fast movement towards your belly button, not further up. Go slowly down to the initial position. Don't swing with your body and keep your arms next to your body.</p>","name":"Bent Over Rowing Reverse","name_original":"Bent over rowing reverse","creation_date":null,"uuid":"77688310-f2cf-4d37-a854-dca906387be7","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[2,1],"equipment":[1]},{"id":507,"license_author":"Bonniechica","status":"1","description":"<p>Liegestütz in der V-Form ausführen, so dass die Schulter trainiert wird</p>","name":"Bergliegestütz","name_original":"Bergliegestütz","creation_date":"2017-11-17","uuid":"89d579b1-9b61-4a5c-a5ad-6070a262c6ac","license":2,"category":13,"language":1,"muscles":[2,13],"muscles_secondary":[4,5],"equipment":[7]},{"id":499,"license_author":"Bonniechica","status":"1","description":"<p>In Plankstellung \" Geh- of. Laufbewegung \" ausführen</p>","name":"Bergsteiger","name_original":"Bergsteiger","creation_date":"2017-11-17","uuid":"3950ec33-c074-451e-b319-74dcb9f75903","license":2,"category":10,"language":1,"muscles":[6],"muscles_secondary":[2,4,5],"equipment":[7]},{"id":482,"license_author":"harsha0116@gmail.com","status":"1","description":"<p>Bicep Curls to max use you bicep to curl weight</p>","name":"Bicep Curls","name_original":"Bicep Curls","creation_date":"2017-09-21","uuid":"854d1e63-962b-452c-9250-95589d2b5b61","license":2,"category":8,"language":2,"muscles":[2,1],"muscles_secondary":[],"equipment":[]},{"id":542,"license_author":"Metin","status":"1","description":"While you rate this No. 1, we give it mixed reviews. The incline bench position increases the stretch on the long head of the biceps, while the neutral grip increases emphasis on the brachioradialis and brachialis. But the \"hammer\" takes some of the tension away from the long head, negating the benefit you gain from sitting at an incline.  Test this yourself by simply placing your right hand on your left biceps. Move your left hand from palm up to palm sideways and you can feel the tension change in your biceps.","name":"Biceps","name_original":"biceps","creation_date":"2018-01-15","uuid":"085a5f5a-cc5e-4064-bada-370bbada46bd","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":74,"license_author":"wger.de","status":"2","description":"<p>Hold the Barbell shoulder-wide, the back is straight, the shoulders slightly back, the arms are streched. Bend the arms, bringing the weight up, with a fast movement. Without pausing, let down the bar with a slow and controlled movement.</p>\n<p>Don't allow your body to swing during the exercise, all work is done by the biceps, which are the only mucles that should move (pay attention to the elbows).</p>","name":"Biceps Curls With Barbell","name_original":"Biceps curls with barbell","creation_date":null,"uuid":"c56078d2-ae85-4524-a467-d1e143b6df1a","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[13],"equipment":[1]},{"id":81,"license_author":"wger.de","status":"2","description":"<p>Hold two barbells, the arms are streched, the hands are on your side, the palms face inwards. Bend the arms and bring the weight with a fast movement up. At the same time, rotate your arms by 90 degrees at the very beginning of the movement. At the highest point, rotate a little the weights further outwards. Without a pause, bring them down, slowly.</p>\n<p>Don't allow your body to swing during the exercise, all work is done by the biceps, which are the only mucles that should move (pay attention to the elbows).</p>","name":"Biceps Curls With Dumbbell","name_original":"Biceps curls with dumbbell","creation_date":null,"uuid":"48a59aa8-4568-409c-8afe-f8cb99c558ea","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[13],"equipment":[3]},{"id":80,"license_author":"wger.de","status":"2","description":"<p>Hold the SZ-bar shoulder-wide, the back is straight, the shoulders slightly back, the arms are streched. Bend the arms, bringing the weight up, with a fast movement. Without pausing, let down the bar with a slow and controlled movement.</p>\n<p>Don't allow your body to swing during the exercise, all work is done by the biceps, which are the only mucles that should move (pay attention to the elbows).</p>","name":"Biceps Curls With SZ-bar","name_original":"Biceps curls with SZ-bar","creation_date":null,"uuid":"38919515-ce04-4383-9c3f-5846edd0e844","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[13],"equipment":[2]},{"id":129,"license_author":"wger.de","status":"2","description":"<p>Stand around 30 - 40cm away from the cable, the feet are firmly on the floor. Take the bar and lift the weight with a fast movements. Lower the weight as with the dumbbell curls slowly and controlled.</p>","name":"Biceps Curl With Cable","name_original":"Biceps curl with cable","creation_date":null,"uuid":"8c6c1544-cbf8-403c-ae12-b27b392702f8","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[],"equipment":[]},{"id":481,"license_author":"lendulado","status":"1","description":"<p>Entrenamiento cardio anterior a los ejercicios</p>","name":"Bicicleta Cardio","name_original":"Bicicleta cardio","creation_date":"2017-09-19","uuid":"135415a2-5b89-4903-bfff-32f8bf0fc39d","license":2,"category":9,"language":4,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":561,"license_author":"gustavo","status":"1","description":"ah system she he dhdhdnsjdndndnd dhdhdnsjdndndnd dude dhdhdnsjdndndnd xhdn","name":"Bigmarms","name_original":"bigmarms","creation_date":"2018-03-31","uuid":"fa8031c1-e1b3-4509-ba26-625a9930b7a3","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[1],"equipment":[3]},{"id":523,"license_author":"amirvahid","status":"1","description":"<p>bike adjasjaf; afahf a;ifh a'f afjha f/af</p>\n<p>af ha'fauf</p>\n<p> af a</p>\n<p>faif</p>\n<p>a fa</p>\n<p>f</p>","name":"Bike Ride","name_original":"bike ride","creation_date":"2017-12-01","uuid":"5d79179d-7057-49ae-ab54-8f2ca6f900c2","license":2,"category":9,"language":2,"muscles":[12,14],"muscles_secondary":[],"equipment":[10]},{"id":524,"license_author":"amirvahid","status":"1","description":"<p>bike adjasjaf; afahf a;ifh a'f afjha f/af</p>\n<p>af ha'fauf</p>\n<p> af a</p>\n<p>faif</p>\n<p>a fa</p>\n<p>f</p>","name":"Bike Ride","name_original":"bike ride","creation_date":"2017-12-01","uuid":"005e257e-386f-4567-975f-ed9caa54e97f","license":2,"category":9,"language":2,"muscles":[12,14],"muscles_secondary":[],"equipment":[10]},{"id":272,"license_author":"colinp23","status":"1","description":"<p>Biking</p>","name":"Biking","name_original":"Biking","creation_date":"2014-09-13","uuid":"bde91b45-f954-4022-b157-90234a88a65d","license":1,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=4","previous":"https://wger.de/api/v2/exercise/?page=2","results":[{"id":259,"license_author":"andikeller","status":"2","description":"<p>Auf Rolle liegend</p>","name":"Bauch Stabilisation","name_original":"Bauch stabilisation","creation_date":"2014-07-10","uuid":"c659577f-d9de-4e39-bcd1-1b0bf1f62d11","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[14],"equipment":[4]},{"id":545,"license_author":"Metin","status":"1","description":"Why it's on the list: This is technically more than a back exercise—it hits the entire posterior chain from your calves to your upper traps—but it's the absolute best for overall backside development. Technique is uber-important with the deadlift, but once you nail it, you can progress to lifting monster weights that will recruit maximum muscle, release muscle-building hormones, and help you get big.","name":"Bdeadlift","name_original":"bdeadlift","creation_date":"2018-01-15","uuid":"d48aefb4-ccc2-4e52-8993-2cc4bb585a7b","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":388,"license_author":"47db224935ff41e6ad927cedea87e1","status":"2","description":"<p>-Rest your weight on your palms and the balls of your feet, not dissimilar to normal pushup position</p>\n<p>-Move by stepping with your R palm and L foot, then your L palm and R foot.  Basically, walk like a lumbering bear.</p>\n<p>-Move as fast as you can.  Measure your reps/sets in either distance (i.e. 40 yards) or time (i.e. 45 seconds)</p>\n<p>-Works your Pecs, Deltoids, Triceps, Traps, Lats, Abs and Lower Back, Hip Flexors, Quads, Glutes and Calves</p>","name":"Bear Walk","name_original":"Bear Walk","creation_date":"2016-02-29","uuid":"79181b05-1429-45be-bc8a-5bf0913d22b9","license":2,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":307,"license_author":"nate303303","status":"2","description":"<p>-Rest your weight on your palms and the balls of your feet, not dissimilar to normal pushup position</p>\n<p>-Move by stepping with your R palm and L foot, then your L palm and R foot.  Basically, walk like a lumbering bear.</p>\n<p>-Move as fast as you can.  Measure your reps/sets in either distance (i.e. 40 yards) or time (i.e. 45 seconds)</p>\n<p>-Works your Pecs, Deltoids, Triceps, Traps, Lats, Abs and Lower Back, Hip Flexors, Quads, Glutes and Calves</p>","name":"Bear Walk","name_original":"Bear Walk","creation_date":"2015-02-06","uuid":"1b8b1657-40fd-4e3b-97b7-1c79b1079f8e","license":2,"category":11,"language":2,"muscles":[2,7,4,6,3,15,5],"muscles_secondary":[8,12,14,10,9],"equipment":[7]},{"id":230,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf die Matte, die Arme sind ausgestreckt und bilden einen rechten Winkel mit dem Körper. Bringe mit etwas Schwung die Beine in eine senkrechte Position. Hebe nun mit einer kontrollierten Bewegung den Becken etwa 5 cm. hoch. und bringe ihn langsam wieder runter. Ohne Pausen wird die Bewegung wiederholt.</p>","name":"Beckenheben","name_original":"Beckenheben","creation_date":"2014-03-09","uuid":"981ef1f0-414a-478b-bc1b-9c6afa45bc77","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[],"equipment":[4]},{"id":22,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf dem Bauch auf die Bank und klemme die Beine unter der Halterung (eher im unteren Wadenbereich ansetzen). Halte dich fest und bringe nun das Gewicht nach oben, in dem du die Beinbizeps zusammenziehst, gehe langsam wieder nach unten. Während der Übung muss der Körper fest bleiben.</p>","name":"Beinbeuger Liegend","name_original":"Beinbeuger liegend","creation_date":null,"uuid":"8f0170a2-5274-4487-a295-1a9baf2c92a3","license":1,"category":9,"language":1,"muscles":[11],"muscles_secondary":[],"equipment":[]},{"id":133,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf das Geräts und schiebe dich so weit nach hinten, bis du die Rückenlehne berührst. Lege deine Beine auf das Polster (verstelle die Höhe so, dass es knapp unter den Waden Kontakt macht). Drücke nun das Gewicht nach unten indem du die Beine beugst, die Fußspitzen sind angespannt und zeigen nach oben (90° Winkel). Bringe dann das Gewicht langsam wieder hoch, strecke aber die Beine nicht komplett aus.</p>","name":"Beinbeuger Sitzend","name_original":"Beinbeuger sitzend","creation_date":null,"uuid":"da7fccca-941e-457a-a2eb-d0c56d419938","license":1,"category":9,"language":1,"muscles":[11],"muscles_secondary":[],"equipment":[]},{"id":72,"license_author":"wger.de","status":"2","description":"<p>Diese Übung wird jeweils mit einem Bein durchgeführt.</p>\n<p>Stelle dich vor der Maschine und stelle deine Waden hinter dem Polster (setzte die Höhe so ein, dass es knapp unter den Waden ansetzt). Beuge nun das Bein bis dein Knie einen rechten Winkel einnimmt, bringe das Gewicht nun langsam und kontrolliert wieder nach unten.</p>","name":"Beinbeuger Stehend","name_original":"Beinbeuger stehend","creation_date":null,"uuid":"9075241c-0493-4f2a-a399-a57e3634093e","license":1,"category":9,"language":1,"muscles":[11],"muscles_secondary":[],"equipment":[]},{"id":35,"license_author":"wger.de","status":"2","description":"<p>Stelle dich mit den Unterarmen fest auf die Polster der Beinhebemaschine, der Körper hängt frei nach unten. Hebe nun die Beine so weit wie möglich nach oben, wobei an der höchsten Stelle eine kurze Pause eingelegt wird. Bringe sie dann langsam und kontrolliert wieder nach unten. Während der Übung darf der Körper nicht mitschwingen, nur die Beine sollten sich hier bewegen.</p>","name":"Beinheben Aufrecht","name_original":"Beinheben aufrecht","creation_date":null,"uuid":"ecff5124-9f6a-414a-b91a-70101847b76d","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[3],"equipment":[]},{"id":280,"license_author":"Konsumopfer","status":"2","description":"<p>Ausgangspostion im Hang, die Beine sind angebhoben (Oberschenkel-Rumpf-Winkel 90°)</p>\n<p>Von hier aus kleine Hebebewegungen ausführen, die Hüftgelenke bleiben in der Endposition gebeugt (90°)</p>","name":"Beinheben im Hang","name_original":"Beinheben im Hang","creation_date":"2014-10-24","uuid":"b85a9224-a562-4924-a0f1-5ead09943c75","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[],"equipment":[6]},{"id":34,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf die Bank und greife mit den Armen die Lehne o.Ä. damit du stabil liegst. Halte die Beine ausgestreckt und hebe sie, bis sie einen Winkel von etwa 45° bilden. Mache eine kleine Pause von ca. 1 sek. und gehe langsam wieder runter. Du kannst zur Steigerung z.B. jedes 5. Mal, eine längere Pause von 7 Sekunden machen.</p>","name":"Beinheben Liegend","name_original":"Beinheben liegend","creation_date":null,"uuid":"342e5889-fee2-420e-a287-f6e5a7f6c4b1","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[3],"equipment":[4]},{"id":6,"license_author":"wger.de","status":"2","description":"<p>In die Maschine setzten und die Füße auf die Auflage stellen, der Abstand, etwas mehr als schulterbreit. Die Füße sind etwas nach außen gedreht.</p>\r\n<p>Das Gewicht wird so weit abgesenkt, dass die Knie einen rechten Winkel machen. Sofort wird das Gewicht nach oben gedrückt. Die Knie zeigen etwas nach außen und werden nie ganz ausgestreckt, die Bewegung bleibt immer flüssig, also weder oben noch unten irgendwelche Pausen einlegen!</p>","name":"Beinpresse","name_original":"Beinpresse","creation_date":null,"uuid":"a27cfdd9-5299-49ab-85f5-6e4042657549","license":1,"category":9,"language":1,"muscles":[10],"muscles_secondary":[8],"equipment":[]},{"id":54,"license_author":"wger.de","status":"2","description":"<p>In die Maschine setzten und die F&uuml;&szlig;e auf die Auflage stellen. Dabei sollte etwa so viel Platz dazwischen bleiben, dass noch ein Fu&szlig; dazwischen Platz h&auml;tte. Die F&uuml;&szlig;e sind wie beim normalen Bankdr&uuml;cken etwas nach au&szlig;en gedreht.</p>\r\n<p>Der Bewegungsablauf ist wie bei bei der breite Beinpresse: das Gewicht wird so weit abgesenkt, dass die Knie einen rechten Winkel machen. Ohne Pause wird dann das Gewicht nach oben gedr&uuml;ckt. Die Knie zeigen etwas nach au&szlig;en und werden nie ganz ausgestreckt, die Bewegung bleibt immer fl&uuml;ssig, also weder oben noch unten irgendwelche Pausen einlegen!</p>","name":"Beinpresse Eng","name_original":"Beinpresse eng","creation_date":null,"uuid":"e7d0cc2d-e28b-479f-91d9-7eab7b686fd8","license":1,"category":9,"language":1,"muscles":[10],"muscles_secondary":[8],"equipment":[]},{"id":39,"license_author":"wger.de","status":"2","description":"<p>Setze dich in die Beinstreckermaschine. Der Rücken soll einen festen Halt haben, stelle die Maschine so ein, dass du fest sitzt. In der Anfangsposition sind die Beine entwas nach hinten angewinkelt. Drücke das Gewicht nach oben bis die Beine nahezu vollständig ausgestreckt sind. Gehe langsam und kontrolliert wieder runter.</p>","name":"Beinstrecker","name_original":"Beinstrecker","creation_date":null,"uuid":"a07629b2-a422-4da0-b70a-810fa203bf12","license":1,"category":9,"language":1,"muscles":[10],"muscles_secondary":[],"equipment":[]},{"id":69,"license_author":"wger.de","status":"2","description":"<p>Der Bewegungsablauf ist wie beim beidbeinigem Beinstrecker:</p>\r\n<p>Setze dich in die Beinstreckermaschine. Der Rücken soll einen festen Halt haben, stelle die Maschine so ein, dass du fest sitzt. In der Anfangsposition sind die Beine entwas nach hinten angewinkelt. Drücke das Gewicht nach oben bis die Beine nahezu vollständig ausgestreckt sind. Gehe langsam und kontrolliert wieder runter.</p>","name":"Beinstrecker Einbeinig","name_original":"Beinstrecker einbeinig","creation_date":null,"uuid":"71efbc60-c301-453e-8ac7-4184b16a4681","license":1,"category":9,"language":1,"muscles":[10],"muscles_secondary":[],"equipment":[]},{"id":529,"license_author":"GageThomas","status":"1","description":"lift stuff bro\nand keep going\nand keep going\nand keep going\nand keep going","name":"BenchPress","name_original":"BenchPress","creation_date":"2017-12-07","uuid":"328074ec-db82-4594-8a9c-962a18fdeaaf","license":2,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[8]},{"id":192,"license_author":"sistab2","status":"2","description":"<p>Lay down on a bench, the bar should be directly above your eyes, the knees are somewhat angled and the feet are firmly on the floor. Concentrate, breath deeply and grab the bar more than shoulder wide. Bring it slowly down till it briefly touches your chest at the height of your nipples. Push the bar up.</p>\n<p>If you train with a high weight it is advisable to have a <em>spotter</em> that can help you up if you can't lift the weight on your own.</p>\n<p>With the width of the grip you can also control which part of the chest is trained more:</p>\n<ul>\n<li>wide grip: outer chest muscles</li>\n<li>narrow grip: inner chest muscles and triceps</li>\n</ul>","name":"Bench Press","name_original":"Bench Press","creation_date":"2013-08-11","uuid":"5da6340b-22ec-4c1b-a443-eef2f59f92f0","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[1],"equipment":[1,8]},{"id":559,"license_author":"gustavo","status":"1","description":"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc at mauris scelerisque, luctus ipsum eu, rutrum dolor. Proin eleifend velit lorem, vel eleifend libero cursus nec","name":"Bench Press","name_original":"Bench Press","creation_date":"2018-03-29","uuid":"2e157bf9-4fb7-4a91-a2ad-d61c67a72a2c","license":1,"category":11,"language":4,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":97,"license_author":"wger.de","status":"2","description":"<p>The movement is very similar to benchpressing with a barbell, however, the weight is brought down to the chest at a lower point.</p>\n<p>Hold two dumbbells and lay down on a bench. Hold the weights next to the chest, at the height of your nipples and press them up till the arms are stretched. Let the weight slowly and controlled down.</p>","name":"Benchpress Dumbbells","name_original":"Benchpress dumbbells","creation_date":null,"uuid":"0ec76f5d-1311-4d6d-bf79-00fa17c3061a","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[2,5],"equipment":[8,3]},{"id":88,"license_author":"wger.de","status":"2","description":"<p>Lay down on a bench, the bar is directly over your eyes, the knees form a slight angle and the feet are firmly on the ground. Hold the bar with a narrow grip (around 20cm.). Lead the weight slowly down till the arms are parallel to the floor (elbow: right angle), press then the bar up. When bringing the bar down, don't let it down on your nipples as with the regular bench pressing, but somewhat lower.</p>","name":"Bench Press Narrow Grip","name_original":"Bench press narrow grip","creation_date":null,"uuid":"03d821e7-e1ac-4026-903b-d406381cbf76","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[2,4],"equipment":[1,8]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=3","previous":"https://wger.de/api/v2/exercise/","results":[{"id":353,"license_author":"Tetsuhiko Asai","status":"2","description":"<ol>\n<li>single leg sit and stand</li>\n</ol>","name":"Asai Squad","name_original":"Asai Squad","creation_date":"2015-10-22","uuid":"583281c7-2362-48e7-95d5-8fd6c455e0fb","license":2,"category":9,"language":7,"muscles":[10],"muscles_secondary":[8],"equipment":[]},{"id":5,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Ausfallschritte im Gehen","name_original":"Ausfallschritte im Gehen","creation_date":null,"uuid":"5675ae61-6597-4806-ae5c-2dda5a5ac03c","license":1,"category":9,"language":1,"muscles":[8,10],"muscles_secondary":[],"equipment":[3]},{"id":55,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Ausfallschritte Stehend","name_original":"Ausfallschritte stehend","creation_date":null,"uuid":"27301836-ed7f-4510-83e7-66c0b8041a44","license":1,"category":9,"language":1,"muscles":[8,10],"muscles_secondary":[],"equipment":[3]},{"id":135,"license_author":"wger.de","status":"2","description":"","name":"Ausfallschritt Trizepsdrücken ü. Kopf, ß-Stange","name_original":"Ausfallschritt Trizepsdrücken ü. Kopf, ß-Stange","creation_date":null,"uuid":"c8d08cbd-d406-4ce0-b1b9-10b236272d30","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":574,"license_author":"samjunior","status":"1","description":"<p>This is one awesome exercise for working out your muscle , you probably want to try this most of the time</p>","name":"Awesome","name_original":"Awesome","creation_date":"2018-05-11","uuid":"efbb5a50-198f-482d-9842-1c12737fd2f5","license":2,"category":10,"language":2,"muscles":[2,8,10,3],"muscles_secondary":[11,7,12],"equipment":[8,4]},{"id":572,"license_author":"hojhll","status":"1","description":"<p>This is one of the best stuff around here , y'all shouold come and taste or even test it, just aesome </p>","name":"Awesome","name_original":"awesome","creation_date":"2018-05-10","uuid":"34d1ff08-4c68-4256-8554-2eb7fd399917","license":2,"category":10,"language":2,"muscles":[1],"muscles_secondary":[],"equipment":[]},{"id":573,"license_author":"hojhll","status":"1","description":"<p>This is one of the best stuff around here , y'all shouold come and taste or even test it, just aesome </p>","name":"Awesome","name_original":"awesome","creation_date":"2018-05-10","uuid":"36c9e74f-f6e3-4e06-9f89-c3b24c8f6694","license":2,"category":10,"language":2,"muscles":[1],"muscles_secondary":[],"equipment":[]},{"id":289,"license_author":"GrosseHund","status":"2","description":"<p>Grab dumbbells and extend arms to side and hold as long as you can</p>","name":"Axe Hold","name_original":"axe hold","creation_date":"2014-11-02","uuid":"6add5973-86d0-4543-928a-6bb8b3f34efc","license":1,"category":8,"language":2,"muscles":[2,9],"muscles_secondary":[9],"equipment":[3]},{"id":473,"license_author":"sthorn","status":"1","description":"<p>Perform eveyday.  90 minute wokout.  </p>","name":"Back, Shoulder, And Leg Stretching.","name_original":"Back, shoulder, and leg stretching.","creation_date":"2017-07-13","uuid":"d7562a07-c9d4-4b03-9724-4ff7d754c980","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[4]},{"id":38,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf die Bank, die Stange direkt über die Augen, die Knie etwas angewinkelt und die Füße fest auf dem Boden. Greife nun die Stange mit einem engen Griff (nicht mehr als 20cm.). Führe nun das Gewicht so weit nach unten, bis die Oberarme paralell zum Boden sind, gehe dann wieder nach obern. Bringe die Stange nicht wie beim (breiten) Bankdrücken auf Brusthöhe runter, sondern weiter unten. Auf der tiefsten Stelle sollten deine Arme einen rechten Winkel machen.</p>","name":"Bankdrücken Eng","name_original":"Bankdrücken eng","creation_date":null,"uuid":"4def60e7-ed8d-4a9d-bf76-ceb15ecf9779","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[2,4],"equipment":[1]},{"id":77,"license_author":"wger.de","status":"2","description":"<p>Der Bewegungsablauf ist ähnlich zur Übung mit einer Langhantel.</p>\n<p>Nehme die Gewichte in die Hände und lege dich auf die Bank. Halte die Hanteln neben der Brust auf Brustwarzenhöhe und drücke sie nun nach oben, bis die Arme ausgestreckt sind. Lasse die Gewichte nun langsam und kontrolliert runter.</p>\n<p> </p>","name":"Bankdrücken KH","name_original":"Bankdrücken KH","creation_date":null,"uuid":"06450bcb-03a8-4bd7-8349-ef677ee57ea3","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[2,5],"equipment":[8,3]},{"id":15,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf die Bank, die Stange direkt über die Augen, die Knie etwas angewinkelt und die Füße fest auf dem Boden. Greife die Stange breit und lasse sie langsam und kontrolliert runter, dabei sollte die Stange kurz auf Brustwarzenhöhe den Körper berühren. Dann das Gewicht wieder hochdrücken bis die Arme durchgestreckt sind.</p>\n<p>Bei hohem Gewicht, empfielt sich natürlich einen <em>Spotter</em> zu haben, der einen hilft falls man die Stange nicht alleine hochdrücken kann.</p>\n<p>Mit der Breite des Griffs kann außerdem kontrolliert werden, welcher Bereich der Brust stärker belastet wird:</p>\n<ul>\n<li>breiter Griff: äußere Brustmuskeln</li>\n<li>enger Griff: innere Brustmuskeln und Trizeps</li>\n</ul>","name":"Bankdrücken LH","name_original":"Bankdrücken LH","creation_date":null,"uuid":"198dcb2e-e35f-4b69-ae8b-e1124d438eae","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[2,5],"equipment":[1,8]},{"id":343,"license_author":"sevae","status":"2","description":"<p>Place a barbell on the floor at your feet.</p>\n<p>Bending at the waist, grip the barbell with a shoulder with overhand grip.</p>\n<p>With a slow controlled motion, roll the bar out so that your back is straight.</p>\n<p>Roll back up raising your hips and butt as you return to the starting position.</p>","name":"Barbell Ab Rollout","name_original":"Barbell Ab Rollout","creation_date":"2015-07-27","uuid":"1b9dc5bc-790b-4e21-a55d-f8b3115e94c5","license":2,"category":10,"language":2,"muscles":[14,6],"muscles_secondary":[2,12],"equipment":[1]},{"id":407,"license_author":"BePieToday","status":"2","description":"<p>Perform leg squats with barbell behind your legs</p>","name":"Barbell Hack Squats","name_original":"Barbell Hack Squats","creation_date":"2016-07-30","uuid":"1215dad0-b7e0-42c6-80d4-112f69acb68a","license":2,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8],"equipment":[1]},{"id":461,"license_author":"exrx.net","status":"1","description":"<p><strong>Preparation</strong></p>\n<p> </p>\n\nSit on floor with long side of bench behind back. Roll barbell back and center over hips. Position upper back on corner of bench. Place feet on floor approximately shoulder width with knees bent. Grasp bar to each side.\n\n<p> </p>\n<p><strong>Execution</strong></p>\n<p> </p>\n\nRaise bar upward by extending hips until straight. Lower and repeat.\n","name":"Barbell Hip Thrust","name_original":"Barbell Hip Thrust","creation_date":"2017-04-15","uuid":"c96debf3-b245-48f4-977f-b8f79e2b0895","license":2,"category":9,"language":2,"muscles":[8],"muscles_secondary":[11,14,10,6],"equipment":[1]},{"id":405,"license_author":"Mikko Ruohola","status":"2","description":"<p>Put barbell on the back of your shoulders. Stand upright, then take the first step forward. Step should bring you forward so that your supporting legs knee can touch the floor. Then stand back up and repeat with the other leg.</p>\n<p>Remember to keep good posture.</p>","name":"Barbell Lunges","name_original":"Barbell Lunges","creation_date":"2016-07-30","uuid":"ae6a6c23-4616-49b7-a152-49d7461c2b7f","license":2,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8],"equipment":[1]},{"id":522,"license_author":"Umar Qattan","status":"1","description":"This is the beset way to do a squat. Just do it and you are good to go","name":"Barbell Squat","name_original":"barbell squat","creation_date":"2017-11-29","uuid":"4e347281-048b-48e8-a8f3-93510e0668cc","license":2,"category":8,"language":2,"muscles":[2,1],"muscles_secondary":[9],"equipment":[3]},{"id":344,"license_author":"sevae","status":"2","description":"<p>Position barbell overhead with narrow overhand grip.</p>\n<p>Lower forearm behind upper arm with elbows remaining overhead. Extend forearm overhead. Lower and repeat.</p>","name":"Barbell Triceps Extension","name_original":"Barbell Triceps Extension","creation_date":"2015-07-27","uuid":"2cd5e256-20a7-4bc8-a7a8-d62bf8ce00cf","license":2,"category":8,"language":2,"muscles":[5],"muscles_secondary":[2,4],"equipment":[1]},{"id":451,"license_author":"Daddy-Beckman","status":"1","description":"<p>With forearms horizontal and stationary, palms up, curl wrists up then return to down position, repeat</p>","name":"Barbell Wrist Curls","name_original":"Barbell Wrist Curls","creation_date":"2017-02-21","uuid":"7d81842a-2a9a-48e6-8445-decd03fc1f46","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]},{"id":494,"license_author":"Bonniechica","status":"1","description":"<p>In Rückenlage Arme und Beine heben. In der Endphase die Bauchmuskeln maximal anspannen und 2 Sekunden halten.</p>","name":"Bauchpresse","name_original":"Bauchpresse","creation_date":"2017-11-17","uuid":"0fb89475-93fe-4b1b-aea6-f8b91931a5de","license":2,"category":10,"language":1,"muscles":[6],"muscles_secondary":[6,3],"equipment":[4]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=8","previous":"https://wger.de/api/v2/exercise/?page=6","results":[{"id":213,"license_author":"tuckerm","status":"2","description":"<p>Grip the pull-down bar with your hands closer than shoulder width apart, with your palms facing away from you. Lean back slightly. Pull the bar down towards your chest, keeping your elbows close to your sides as you come down. Pull your shoulders back at the end of the motion.</p>","name":"Close-grip Lat Pull Down","name_original":"Close-grip lat pull down","creation_date":"2014-02-01","uuid":"42b092ec-80b1-4471-90d1-e462a65ab18c","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":558,"license_author":"franksolis","status":"1","description":"<p>block/spacer betweet the chest and barbel when going down.  touch block and exploed up.</p>","name":"Controlled Bench","name_original":"controlled Bench","creation_date":"2018-03-14","uuid":"39bbb293-3428-4082-a6d7-0b577e7eb51d","license":2,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":301,"license_author":"Firmeza ","status":"1","description":"<p>Frente e verso</p>\n<p> </p>\n<p> </p>","name":"Costas Com Barra de Puxar","name_original":"costas com barra de puxar","creation_date":"2015-01-27","uuid":"d31503f0-7ecb-44e9-ace8-84dc08b94f65","license":2,"category":12,"language":7,"muscles":[],"muscles_secondary":[],"equipment":[6]},{"id":194,"license_author":"powerade69","status":"2","description":"<p>Grasp a moderately weighted dumbbell so your palms are flat against the underside of the top plates and your thumbs are around the bar. Lie on your back across a flat bench so only your upper back and shoulders are in contact with the bench. Your feet should be set about shoulder-width apart and your head should hang slightly downward. With the dumbbell supported at arm's length directly about your chest, bend your arms about 15 degrees and keep them bent throughout the movement. Slowly lower the dumbbell backward and downward in a semicircle arc to as low a position as is comfortably possible. Raise it slowly back along the same arc to the starting point, and repeat for the required number of repetitions.</p>","name":"Cross-Bench Dumbbell Pullovers","name_original":"Cross-Bench Dumbbell Pullovers","creation_date":"2013-08-20","uuid":"122f5dd3-fc8c-47fe-9a79-1c15cf784a60","license":1,"category":11,"language":2,"muscles":[12,4,3],"muscles_secondary":[],"equipment":[]},{"id":470,"license_author":"Zwan","status":"1","description":"<p>Start standing up, put one leg in front of you so you stand on your knee. Twist your core to the same side as your knee. Repeat with the other leg</p>","name":"Crossover Reverse Lunge","name_original":"Crossover Reverse Lunge","creation_date":"2017-05-24","uuid":"f0f21f60-43d9-4e8b-a063-73d61de9e63c","license":2,"category":9,"language":10,"muscles":[],"muscles_secondary":[],"equipment":[7]},{"id":564,"license_author":"hassan","status":"1","description":"<p>This is performed while lying face up on the floor with knees bent, by curling the shoulders up towards the pelvis. This is an isolation exercise for the abdominals.</p>","name":"Crunch","name_original":"Crunch","creation_date":"2018-04-09","uuid":"61ff25de-d17b-43ab-9d64-9e72ca514bda","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":4,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf eine Matte mit angewinkelten Beinen. Die Füße werden irgendwie festgehalten (Partner, Lanhghantel, o.Ä.) und die Hände werden hinter dem Nacken verschränkt. Aus dieser Position führe den Oberkörper so weit nach oben, bis Kopf oder Ellenbogen die angewinkelten Beine berühren.</p>\n<p>Es ist wichtig, dass dieser Vorgang mit einer rollenden Bewegung durchgeführt wird: die Wirbelsäule sollte sich Wirbel für Wirbel von der Matte lösen. Ein Hohlkreuz ist stets zu vermeiden.</p>","name":"Crunches","name_original":"Crunches","creation_date":null,"uuid":"0e10ac9b-ed1d-42c9-b8cc-123c22ccc5d5","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[3],"equipment":[8]},{"id":91,"license_author":"wger.de","status":"2","description":"<p>Lay down on your back a soft surface, the feet are on the floor. Ask a partner or use some other help (barbell, etc.) to keep them fixed, your hands are behind your head. From this position move your upper body up till your head or elbows touch your knees. Do this movement by rolling up your back.</p>","name":"Crunches","name_original":"Crunches","creation_date":null,"uuid":"d325dd5c-6833-41c7-8eea-6b95c4871133","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[3],"equipment":[8,4]},{"id":33,"license_author":"wger.de","status":"2","description":"<p>Nehme das Kabel in die Hand und halte es neben den Schläfen fest. Knie dich nun vor dem Kabelzug mit geradem aber nach vorne gebeugtem Oberkörper hin. Rolle dich mit einer schnellen Bewegung zusammen, die Ellenbogen zeigen zu den Knien. Gehe langsam wieder zur Anfangsposition zurück.</p>","name":"Crunches am Seil","name_original":"Crunches am Seil","creation_date":null,"uuid":"5c47b690-d19f-4523-9c47-47160693eefc","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":51,"license_author":"wger.de","status":"2","description":"\n<p>Ablauf wie bei reguläre Crunches, nur mit zusätzlichem Gewicht an der Maschine.</p>\n<p>Setzte dich hin, beide Füße stabil auf dem Boden. Nehme die Gewichte, Kabel, etc. fest und führe eine rollende Bewegung nach vorn (die Wirbelsäule sollte sich idealerweise Wirbel für Wirbel von der Lehne lösen). Kehre langsam in die Ausgangsposition zurück.</p>\n","name":"Crunches an Maschine","name_original":"Crunches an Maschine","creation_date":null,"uuid":"efbece79-4384-49d1-bb88-e16fcd8de5aa","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":32,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf die Negativbank und fixiere deine Beine. Kreuze deine Arme &uuml;ber die Brust und bringe den Oberk&ouml;rper nach oben, den Kopf dabei nicht nach vorn kippen. Gehe langsam wieder runter. </p>","name":"Crunches an Negativbank","name_original":"Crunches an Negativbank","creation_date":null,"uuid":"f5e98b51-6c0e-4c77-94ec-158210669f6d","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":56,"license_author":"wger.de","status":"2","description":"\n<p>Der Ablauf der Übung ist im Prinzip wie bei den normalen Crunches, nur legst du dich auf eine Schrägbank oder eine andere geeignete Fläche. Stelle sicher, dass du nicht rutschen kannst indem du die Beine über den Rand anwikelst oder sonstwo festhalten kannst. Halte die Hände hinter dem Nacken verschränkt. Aus dieser Position führe den Oberkörper so weit nach oben, bis Kopf oder Ellenbogen die Knie berühren.</p>\n<p>Es ist wichtig, dass dieser Vorgang mit einer rollenden Bewegung durchgeführt wird: die Wirbelsäule sollte sich Wirbel für Wirbel von der Matte lösen. Ein Hohlkreuz ist stets zu vermeiden.</p>\n","name":"Crunches an Schrägbank","name_original":"Crunches an Schrägbank","creation_date":null,"uuid":"6f473716-2fc0-453d-9ab7-70212c1d2f92","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[],"equipment":[9]},{"id":94,"license_author":"wger.de","status":"2","description":"<p>The procedure is very similar as for regular crunches, only with the additional weight of the machine. Sit on the machine, put both feet firmly on the ground. Grab the to the weights, cables, etc. and do a rolling motion forwards (the spine should ideally lose touch vertebra by vertebra). Slowly return to the starting position. </p>","name":"Crunches on Machine","name_original":"Crunches on machine","creation_date":null,"uuid":"6709577b-95ec-4053-a822-d5fe1f753966","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":92,"license_author":"wger.de","status":"2","description":"<p>Take the cable on your hands and hold it next to your temples. Knee down and hold your upper body straight and bend forward. Go down with a fast movement, rolling your back in (your ellbows point to your knees). Once down, go slowly back to the initial position.</p>","name":"Crunches With Cable","name_original":"Crunches with cable","creation_date":null,"uuid":"8d6c13c6-256d-4137-b1c6-b0e817697639","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":416,"license_author":"krisbbb","status":"2","description":"<p>On your back, legs extended straight up, reach toward your toes with your hands and lift your shoulder blades off the ground and back.</p>","name":"Crunches With Legs Up","name_original":"Crunches with Legs Up","creation_date":"2016-09-13","uuid":"6ec0d447-1dfa-40fa-9fad-9a86c222d1a4","license":2,"category":10,"language":2,"muscles":[6],"muscles_secondary":[14],"equipment":[]},{"id":544,"license_author":"Metin","status":"1","description":"Lie on your back, with your hips and knees bent to 90°. Raise both arms toward the ceiling. Pull your lower back to the floor to eliminate the gap. Start by pressing one leg out, and tapping the heel to the floor. \"As you extend one leg, exhale as much as you can, keeping your lower back glued to the floor,\" Dunham says. When you can’t exhale any more, pull your knee back to the starting position. Make this more difficult by holding weight in your hands, or by lowering opposite arm and leg.","name":"Deadbug","name_original":"deadbug","creation_date":"2018-01-15","uuid":"e3c163b4-205e-457f-8b91-68e5c6d6be96","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":543,"license_author":"Metin","status":"1","description":"The core plays a big role in helping you move your limbs while stabilizing your spine—an incredibly important prerequisite for most strength-training exercises,\" Dunham says. The deadbug protects your lower back mid-movement and keeps you from wasting any energy.","name":"Deadbug","name_original":"deadbug","creation_date":"2018-01-15","uuid":"d846f8c6-4f70-46fc-9b65-600081522936","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":541,"license_author":"Metin","status":"1","description":"The core plays a big role in helping you move your limbs while stabilizing your spine—an incredibly important prerequisite for most strength-training exercises,\" Dunham says. The deadbug protects your lower back mid-movement and keeps you from wasting any energy.","name":"Deadbug","name_original":"deadbug","creation_date":"2018-01-15","uuid":"bfca2047-e4a3-41c8-8e16-d815a9c902d3","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":347,"license_author":"2dPREtEZP221u68Akf0JImv5L48","status":"2","description":"<p>Deadhang performed on an edge either with or without added weight (adujst edge or weight to adjust difficulty)</p>","name":"Deadhang","name_original":"Deadhang","creation_date":"2015-08-27","uuid":"8976d255-d7e4-46c7-8079-ca525f0a7d0d","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":105,"license_author":"wger.de","status":"2","description":"<p>Stand firmly, with your feet slightly more than shoulder wide apart. Stand directly behind the bar where it should barely touch your shin, your feet pointing a bit out. Bend down with a straight back, the knees also pointing somewhat out. Grab the bar with a shoulder wide grip, one underhand, one reverse grip.</p>\n<p>Pull the weight up. At the highest point make a slight hollow back and pull the bar back. Hold 1 or 2 seconds that position. Go down, making sure the back is not bent. Once down you can either go back again as soon as the weights touch the floor, or make a pause, depending on the weight.</p>","name":"Deadlifts","name_original":"Deadlifts","creation_date":null,"uuid":"22cca8fc-cfaf-4941-b0f7-faf9f2937c52","license":1,"category":12,"language":2,"muscles":[12,10],"muscles_secondary":[8],"equipment":[1]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=9","previous":"https://wger.de/api/v2/exercise/?page=7","results":[{"id":100,"license_author":"wger.de","status":"2","description":"<p>Lay down on a decline bench, the bar should be directly above your eyes, the knees are somewhat angled and the feet are firmly on the floor. Concentrate, breath deeply and grab the bar more than shoulder wide. Bring it slowly down till it briefly touches your chest at the height of your nipples. Push the bar up.</p>","name":"Decline Bench Press Barbell","name_original":"Decline bench press barbell","creation_date":null,"uuid":"b72ae8d4-ede6-4480-8fc5-7b80e369f7ed","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[1]},{"id":101,"license_author":"wger.de","status":"2","description":"<p>Take two dumbbells and sit on a decline bench, the feet are firmly on the floor, the head is resting the bench. Hold the weights next to the chest, at the height of your nipples and press them up till the arms are stretched. Let the weight slowly and controlled down.</p>","name":"Decline Bench Press Dumbbell","name_original":"Decline bench press dumbbell","creation_date":null,"uuid":"80d318b3-4b8a-41aa-9c6c-0a2a921fe1e6","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[3]},{"id":323,"license_author":"http://www.bodybuilding.com/exercises/detail/view/","status":"1","description":"<ol>\n<li>Lie down on a bench with a barbell resting on your chest. Position your legs so they are secure on the extension of the abdominal bench.</li>\n<li>While inhaling, tighten your abdominals and glutes. Simultaneously curl your torso as you do when performing a sit-up and press the barbell to an overhead position while exhaling. </li>\n<li>Lower your upper body back down to the starting position while bringing the barbell back down to your torso. Remember to breathe in while lowering the body.</li>\n</ol>\n<p>Caution: It is best to have a spotter while performing this exercise so that it is easier to get the barbell and also get rid of it. Also, always start with an empty bar and do not use jerking motions at any time.</p>\n<p> </p>\n<p>Reference: http://www.bodybuilding.com/exercises/detail/view/name/press-sit-up</p>","name":"Decline Press Sit-Up","name_original":"Decline Press Sit-Up","creation_date":"2015-05-02","uuid":"392a531f-f0d6-4f65-b890-63776fc6b053","license":3,"category":10,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[1,8]},{"id":260,"license_author":"aszc","status":"2","description":"<p>With your feet raised approximately 30cm on a platform, align your shoulders, elbows and hands, then perform regular pushups. This emphasises the clavicular fibers of the pectoralis major.</p>","name":"Decline Pushups","name_original":"Decline Pushups","creation_date":"2014-07-12","uuid":"36ef5f12-6f77-4754-a926-39915e4b57a5","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[2,5],"equipment":[7]},{"id":381,"license_author":"bobbyprince89","status":"2","description":"<p>Preparation</p>\n<p>Stand on weight plate, bumper plate, or shallow elevated platform with loaded bar above feet. Squat down and grasp bar with shoulder width or slightly wider overhand or mixed grip.</p>\n<p> </p>\n<p>Execution</p>\n<p>Lift bar by extending hips and knees to full extension. Pull shoulders back at top of lift if rounded. Return weights to floor by bending hips back while allowing knees to bend forward, keeping back straight and knees pointed same direction as feet. Repeat.</p>\n<p> </p>\n<p>Comments</p>\n<p>Throughout lift, keep hips low, shoulders high, arms and back straight. Knees should point same direction as feet throughout movement. Keep bar close to body to improve mechanical leverage. Grip strength and strength endurance often limit ability to perform multiple reps at heavy resistances. Gym chalk, wrist straps, grip work, and mixed grip can be used to enhance grip. Mixed grip indicates one hand holding with overhand grip and other hand holding with underhand grip. Lever barbell jack can be used to lift barbell from floor for easier loading and unloading of weight plates.</p>\n<p>Barbell Deficit Deadlift emphasizes building strength through lowest portion of Deadlift. Target muscle is exercised isometrically. Heavy barbell deadlifts significantly engages Latissmus Dorsi. See Barbell Deficit Deadlift under Gluteus Maximus. Also see Deadlift Analysis.</p>","name":"Deficit Deadlift","name_original":"Deficit Deadlift","creation_date":"2016-02-09","uuid":"83b741dc-fd19-4c85-ac0c-b0388c5838e6","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[11,8,12,6,15],"equipment":[1]},{"id":267,"license_author":"Fergy","status":"1","description":"<p>Depth Jumps</p>\n<p> </p>","name":"Depth Jumps","name_original":"Depth Jumps","creation_date":"2014-08-20","uuid":"6d382d89-e16c-47f9-bf92-57c099f97c40","license":1,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":471,"license_author":"souhailMhd","status":"1","description":"<p>chest test chest test chest test chest test chest test chest test chest test</p>","name":"Developpé Couché","name_original":"developpé couché","creation_date":"2017-06-30","uuid":"bbb6fa72-c998-46fb-8b65-4d196aa903a3","license":1,"category":11,"language":2,"muscles":[4,5],"muscles_secondary":[2,13],"equipment":[1,8]},{"id":329,"license_author":"oboema","status":"2","description":"<p>You sit at the bench press device, back slightly tilted to the back. The bar should be about 20 cm in front of you. Then you push the bar and take it back again, as you would with a bench press.</p>\n<p>In this position you strain your chest muscles a lot less, which is nice if you want to train, but your chest hasn't recovered yet.</p>\n<p>Here's a link to a girl on a machine specialized for this exercise, to give a better description than my failing words above.</p>\n<p>http://www.schnell-online.de/db_imgs/products/img/t-80400.jpg</p>","name":"Diagonal Shoulder Press","name_original":"Diagonal shoulder Press","creation_date":"2015-06-12","uuid":"ee291ad5-2064-4d0a-b252-c715f362e035","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[8]},{"id":82,"license_author":"wger.de","status":"2","description":"<p>Hold onto the bars at a narrow place (if they are not parallel) and press yourself up, but don't stretch the arms completely, so the muscles stay during the whole exercise under tension. Now bend the arms and go down as much as you can, keeping the elbows always pointing back, At this point, you can make a short pause before repeating the movement.</p>","name":"Dips","name_original":"Dips","creation_date":null,"uuid":"22879094-ced4-4bd1-81f2-76fdfeb867e6","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[4,6],"equipment":[]},{"id":29,"license_author":"wger.de","status":"2","description":"<p>Greife die Stangen an einer engen Stelle und drücke dich hoch. Strecke dabei die Arme nicht ganz aus, dann bleiben während des gesamten Bewegungablaufs die Muskeln immer unter Spannung. Beuge nun die Arme und gehe so tief wie möglich runter, die Ellenbogen zeigen nach hinten. Du kannst an dieser Stelle einige Sekunden bleiben, bevor du die Übung weitermachst.</p>","name":"Dips","name_original":"Dips","creation_date":null,"uuid":"41b495fd-562e-4d6e-942a-60dc52d5e194","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[4,6],"equipment":[]},{"id":83,"license_author":"wger.de","status":"2","description":"<p>Put two benches so far appart, that you can hold onto one with your hands and are just able to reach the other with your feet. The legs stay during the exercise completely stretched. With your elbows facing back, bend them as much as you can. Push yourself up, but don't stretch out the arms.</p>","name":"Dips Between Two Benches","name_original":"Dips between two benches","creation_date":null,"uuid":"aa4fcd9b-baee-41cf-b4c5-8462bc43a8be","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[8]},{"id":68,"license_author":"wger.de","status":"2","description":"<p>Stelle zwei Bänke so weit ausernander, dass du die Hände am Rand der einen und du die Füße auf der anderen noch knapp draufstellen kannst. Die Beine bleiben während der Übung ausgestreckt. Beuge nun die Arme und gehe so tief wie möglich runter, die Ellenbogen zeigen nach hinten. Hebe den Körper wieder, achte aber darauf, dass du die Arme nicht ganz austreckst.</p>","name":"Dips Zwischen 2 Bänke","name_original":"Dips zwischen 2 Bänke","creation_date":null,"uuid":"011b956d-33b3-4600-9e42-2e7dcbac9fb5","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[8]},{"id":528,"license_author":"test0001","status":"1","description":"<p>A dragon flag is typically performed lying face-up on a bench or on the ground with your hands grasping a sturdy object behind you for support.</p>\n<p>From here, the objective is to lift your entire body up in a straight line, stacking it vertically over your shoulders, then slowly lower back down until parallel to the ground and repeat.</p>\n<p>The aim is to keep your body straight, so do your best to avoid bending at the hips. Your abs will have to provide extreme stabilization to do so. In fact, you'll also need to engage your lower back, glutes, and other trunk musculature to maintain your form.</p>\n<p>Though the dragon flag emphasizes the abs, it's really a full-body exercise.</p>\n<p>- T-nation</p>","name":"Dragon Flags","name_original":"Dragon Flags","creation_date":"2017-12-03","uuid":"a8422025-90d0-4895-b523-1035fa101b87","license":3,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":364,"license_author":"perteus","status":"2","description":"Cvik se provádí v širším postoji nohou se vzpěračskou činkou na zadech. Po dosednutí na box na chvíli uvolnit nohy a následně výbušně se zvednout.","name":"Dřep do Sedu na Box","name_original":"Dřep do sedu na box","creation_date":"2016-01-13","uuid":"987d4bd5-dfd7-41b3-a51a-54bc9380e9ba","license":2,"category":9,"language":9,"muscles":[10],"muscles_secondary":[8],"equipment":[1]},{"id":287,"license_author":"GrosseHund","status":"1","description":"<p>Grab kettlebell and walk while holding it between legs</p>","name":"Duck Walks","name_original":"duck walks","creation_date":"2014-11-02","uuid":"bfeccc21-e354-4878-b4d3-a9fcaa680fc4","license":1,"category":8,"language":2,"muscles":[1,13,5],"muscles_secondary":[14,6],"equipment":[3]},{"id":275,"license_author":"http://www.exrx.net/WeightExercises/Brachialis/DBC","status":"2","description":"<p>Sit on bench. Grasp dumbbell between feet. Place back of upper arm to inner thigh. Lean into leg to raise elbow slightly.</p>","name":"Dumbbell Concentration Curl","name_original":"Dumbbell Concentration Curl","creation_date":"2014-10-04","uuid":"dfa090e4-77ae-40ed-86c0-4696fe93dcf1","license":1,"category":8,"language":2,"muscles":[13],"muscles_secondary":[1],"equipment":[3]},{"id":300,"license_author":"ataraxie67","status":"2","description":"<p>Grasp dumbbell with both hands at the sides of the upper plates. Hold dumbbell in front of chest, close to torso. Place feet about shoulderwide apart, keep knees slightly bent.</p>\n<p>Squat down until thighs are parallel to floor. Keep back straight, bend and move hips backward to keep knees above feet. Return, keep knees slightly flexed. Repeat.</p>\n<p>Keep bodyweight on heels and look ahead or slightly above to keep back straight.</p>","name":"Dumbbell Goblet Squat","name_original":"Dumbbell Goblet squat","creation_date":"2015-01-08","uuid":"2120f390-4a5f-41bc-9139-045581a3a245","license":2,"category":9,"language":2,"muscles":[10],"muscles_secondary":[],"equipment":[3]},{"id":298,"license_author":"ExRx","status":"2","description":"<p>With elbows back to sides, raise one dumbbell and rotate forearm until forearm is vertical and palm faces shoulder. Lower to original position and repeat with opposite arm. Continue to alternate between sides.</p>","name":"Dumbbell Incline Curl","name_original":"Dumbbell Incline Curl","creation_date":"2015-01-01","uuid":"fa56d30a-7a8f-4084-aa68-46bd52f97959","license":2,"category":8,"language":2,"muscles":[1],"muscles_secondary":[13],"equipment":[3]},{"id":112,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Dumbbell Lunges Standing","name_original":"Dumbbell lunges standing","creation_date":null,"uuid":"587c0052-f2bc-48ca-8af9-415175308901","license":1,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8],"equipment":[3]},{"id":113,"license_author":"wger.de","status":"2","description":"<p>Take two dumbbells in your hands, stand straight, feet about shoulder wide. Take one long step so that the front knee is approximately forming a right angle. The back leg is streched, the knee is low but doesn't touch the ground. \"Complete\" the step by standing up and repeat the movement with the other leg.</p>","name":"Dumbbell Lunges Walking","name_original":"Dumbbell lunges walking","creation_date":null,"uuid":"ffd4ce7e-e14f-49d4-9dc9-dc1362631382","license":1,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8],"equipment":[3]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=10","previous":"https://wger.de/api/v2/exercise/?page=8","results":[{"id":324,"license_author":"http://workouttrends.com/how-to-do-dumbbell-side-b","status":"1","description":"<p>1. Stand straight with shoulders and feet wide apart and hold a dumbbell in your left hand.</p>\n<p>2. Starting position: Place your right hand on your waist.</p>\n<p>3. Now, keep your head and back straight and bend only from your waist to your right.</p>\n<p>4. Inhale, and bend as much as you can and hold for a count of two.</p>\n<p>5. Final position: Get back to the start position, exhale as you do so.</p>\n<p> </p>\n<p>6. Now perform the similar steps bending to your left.</p>\n<p> </p>\n<p>Reference : http://workouttrends.com/how-to-do-dumbbell-side-bends</p>","name":"Dumbbell Side Bends","name_original":"Dumbbell Side Bends","creation_date":"2015-05-02","uuid":"5399f95f-5fb3-4d5f-a60f-9c7a1d2add2b","license":3,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[3]},{"id":87,"license_author":"wger.de","status":"2","description":"","name":"Dumbbells on Scott Machine","name_original":"Dumbbells on scott machine","creation_date":null,"uuid":"d147a6c2-ce64-424b-baf3-4ca841a51512","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[],"equipment":[]},{"id":349,"license_author":"Clegg89","status":"1","description":"<p>Split Squats with Dumbbells: http://www.bodybuilding.com/exercises/detail/view/name/split-squat-with-dumbbells</p>","name":"Dumbbell Split Squat","name_original":"Dumbbell Split Squat","creation_date":"2015-10-11","uuid":"54ea75e7-2187-48f3-8b54-59b9bb1e2910","license":3,"category":9,"language":2,"muscles":[10],"muscles_secondary":[],"equipment":[3]},{"id":274,"license_author":"tuninx","status":"2","description":"<p>Position one dumbbell over head with both hands under inner plate (heart shaped grip).</p>\n<p>With elbows over head, lower forearm behind upper arm by flexing elbows. Flex wrists at bottom to avoid hitting dumbbell on back of neck. Raise dumbbell over head by extending elbows while hyperextending wrists. Return and repeat.</p>","name":"Dumbbell Triceps Extension","name_original":"Dumbbell Triceps Extension","creation_date":"2014-09-26","uuid":"3f7b893e-a089-450f-b8cc-ec3ec17d3bf3","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[2,4],"equipment":[3]},{"id":435,"license_author":"jonfk","status":"1","description":"<p>Romanian Deadlifts with dumbells in each hands instead of a barbell.</p>","name":"Dumbell Romanian Deadlift","name_original":"Dumbell Romanian Deadlift","creation_date":"2016-11-16","uuid":"2f25786e-2b51-49df-b01f-d29c07cf8491","license":3,"category":9,"language":2,"muscles":[],"muscles_secondary":[8],"equipment":[3]},{"id":577,"license_author":"kojack70","status":"1","description":"<p>Bent over dumbell row, leaning on bench</p>","name":"Dumbell Row","name_original":"Dumbell Row","creation_date":"2018-06-05","uuid":"24a20378-7d2e-4a60-8fb3-18b485d236f3","license":2,"category":12,"language":2,"muscles":[12],"muscles_secondary":[1,11],"equipment":[3]},{"id":11,"license_author":"wger.de","status":"2","description":"<p>Nehme eine Flachbank und setze das Knie eines Beines auf ein Ende, das andere Bein ist daneben und leicht angewinkelt. Beuge deinen Oberkörper nach vorn und benutze deine Hand um dich abzustützen. Der Rücken macht einen leichten Hohlkreuz. Greife die Hantel mit der freien Hand und hebe sie eng am Körper entlang (achte auf die Ellenbogen). Bringe sie langsam nach unten und wiederhole die Bewegung sobald du unten angekommen bist. Wechsle danach die Seite.</p>\n<p> </p>","name":"Einarmiges Rudern KH","name_original":"Einarmiges rudern KH","creation_date":null,"uuid":"89e0ea72-fef4-4d6e-b9e0-0085f536e9ee","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[2,1,13],"equipment":[3]},{"id":358,"license_author":"silke","status":"2","description":"<p>Auf einen Bein stehen - und den Po nach hinten führen. Gleichzeitig in die Knie gehen</p>","name":"Einbeinige Kniebeuge (Pistol Squat)","name_original":"Einbeinige Kniebeuge (Pistol Squat)","creation_date":"2016-01-04","uuid":"40a0019e-eaf2-491f-a134-9fdd51121358","license":1,"category":9,"language":1,"muscles":[10],"muscles_secondary":[11,8],"equipment":[7]},{"id":510,"license_author":"Bonniechica","status":"1","description":"<p>Im Vierfüßlerstand im Wechsel das gebeugte Bein heben</p>","name":"Eselstritt","name_original":"Eselstritt","creation_date":"2017-11-17","uuid":"631eb92c-82ba-4362-a003-e5450eee16f1","license":2,"category":9,"language":1,"muscles":[8],"muscles_secondary":[6,5],"equipment":[7]},{"id":484,"license_author":"INstruc A","status":"1","description":"<p>sdfdsdsdsdf</p>\n<p>dfsdfdf</p>\n<p>sdf</p>\n<p>sdf</p>","name":"ExerA","name_original":"ExerA","creation_date":"2017-10-01","uuid":"6dff19cf-4ce9-43a4-b373-19b79bdb2593","license":3,"category":11,"language":2,"muscles":[7,9],"muscles_secondary":[15],"equipment":[10]},{"id":414,"license_author":"geantvert","status":"2","description":"<p>En face</p>\n<ol>\n<li>Tirer</li>\n<li>relacher doucement</li>\n</ol>","name":"Extenseurs - Face","name_original":"Extenseurs - Face","creation_date":"2016-09-05","uuid":"6ec02111-96f7-4e66-ad1f-82d102580ed6","license":2,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":394,"license_author":"abeworld","status":"2","description":"<p>Attach a rope to a pulley station set at about chest level.</p>\n<p>Step back so you're supporting the weight with arms completely outstretched and assume a staggered (one foot forward) stance. Bend the knees slightly for a stable base.</p>\n<p>Retract the scapulae (squeeze your partner's finger with your shoulder blades) and pull the center of the rope slightly up towards the face. A good cue is to think about pulling the ends of the rope apart, not just pulling back.</p>\n<p>As you near your face, externally rotate so your knuckles are facing the ceiling.</p>\n<p>Hold for one second at the top position and slowly lower.</p>","name":"Facepull","name_original":"Facepull","creation_date":"2016-04-20","uuid":"659f3fb9-2370-42fb-9c29-9aaf65c7a7de","license":2,"category":13,"language":2,"muscles":[9],"muscles_secondary":[],"equipment":[]},{"id":415,"license_author":"TP-Tobi","status":"2","description":"<p>Die Übung trainiert die Rückseite der Schulter.</p>\n<p>Die Ausführung erfolgt mit dem Seil am Kabelzug. Dabei wird kontrolliert auf das Gesicht zugezogen.</p>","name":"Face Pulls","name_original":"Face Pulls","creation_date":"2016-09-05","uuid":"237c8770-4c1f-433d-b8b4-b1ae5c69bbc5","license":2,"category":12,"language":1,"muscles":[2],"muscles_secondary":[9],"equipment":[]},{"id":286,"license_author":"GrosseHund","status":"1","description":"<p>Grab dumbbells and walk</p>\n<p> </p>","name":"Farmers Walks","name_original":"farmers walks","creation_date":"2014-11-02","uuid":"d7a76292-8d6f-4857-9364-682615d781b4","license":1,"category":8,"language":2,"muscles":[1,11,13],"muscles_secondary":[9],"equipment":[3]},{"id":348,"license_author":"Sench0","status":"1","description":"<p>fentes avant buste droit ( quadriceps ) buste penché ( fessisers )</p>","name":"Fentes Avant","name_original":"Fentes avant","creation_date":"2015-10-10","uuid":"56ab4b97-6819-4f0d-af80-90ee5c87230d","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":509,"license_author":"Bonniechica","status":"1","description":"<p>In Vierfüßlerstand im Wechsel das Bein gebeugt seitwärts anheben</p>","name":"Feuerhydrant","name_original":"Feuerhydrant","creation_date":"2017-11-17","uuid":"52f5c0b6-7b05-48c8-bd0e-5b4bc2fc1c43","license":2,"category":9,"language":1,"muscles":[8],"muscles_secondary":[6,5],"equipment":[7]},{"id":480,"license_author":"KS90","status":"1","description":"1. Position yourself on all fours with shoulders wide apart and palms flat.\n<p>2. Keep your knees, hip wide apart and bend them at a 90-degrees angle.3. Keep your back straight, raise your right thigh and bring it close to your chest as much as you can.4. Then raise the same thigh out to the side by keeping the hips still.5. Now, kick your raised leg slowly in the backward position.6. Now perform these steps with your left leg.</p>","name":"Fire Hydrant","name_original":"Fire Hydrant","creation_date":"2017-09-05","uuid":"97f02715-43e9-44bf-b8a7-4aa0b38a4945","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[7]},{"id":468,"license_author":"xDaphil","status":"1","description":"<p>Die Fliegenden werden an zwei Kabelzügen aufrecht stehend durchgeführt.</p>","name":"Fliegende am Kabel","name_original":"Fliegende am Kabel","creation_date":"2017-05-12","uuid":"ab24ab79-0522-4242-9538-c6f054fa73a2","license":2,"category":11,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":18,"license_author":"wger.de","status":"2","description":"<p>Greife zwei Kurzhanteln und lege dich auf eine Bank und strecke die Arme schulterbreit vollständig aus. Füße, Rücken und Kopf liegen fest auf Boden/Bank und geben Halt. Beuge nun leicht die Arme am Ellenbogengelenk und lasse sie mit einer Halbkreisbewegung seitlich runter. Ohne diesen Winkel zu verändern bringe sie wieder nach oben.</p>","name":"Fliegende KH Flachbank","name_original":"Fliegende KH Flachbank","creation_date":null,"uuid":"c0119734-a412-4f34-91f1-cd1c1177fcb8","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[],"equipment":[8,3]},{"id":73,"license_author":"wger.de","status":"2","description":"<p>Greife zwei Kurzhanteln und lege dich auf eine Schrägbank und strecke die Arme schulterbreit vollständig aus. Füße, Rücken und Kopf liegen fest auf Boden/Bank und geben Halt. Beuge nun leicht die Arme am Ellenbogengelenk und lasse sie mit einer Halbkreisbewegung seitlich runter. Ohne diesen Winkel zu verändern bringe sie wieder nach oben.</p>","name":"Fliegende KH Schrägbank","name_original":"Fliegende KH Schrägbank","creation_date":null,"uuid":"3b34d81d-7882-46a6-bb83-40f84d3f8300","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[],"equipment":[3,9]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=12","previous":"https://wger.de/api/v2/exercise/?page=10","results":[{"id":12,"license_author":"wger.de","status":"2","description":"","name":"Frontziehen Eng","name_original":"Frontziehen eng","creation_date":null,"uuid":"9d4990c5-ae5a-450a-a9ef-0a3e0e7cd469","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[1,13],"equipment":[]},{"id":326,"license_author":"http://www.realsimple.com/health/fitness-exercise/","status":"2","description":"<p>(A) Get in high plank position on your hands and toes.(B) Shift your weight to your left hand as you turn your body to the right; bend your right leg behind you and extend your right arm up. Return to the center and repeat on the opposite side. Continue, alternating sides.<strong>Make it easier:</strong> Don’t raise your arm after you bend your leg behind you.<strong>Make it harder:</strong> Balance with your arm and leg extended for two counts.</p>","name":"Full Sit Outs","name_original":"Full Sit Outs","creation_date":"2015-06-02","uuid":"bf9e572d-d138-43e9-a486-a5c6ad9033f8","license":2,"category":10,"language":2,"muscles":[8,14,6],"muscles_secondary":[],"equipment":[7]},{"id":501,"license_author":"Bonniechica","status":"1","description":"<p>Aus gebückter Haltung in Kniestand und wieder zurück in die gebückte Haltung</p>","name":"Gefangenen Geht up","name_original":"Gefangenen Geht up","creation_date":"2017-11-17","uuid":"009eab81-ce84-4901-b44b-de9d4e5b4f3b","license":2,"category":9,"language":1,"muscles":[8,10],"muscles_secondary":[6,15],"equipment":[7]},{"id":262,"license_author":"MaddieBeasley","status":"1","description":"<p>Glute machine</p>","name":"Glute","name_original":"Glute","creation_date":"2014-07-22","uuid":"5f7df94a-3ffe-4b36-8581-c640380279ba","license":1,"category":12,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":408,"license_author":"tdprice12","status":"2","description":"<p>Lie on you back with your hips and knees flexed, feet on the ground. From this position, raise your butt off of the ground to a height where your body makes a straight line from your knees to your shoulders. To make the exercise more intense, you can add weight by letting a barbell rest on your hips as you complete the motion, or you can put your feet on a slightly higher surface such as a step or a bench.</p>","name":"Glute Bridge","name_original":"Glute Bridge","creation_date":"2016-07-31","uuid":"97ae7d90-a4b2-472c-bf7b-826df674622c","license":2,"category":9,"language":2,"muscles":[8],"muscles_secondary":[11],"equipment":[]},{"id":50,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Good Mornings","name_original":"Good Mornings","creation_date":null,"uuid":"a311a463-f219-4741-b4fb-247013dc8dd8","license":1,"category":12,"language":1,"muscles":[11,8],"muscles_secondary":[],"equipment":[1]},{"id":116,"license_author":"wger.de","status":"2","description":"","name":"Good Mornings","name_original":"Good mornings","creation_date":null,"uuid":"6e862700-3d63-486c-99ae-744c68d2f753","license":1,"category":9,"language":2,"muscles":[11],"muscles_secondary":[],"equipment":[]},{"id":46,"license_author":"wger.de","status":"2","description":"<p>Greife zwei Hanteln, die Handflächen zeigen zum Körper.  Beuge die Arme und brige die Hanteln mit einer schnellen Bewegung nach oben wobei sie im Unterschied zu den normalen KH Curls <strong>nicht</strong> um 90 Grad gedreht werden, die Handflächen zeigen also die ganze Zeit nach innen. Ohne Pause wird das Gewicht nun kontrolliert nach unten gebracht. Beachte, dass die Bewegung nach oben schneller ist als nach unten.</p>\n<p>Während des Bewegungablaufs darf der Körper nicht mitschwingen. Die Ellenbogen bleiben dabei immer an der Stelle.</p>","name":"Hammercurls","name_original":"Hammercurls","creation_date":null,"uuid":"ff454f5a-70ee-40fb-9200-5e7e42960ef0","license":1,"category":8,"language":1,"muscles":[1],"muscles_secondary":[13],"equipment":[3]},{"id":86,"license_author":"wger.de","status":"2","description":"<p>Hold two dumbbells and sit on a bench with a straight back, the shoulders are slightly rolled backwards. Your pals point to your body. Bend the arms and bring the weight up with a fast movement. Don't rotate your hands, as with the curls. Without any pause bring the dumbbell down with a slow, controlled movement.</p>\n<p>Don't swing your body during the exercise, the biceps should do all the work here. The elbows are at your side and don't move.</p>","name":"Hammercurls","name_original":"Hammercurls","creation_date":null,"uuid":"6dcc9adb-939c-4581-9e44-d0d73753997b","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[],"equipment":[3]},{"id":134,"license_author":"wger.de","status":"2","description":"<p>Nehme das Kabel in die Hände (Handflächen parallel, zeigen aufeinander), der Körper steht gerade und ist etwas vom Kabelzug entfernt.</p>\n<p>Beuge nun die Arme und bringe das Kabel mit einer schnellen Bewegung nach oben. Ohne Pause wird das Gewicht nun kontrolliert nach unten gebracht (Arme aber nicht ganz austrecken). Während des Bewegungablaufs darf der Körper nicht mitschwingen. Die Ellenbogen bleiben dabei immer an der Stelle.</p>","name":"Hammercurls am Seil","name_original":"Hammercurls am Seil","creation_date":null,"uuid":"06e9de49-ac1b-45c1-b289-475118932434","license":1,"category":8,"language":1,"muscles":[1],"muscles_secondary":[13],"equipment":[]},{"id":138,"license_author":"wger.de","status":"2","description":"<p>Take a cable in your hands (palms parallel, point to each other), the body is straight. Bend the arms and bring the weight up with a fast movement. Without any pause bring it back down with a slow, controlled movement, but don't stretch completely your arms.</p>\n<p>Don't swing your body during the exercise, the biceps should do all the work here. The elbows are at your side and don't move.</p>","name":"Hammercurls on Cable","name_original":"Hammercurls on cable","creation_date":"2013-05-05","uuid":"5baf40e5-ea3c-4f8d-b60a-d294ee2de55b","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[13],"equipment":[]},{"id":378,"license_author":"http://www.wikifit.de","status":"1","description":"Handgelenk-Beugen mit einer Kurzhantel wird sitzend durchgeführt. Die Unterarme werden dabei auf einer Bank oder den Oberschenkeln abgestützt. Es können beide Unterarme gleichzeitig oder einzeln trainiert werden.\n\nHalte eine Kurzhantel in der Hand, so dass die Handflächen nach oben zeigen. Das Handgelenk ist in der Ausgangsposition nach unten gestreckt.\n\n1. Beim Einatmen das Handgelenk nach oben maximal beugen.\n2. In die Ausgangssituation zurückkehren.\n","name":"Handgelenk-Beugen","name_original":"Handgelenk-Beugen","creation_date":"2016-02-02","uuid":"ec4248f3-5ac7-488c-b16e-8e3ef4c16d35","license":2,"category":8,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[3]},{"id":282,"license_author":"Konsumopfer","status":"2","description":"<p>Im Sitzen Unterarme auf die Oberschenkel, Handrücken nach oben (Obergriff) und dann Kurzhanteln nach oben bewegen.</p>","name":"Handgelenkstreckung","name_original":"Handgelenkstreckung","creation_date":"2014-10-31","uuid":"5afb7241-2eb9-4c9e-aa8f-b0b9bc8a0797","license":1,"category":8,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":317,"license_author":"vince63","status":"2","description":"<p>chrome Hand Flex Grip to build up forearms muscles</p>","name":"Hand Grip","name_original":"Hand Grip","creation_date":"2015-03-07","uuid":"1ec5352f-41da-408b-8e6c-3fef79475847","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":166,"license_author":"robhoyt","status":"2","description":"<p>Hanging from bar or straps, bring legs up with knees extended or flexed</p>","name":"Hanging Leg Raises","name_original":"Hanging Leg Raises","creation_date":"2013-06-22","uuid":"5aab5983-55d6-4d4c-a24e-bc18704f50c5","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":291,"license_author":"GrosseHund","status":"2","description":"<p>Grab two cables stand in the middle so both have tension and hold</p>","name":"Hercules Pillars","name_original":"Hercules pillars","creation_date":"2014-11-02","uuid":"3329b890-685a-475d-b8e5-42362711b445","license":1,"category":8,"language":2,"muscles":[1,13,5],"muscles_secondary":[2],"equipment":[]},{"id":304,"license_author":"nate303303","status":"2","description":"<p>-Start with legs slightly wider than shoulder width</p>\n<p>-Drop into a bodyweight squat</p>\n<p>-As you hit the bottom of the squat, explode upwards into a jump while simultaneously tucking your knees into your chest midflight.  Remain tucked until the apex of your jump.</p>\n<p>-Land on both feet, making sure your knees are not locked so as to avoid excessive strain upon your joints.  Collect yourself into the next rep as quickly but under control as possible.</p>","name":"High Knee Jumps","name_original":"High Knee Jumps","creation_date":"2015-02-06","uuid":"d79e7078-0dd3-4b49-8947-731e6aaa1de0","license":2,"category":9,"language":2,"muscles":[11,7,10,15],"muscles_secondary":[14,6,3],"equipment":[]},{"id":432,"license_author":"BNolet","status":"2","description":"<p>-Start with legs at a comfortable standing width</p>\n<p>-Run in place, bringing knees to or above waist level</p>","name":"High Knees","name_original":"High Knees","creation_date":"2016-11-02","uuid":"e5b6bf59-d933-416e-8228-75c0e7de5dd9","license":3,"category":9,"language":2,"muscles":[7,10,15],"muscles_secondary":[6],"equipment":[]},{"id":164,"license_author":"Mahoney","status":"2","description":"<p>Use a light barbell, perform explosive lift up starting from underneath knee cap level. Lift/raise explosively using hips, at shoulder level. Tempo: 2111</p>","name":"High Pull","name_original":"High pull","creation_date":"2013-06-21","uuid":"a0d1e216-4517-46db-ac4c-fa11686fd513","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[8],"equipment":[]},{"id":255,"license_author":"novadani","status":"2","description":"<p>Interval Sprints</p>\n<p>20 sec Belastung</p>\n<p>30 sec Regen.</p>","name":"HIIT","name_original":"HIIT","creation_date":"2014-06-09","uuid":"5ba12913-759c-4343-aa26-ddd9b64875d4","license":1,"category":9,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=11","previous":"https://wger.de/api/v2/exercise/?page=9","results":[{"id":469,"license_author":"darkserman","status":"1","description":"<p>Como el press de banca, pero en el suelo</p>","name":"Floor Press","name_original":"Floor press","creation_date":"2017-05-17","uuid":"92f4fa8e-02f1-48b1-9bec-c34939b748e2","license":2,"category":11,"language":4,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":303,"license_author":"nate303303","status":"2","description":"<p>-Laying on the back, lift your straightened legs from the ground at a 45 degree angle. </p>\n<p>-As your Left foot travels downward and nearly touches the floor, your Right foot should seek to reach a 90 degree angle, or as close to one as possible.</p>\n<p>-Bring your R foot down until it nearly touches the floor, and bring your L foot upwards.  Maintain leg rigidity throughout the exercise.  Your head should stay off the ground, supported by tightened upper abdominals.</p>\n<p>-(L up R down, L down R up, x2)  ^v, v^, ^v, v^ = 1 rep</p>\n<p>-Primarily works the Rectus Abdominus, the hip flexors and the lower back. Secondarily works the Obliques.  Emphasis placed on the lower quadrant of the abs.</p>\n<p> </p>","name":"Flutter Kicks","name_original":"Flutter Kicks","creation_date":"2015-02-06","uuid":"ce37341b-379c-4611-ac9f-830c6c3c397a","license":2,"category":10,"language":2,"muscles":[14,6],"muscles_secondary":[],"equipment":[]},{"id":122,"license_author":"wger.de","status":"2","description":"","name":"Fly With Cable","name_original":"Fly with cable","creation_date":null,"uuid":"9e672a47-ad9e-4ae1-8fbe-011646da1c37","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[]},{"id":145,"license_author":"wger.de","status":"2","description":"<p>Take two dumbbells and lay on a bench, make sure the feet are firmly on the ground and your back is not arched, but has good contact with the bench. The arms are stretched in front of you, about shoulder wide. Bend now the arms a bit and let them down with a half-circle movement to the side. Without changing the angle of the elbow bring them in a fluid movement back up.</p>","name":"Fly With Dumbbells","name_original":"Fly with dumbbells","creation_date":"2013-05-05","uuid":"754391c6-39d5-4bb6-a311-68a520f6fd3a","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[3]},{"id":146,"license_author":"wger.de","status":"2","description":"<p>The exercise is the same as with a regular bench:</p>\n<p>Take two dumbbells and lay on a bench, make sure the feet are firmly on the ground and your back is not arched, but has good contact with the bench. The arms are stretched in front of you, about shoulder wide. Bend now the arms a bit and let them down with a half-circle movement to the side. Without changing the angle of the elbow bring them in a fluid movement back up.</p>","name":"Fly With Dumbbells, Decline Bench","name_original":"Fly with dumbbells, decline bench","creation_date":"2013-05-05","uuid":"acf1f2df-46c4-49a3-8e6c-2979ea4204b1","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[3]},{"id":431,"license_author":"trungns","status":"1","description":"<p>thay vì là thanh đòn thì bây giờ sẽ là 2 tay cầm , giúp bạn cơ động được nhiều hơn. Bài tập này chúng ta sẽ tập giống như bài Lats Pull Down nhưng thay vì kéo theo phương hơi xéo lên một tí thì bây giờ ở động tác này chúng ta sẽ kéo theo phương thẳng đứng. <strong>Kéo theo nhiều phương sẽ cho chúng ta những kích thích cơ khác nhau</strong>. <em>Đây là một bài tập rất tốt cho phần cơ xô. Khi ngồi vào chúng ta vẫn phải chỉnh ghế sao cho vừa vặn , khi kéo xuống chúng ta cố gắng kéo sao cho 2 tay cầm ra xa nhau một tí, về cách hít thở thì cũng như vậy, khi bắt đầu dùng lực thì vẫn hít vào và khi kết thúc lực sẽ thở ra. Tư thế bắt đầu sẽ là hai tay kẹp vào đầu , khi xuống các bạn ưỡn ngực ra một tí xíu. Các bạn có thể ngả ra một tí xíu nếu bạn thích.</em></p>","name":"Free Weight Lats Pulldown","name_original":"Free Weight Lats Pulldown","creation_date":"2016-10-30","uuid":"5192f90a-56f3-412f-ba50-f80e224f954c","license":2,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":466,"license_author":"xDaphil","status":"1","description":"<p>Als Griff wird ein Seil verwendet.</p>\n<p>Stelle dich mit dem Rücken in Richtung Kabelzug und strecke die Arme über den Kopf. Bei einer Wiederholung werden die Arme an der Armbeuge bis zu 90°. Achte dabei darauf, dass die Arme nicht nach außen Klappen.</p>","name":"Frenchpress am Kabel","name_original":"Frenchpress am Kabel","creation_date":"2017-05-12","uuid":"a54b960c-f4da-4648-ad6f-2a938ced2eba","license":2,"category":8,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":58,"license_author":"wger.de","status":"2","description":"<p>Nehme die Hanteln in die Hand, lege dich auf eine Bank und stelle dich so hin, dass ca. 1/4 des Kopfes nicht mehr auf der Bank liegt. Strecke die Arme aus und lasse nun mit einem Bogen die Gewichte runter. Wenn die Hanteln knapp über die Stirn sind, drücke sie wieder nach oben.</p>\n<p>Es ist wichtig die Ellenbogen während der ganzen Übung wenig zu bewegen, damit die Trizeps die Arbeit machen.</p>","name":"Frenchpress KH","name_original":"Frenchpress KH","creation_date":null,"uuid":"bdf8997a-84ce-434a-ae95-1f9fc50f43bb","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[3]},{"id":85,"license_author":"wger.de","status":"2","description":"<p>Hold the dumbbells and lay down on a flat bench in such a way that around 1/4 of your head is over the edge. Stretch your arms with the weights and bend them so that the dumbbells are lowered (make sure they don't touch each other). Just before they touch your forehead, push them up.</p>\n<p>Pay attention to your elbows and arms: only the triceps are doing the work, the rest of the arms should not move.</p>","name":"French Press (skullcrusher) Dumbbells","name_original":"French press (skullcrusher) dumbbells","creation_date":null,"uuid":"ee00d53e-4482-44aa-b780-bbc570061841","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[8,3]},{"id":84,"license_author":"wger.de","status":"2","description":"<p>Hold the SZ-bar and lay down on a flat bench in such a way that around 1/4 of your head is over the edge. Stretch your arms with the bar and bend them so that the bar is lowered. Just before it touches your forehead, push it up.</p>\n<p>Pay attention to your elbows and arms: only the triceps are doing the work, the rest of the arms should not move.</p>","name":"French Press (skullcrusher) SZ-bar","name_original":"French press (skullcrusher) SZ-bar","creation_date":null,"uuid":"ee4a350b-c681-407f-a414-6ec243809ec7","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[8,2]},{"id":25,"license_author":"wger.de","status":"2","description":"<p>Nehme die Hantel, lege dich auf eine Bank und stelle dich so hin, dass ca. 1/4 des Kopfes nicht mehr auf der Bank liegt. Strecke die Arme aus und lasse nun mit einem Bogen das Gewicht runter. Wenn die Stange knapp über die Stirn ist, drücke sie wieder nach oben.</p>\n<p>Es ist wichtig die Ellenbogen während der ganzen Übung wenig zu bewegen, damit die Trizeps die Arbeit machen.</p>","name":"Frenchpress ß-Stange","name_original":"Frenchpress ß-Stange","creation_date":null,"uuid":"9972e42d-43d8-43c0-b547-4638ca3e47be","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[2]},{"id":19,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf eine Bank, stelle die Lehne fast Senkrecht ein. Nehme zwei Kurzhanteln in die Hände und bringe sie auf Schulterhöhe, die Handflächen und die Ellenbogen zeigen während der Übung nach vorn. Drücke die Hanteln nach oben, achte darauf, dass auf dem höchsten Punkt sie sich zwar sehr nahe kommen, aber nicht berühren. Bringe die Hanteln langsam auf die Ausgangsposition.</p>","name":"Frontdrücken KH","name_original":"Frontdrücken KH","creation_date":null,"uuid":"52f2f6d2-5b7a-4013-b131-ffeb4c515210","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[],"equipment":[8,3]},{"id":153,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf eine Bank, stelle die Lehne fast Senkrecht ein. Greife die Langhantel etwas mehr als Schulterbreit und hebe sie auf Brusthöhe. Drücke sie nun nach oben, strecke die Arme aber nicht vollständig aus. Bringe das Gewicht langsam wieder runter, bis sie wie beim Bankdrücken die Brust kurz berührt.</p>","name":"Frontdrücken LH","name_original":"Frontdrücken LH","creation_date":"2013-05-05","uuid":"47c33837-be38-4ebb-b19a-84c280f5f2b0","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[],"equipment":[1,8]},{"id":66,"license_author":"wger.de","status":"2","description":"<p>Selbe Durchführung wie mit der Langhantel. Setze dich auf eine Bank, stelle die Lehne fast Senkrecht ein. Greife die Stange etwas mehr als Schulterbreit und hebe sie auf Brusthöhe. Drücke sie nun nach oben, strecke die Arme aber nicht vollständig aus. Bringe das Gewicht langsam wieder runter, bis sie wie beim Bankdrücken die Brust kurz berührt.</p>","name":"Frontdrücken MP","name_original":"Frontdrücken MP","creation_date":null,"uuid":"39fe696c-bd08-4a30-954f-7e5ea730dd92","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":65,"license_author":"wger.de","status":"2","description":"<p>Stelle dich mit dem Rücken zum Kabel, halte aber genügend Abstand, dass du es durch die Beine nach oben ziehen kannst. Greife die Stange, strecke die Arme komplett aus und ziehe das Seil hoch, bis sie waagerecht sind. Bringe dann wieder das Gewicht runter.</p>","name":"Frontheben am Kabel","name_original":"Frontheben am Kabel","creation_date":null,"uuid":"ba57a28a-63e3-41ed-8d22-f8dfb2be7b7e","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":221,"license_author":"Marius","status":"2","description":"<p>Eine Gewichtscheibe mit gestreckten Armen von der Höhe der Oberschenkel bis kurz über den Kopf heben. Arme nicht in die Senkrechte bringen, damit der Muskel unter Anspannung bleibt.</p>","name":"Frontheben Mit Scheibe","name_original":"Frontheben mit Scheibe","creation_date":"2014-02-20","uuid":"61deb9d0-ec4c-4fe3-8cc4-c276116b4b95","license":1,"category":13,"language":1,"muscles":[2,9],"muscles_secondary":[],"equipment":[]},{"id":390,"license_author":"Fogu","status":"2","description":"<p>Bei dieser Variante des Kniebeugens werden der Beinbizeps und der Große Gesäßmuskel trainiert.</p>\n<p>Daneben werden die Rückenstrecker und die Abduktoren beansprucht.</p>","name":"Front Kniebeuge","name_original":"Front Kniebeuge","creation_date":"2016-03-24","uuid":"d23d1980-3a50-4d3f-8123-90d7e55c7804","license":2,"category":9,"language":1,"muscles":[11,8,10],"muscles_secondary":[],"equipment":[1]},{"id":233,"license_author":"Manu, wikipedia","status":"2","description":"<p>To execute the exercise, the lifter stands with their feet shoulder width apart and weights or resistance handles held by their side with a pronated (overhand) grip.</p>\n<p>The movement is to bring the arms up in front of the body to eye level and with only a slight bend in the elbow. This isolates the anterior deltoid muscle (front of the shoulder) and uses the anterior deltoid to lift the weight.</p>\n<p>When lifting it is important to keep the body still so the anterior deltoid is fully utilised; if the weight cannot be lifted by standing still then it is too heavy and a lower weight is needed. It is important to keep a slight bend in the elbow when lifting as keeping the elbow locked will add stress to the elbow joint and could cause injury.</p>\n<p>A neutral grip, similar to that used in the hammer curl, can also be used. With this variation the weight is again raised to eye level, but out to a 45 degree angle from the front of the body. This may be beneficial for those with shoulder injuries, particularly those related to the rotator cuff.</p>","name":"Front Raises","name_original":"Front raises","creation_date":"2014-03-24","uuid":"a87de062-2101-4dc4-adda-328b4c722c6d","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[1,3],"equipment":[1,3]},{"id":191,"license_author":"sistab2","status":"2","description":"<p>Squats</p>","name":"Front Squats","name_original":"Front Squats","creation_date":"2013-08-11","uuid":"f2e563d2-507b-4586-88c8-77652cd19648","license":1,"category":9,"language":2,"muscles":[8],"muscles_secondary":[6],"equipment":[1]},{"id":10,"license_author":"wger.de","status":"2","description":"","name":"Frontziehen Breit","name_original":"Frontziehen breit","creation_date":null,"uuid":"793f471c-04ca-4e5c-b73a-d502919a3190","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[2,1,13],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=13","previous":"https://wger.de/api/v2/exercise/?page=11","results":[{"id":376,"license_author":"James Mackay","status":"2","description":"Lying down on your back, with your feet flat on the floor. Raise your hips up evenly as high as you can and hold for as long as you can.","name":"Hip Raise, Lying","name_original":"Hip Raise, Lying","creation_date":"2016-01-23","uuid":"5b12d361-be23-4f61-94af-0cc1665711ca","license":2,"category":12,"language":2,"muscles":[11,8],"muscles_secondary":[12,14,6,9],"equipment":[7]},{"id":567,"license_author":"knippenm11","status":"1","description":"<p>Band at hip, rock back and forth.</p>","name":"Hip Rockers","name_original":"Hip Rockers","creation_date":"2018-05-01","uuid":"2f26e151-03ce-4e6a-8ddb-08e350e8fc1c","license":2,"category":9,"language":2,"muscles":[8,10],"muscles_secondary":[],"equipment":[4]},{"id":571,"license_author":"sophialj","status":"1","description":"<ol>\n<li>Start with your shoulder blades against a bench, and your arms spread across it for stability.  If your shoulders don’t reach the bench, you may need to start with your butt slightly off the floor.  Bend your knees to about 90 degrees, and make sure your feet are flat on the floor.</li>\n<li>Take a big breath in, blow your air out fully, and brace your core.</li>\n<li>Squeeze your glutes, lift up your hips pushing the barbell up. Hold for a second or two.</li>\n<li>Slowly reslease and repeat.</li>\n</ol>","name":"Hip Thrusts","name_original":"Hip Thrusts","creation_date":"2018-05-09","uuid":"479b303d-1c0d-4fa0-9009-7e9b506ead97","license":2,"category":9,"language":2,"muscles":[8],"muscles_secondary":[11],"equipment":[1,8]},{"id":383,"license_author":"Behrooz","status":"2","description":"<p>Get on a mat and lie on your back. Contract your abs, stretch your raise and legs and raise them (your head and shoulders are also be raised). Make sure your lower back remains in contact with the mat.</p>","name":"Hollow Hold","name_original":"Hollow Hold","creation_date":"2016-02-16","uuid":"9910d61d-b5d4-44fe-8b5f-00fa6e2aaf76","license":3,"category":10,"language":2,"muscles":[14,6],"muscles_secondary":[],"equipment":[4,7]},{"id":566,"license_author":"devster","status":"1","description":"<ul>\n<li>Straight body</li>\n<li>Elbows in</li>\n<li>Arms straight at the bottom</li>\n<li>Rings/bar to chest and shoulder blades fully retracted (pinched together) at the top</li>\n<li>Don't let your shoulders shrug up</li>\n</ul>","name":"Horizontal Rows","name_original":"Horizontal Rows","creation_date":"2018-04-16","uuid":"a5db67e8-83ab-46f1-beff-5a56390d786a","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":513,"license_author":"Bonniechica","status":"1","description":"<p>In Rückenlage die Hüfte heben bis der Körper eine Linie bildet</p>","name":"Hüftheben","name_original":"Hüftheben","creation_date":"2017-11-17","uuid":"405cfc83-2006-458d-97f5-a4d2c48b3f33","license":2,"category":12,"language":1,"muscles":[11,8],"muscles_secondary":[7,6],"equipment":[7]},{"id":60,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf das Polster so, dass der Bauchnabel kurz vor der Vorderkante liegt, der Oberkörper hängt frei nach unten. Spanne die gesamte Rückenmuskulatur an, und bringe den Oberkörper nach oben bis er waagerecht ist (nicht höher). Gehe nun langsam wieder nach unten (Muskelanspannung nicht vergessen).</p>","name":"Hyperextensions","name_original":"Hyperextensions","creation_date":null,"uuid":"913d71cc-ba7a-4902-bfa8-3c5203129d72","license":1,"category":12,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":128,"license_author":"wger.de","status":"2","description":"<p>Lay on the hyperextension pad with the belly button just at the leading edge, the upper body can hang freely. Tense your whole back's muscles and bring your upper body up till it is horizontal, but not more. Go slowly down and don't relax your muscles.</p>","name":"Hyperextensions","name_original":"Hyperextensions","creation_date":null,"uuid":"f57a0c60-7d37-4eb3-a94e-1a90292e8c02","license":1,"category":12,"language":2,"muscles":[9],"muscles_secondary":[],"equipment":[]},{"id":463,"license_author":"Joeliiyy","status":"1","description":"<ol>\n<li>Load the bar to an appropriate weight for your training.</li>\n<li>Lay on the bench with your feet flat on the ground, driving through to your hips. Your back should be arched, and your shoulder blades retracted.</li>\n<li>Take a medium, pronated grip covering the rings on the bar. Remove the bar from the rack, holding the weight above your chest with your arms extended. This will be your starting position.</li>\n<li>Lower the bar to the sternum by flexing the elbows. Maintain control and do not bounce the bar off of your chest. Your lats should stay tight and elbows slightly drawn in.</li>\n<li>After touching your torso with the bar, extend the elbows to return the bar to the starting position.</li>\n</ol>","name":"Incline Barbell Bench Press","name_original":"Incline Barbell Bench Press","creation_date":"2017-04-24","uuid":"db79cf4c-2444-4dcb-b090-662584eea46f","license":2,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1,8,9]},{"id":163,"license_author":"Mahoney","status":"2","description":"<p>To do slowly, tempo is 4010</p>","name":"Incline Bench Press","name_original":"Incline Bench Press","creation_date":"2013-06-21","uuid":"6cfd927c-8009-4cc2-9501-acb3db417396","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[5],"equipment":[1,9]},{"id":445,"license_author":"afiestas","status":"1","description":"<p>Simple chest bench machine rotate between chest muscles</p>","name":"Inclined Bench","name_original":"Inclined bench","creation_date":"2017-01-09","uuid":"9a3014dc-63a1-4dad-abbd-3c18f0056187","license":2,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[9]},{"id":444,"license_author":"afiestas","status":"1","description":"<p>Simple chest bench machine rotate between chest muscles</p>","name":"Inclined Bench","name_original":"Inclined bench","creation_date":"2017-01-09","uuid":"c182baa7-568a-4972-8089-7d4c10ad8f94","license":2,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[9]},{"id":206,"license_author":"tuckerm","status":"2","description":"<p>Use inclined bench. Hold dumbbells straight out to your sides, elbows slightly bent. Bring arms together above you, keeping angle of elbows fixed.</p>","name":"Incline Dumbbell Flye","name_original":"Incline dumbbell flye","creation_date":"2014-01-15","uuid":"7327ab51-7073-4c84-9e3f-2e83af40e96c","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[3,9]},{"id":210,"license_author":"tuckerm","status":"2","description":"<ul>\n<li>Bench should be angled anywhere from 30 to 45 degrees</li>\n<li>Be sure to press dumbbells straight upward (perpendicular to the floor)</li>\n</ul>","name":"Incline Dumbbell Press","name_original":"Incline dumbbell press","creation_date":"2014-02-01","uuid":"15c5dfa0-4103-4515-979d-807eee8faa53","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[3,9]},{"id":340,"license_author":"cal.zabel","status":"2","description":"<ol>\n<li>Using a neutral grip, lean into an incline bench.</li>\n<li>Take a dumbbell in each hand with a neutral grip, beginning with the arms straight. This will be your starting position.</li>\n<li>Retract the shoulder blades and flex the elbows to row the dumbbells to your side.</li>\n<li>Pause at the top of the motion, and then return to the starting position.</li>\n</ol>","name":"Incline Dumbbell Row","name_original":"Incline Dumbbell Row","creation_date":"2015-07-21","uuid":"fbbebbfc-a5b2-4573-8914-147ff60cb7c5","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[12],"equipment":[8,3]},{"id":476,"license_author":"Big Mo","status":"1","description":"<ol>\n<li>Load an appropriate weight onto the pins and adjust the seat for your height. The handles should be near the top of the pectorals at the beginning of the motion. Your chest and head should be up and your shoulder blades retracted. This will be your starting position.</li>\n<li>Press the handles forward by extending through the elbow.</li>\n<li>After a brief pause at the top, return the weight just above the start position, keeping tension on the muscles by not returning the weight to the stops until the set is complete.</li>\n</ol>","name":"Incline Machine Chest Press","name_original":"Incline Machine Chest Press","creation_date":"2017-07-31","uuid":"cf9a0cf0-1efc-41ec-9d40-e6e927a94e5c","license":2,"category":11,"language":2,"muscles":[2,4,5],"muscles_secondary":[9],"equipment":[]},{"id":165,"license_author":"Mahoney","status":"2","description":"<p>Perform the plank with legs elevated, feet on a gymball. Once stabilised, slowly move one foot sideways off the ball, then make it touch the floor, then come back to starting position. Alternate with the other foot.</p>\n<p>This is a core exercise.</p>","name":"Incline Plank With Alternate Floor Touch","name_original":"Incline Plank with alternate floor touch","creation_date":"2013-06-21","uuid":"39c416c8-64db-4330-9d37-c41ec70048fb","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[14],"equipment":[]},{"id":168,"license_author":"kwrindy","status":"2","description":"<p>Regular push with a 30 degree incline.</p>","name":"Incline Pushups","name_original":"Incline Pushups","creation_date":"2013-07-01","uuid":"2d728ea9-9e80-4d16-9d6c-801e1e4b4d0b","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[11],"equipment":[]},{"id":338,"license_author":"cal.zabel","status":"2","description":"<p>Assume push-up position, with hands slightly wider than shoulder width.</p>\n<p>Shift body weight as far as possible to one side, allowing the elbow on that side to flex. </p>\n<p>Reverse the motion, moving completely over to the other side.</p>\n<p>Return to the starting position, and repeat for the desired number of repetitions.</p>","name":"Isometric Wipers","name_original":"Isometric Wipers","creation_date":"2015-07-21","uuid":"20b88059-3958-4184-9134-b48656ad868d","license":2,"category":11,"language":2,"muscles":[4],"muscles_secondary":[6],"equipment":[7]},{"id":553,"license_author":"johnflah","status":"1","description":"<p>testing a temp exervcise so this is a minimum of 40 characters to pass</p>","name":"Jazz Cersixe","name_original":"jazz cersixe","creation_date":"2018-03-03","uuid":"a057c0f6-99d9-4b05-940f-7f181e3124e4","license":2,"category":8,"language":2,"muscles":[2],"muscles_secondary":[2],"equipment":[1]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=14","previous":"https://wger.de/api/v2/exercise/?page=12","results":[{"id":423,"license_author":"Papazit","status":"2","description":"<p>Get your shoes on, go outside and start running at a moderate pace.</p>","name":"Jogging","name_original":"Jogging","creation_date":"2016-10-01","uuid":"7277d3bb-e68b-48fb-829e-37e13268f124","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":565,"license_author":"PlayingItCool","status":"1","description":"<p>Jump and extend arms towards head</p>","name":"Jumping Jacks","name_original":"Jumping Jacks","creation_date":"2018-04-14","uuid":"43c170a4-c55e-4099-991c-5835607d4389","license":2,"category":9,"language":2,"muscles":[7,8],"muscles_secondary":[2],"equipment":[]},{"id":71,"license_author":"wger.de","status":"2","description":"","name":"Kabelcross","name_original":"Kabelcross","creation_date":null,"uuid":"9055153b-6151-47e7-a7fc-ab77f5d1a5cd","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[2],"equipment":[]},{"id":251,"license_author":"Susanne Bock","status":"2","description":"<p>Brustmuskulatur</p>\n<p>Hinterer dreieckiger Schultermuskel</p>","name":"Kabelziehen Über Kreuz","name_original":"Kabelziehen über Kreuz","creation_date":"2014-05-10","uuid":"c438efed-81de-42e4-b616-023948acb824","license":1,"category":11,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":252,"license_author":"LOOX","status":"2","description":"<p>-Brustmuskulatur</p>\n<p>-Vorderer dreieckiger Schultermuskel</p>","name":"Kabelziehen Von Unten","name_original":"Kabelziehen von unten","creation_date":"2014-05-10","uuid":"59b210db-aefa-4a50-85a3-71c677cf4414","license":3,"category":11,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":314,"license_author":"schmiddytimes","status":"2","description":"<p>Seilzug auf Oberarmhöhe. Arm angewinkelt. Unterarm vor dem Bauch von innen nach außen drehen, sodass der Griff vom Kabelzug wegbewegt wird.</p>","name":"Kabelzug","name_original":"Kabelzug","creation_date":"2015-03-07","uuid":"801f7f2c-a11a-4881-85c0-6beac7578a72","license":2,"category":13,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":517,"license_author":"dannjager","status":"1","description":"<p>3 RFT</p>\n<p>10 clean &amp; jerk 60kg</p>\n<p>50 wallbals 9kg</p>","name":"Karen Meets Grace","name_original":"karen meets grace","creation_date":"2017-11-28","uuid":"b3293fe7-dc53-401a-8c49-07b88bddc8f5","license":2,"category":13,"language":6,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":483,"license_author":"pat","status":"1","description":"<p>Swing with a Kettlebell with power from your hips </p>","name":"Kettlebell Swing","name_original":"Kettlebell Swing","creation_date":"2017-09-29","uuid":"211f5e38-8c66-403d-956a-469c3f1f5716","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[10]},{"id":249,"license_author":"J120290,cerin","status":"2","description":"<p>Hold the kettlebell securely in both hands. Keep your back flat throughout the move, avoiding any rounding of the spine.Keeping your knees \"soft\", hinge your hips backwards, letting the kettlebell swing between your knees.</p>\n<p>You want to bend from the hips as far as you can <em>without letting your back round forwards</em>. Then, snap your hips forwards quickly and standing up straight, locking your body in an upright posture.</p>\n<p>The speed you do this will cause your arms and the kettlebell to swing up in front of you. Don't try to <em>lift</em> the kettlebell with your arms. The snapping forwards of your hips will cause the kettlebell to swing forwards through momentum. Depending on the weight of the kettlebell and the speed of your hip movement, your arms will swing up to about shoulder height. At the top of this swing, let your hips hinge backwards again as the kettlebell swings back down to between your legs and the start of the next repetition.</p>","name":"Kettlebell Swings","name_original":"Kettlebell Swings","creation_date":"2014-04-18","uuid":"9d1b45e0-0689-411d-915b-5c5e3452e2b0","license":1,"category":9,"language":2,"muscles":[8],"muscles_secondary":[11],"equipment":[]},{"id":28,"license_author":"wger.de","status":"2","description":"<p>Setze dich vor der Scottmaschine, stelle die Höhe so ein, dass die Achselhöhlen auf die Oberkante liegen. Die Oberarme liegen parallel auf der Fläche und bleiben während der Übung auch so. Ziehe die Hanteln so weit wie möglich hoch und bringe sie ohne Pause wieder runter. Strecke dabei die Arme ganz aus.</p>","name":"KH an Scottmaschine","name_original":"KH an Scottmaschine","creation_date":null,"uuid":"d7c553b1-e84d-4dbc-9f6c-05db489b27c8","license":1,"category":8,"language":1,"muscles":[1],"muscles_secondary":[13],"equipment":[3]},{"id":232,"license_author":"wger.de","status":"2","description":"<p>Stelle dich auf einer Bank, wie beim einarmigen KH-rudern: ein Knie und eine Hand auf die Bank, das andere Bein ist auf dem Boden und gibt Halt. Nehme die KH, der Vorderarm macht einen rechten Winkel und zeigt nach unten. Ohne die Ellenbogen zu bewegen, bringe das Gewicht hoch.</p>","name":"Kick-Backs","name_original":"Kick-Backs","creation_date":"2014-03-09","uuid":"ebe60386-bf33-4f50-87a6-d44c5f454158","license":2,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[8,3]},{"id":367,"license_author":"perteus","status":"2","description":"kliky na medicinbalu se provádějí jako klasické cviky. Ruce jsou na medicinbalu. Pro usnadnění může klečet u cvičení, jako u ženských kliků.","name":"Kliky na Medicinbalu","name_original":"Kliky na medicinbalu","creation_date":"2016-01-13","uuid":"e4aaf859-9d7e-4356-b144-2d00a2fcd868","license":2,"category":10,"language":9,"muscles":[4],"muscles_secondary":[12],"equipment":[7]},{"id":36,"license_author":"wger.de","status":"2","description":"<p>Greife die Klimmzugstange mit breitem Griff, der Körper hängt zunächst frei nach unten. Ziehe nun die Brust raus und bringe den Körper nach oben, bis dein Kinn über der Stange liegt (oder der Nacken sie berührt, wenn du <em>nach hinten</em> gezogen hast), gehe nun langsam nach unten und wiederhole.</p>","name":"Klimmzüge","name_original":"Klimmzüge","creation_date":null,"uuid":"4e741c73-d40a-4fad-b0e0-76edd9bbe8df","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[2,1,9],"equipment":[6]},{"id":48,"license_author":"wger.de","status":"2","description":"","name":"Klimmzüge an Maschine","name_original":"Klimmzüge an Maschine","creation_date":null,"uuid":"22897ebe-cf17-44cf-97e6-87566285684d","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[2,1,9],"equipment":[]},{"id":495,"license_author":"Bonniechica","status":"1","description":"<p>Cardio-Übung: auf der Stelle 🏃, als Cross Training mit wechselnden Tempo</p>","name":"Knie Anziehen Stehend","name_original":"Knie anziehen stehend","creation_date":"2017-11-17","uuid":"c3567e4e-20c4-40a5-85ed-282f5774448b","license":2,"category":10,"language":1,"muscles":[14,6],"muscles_secondary":[10],"equipment":[7]},{"id":7,"license_author":"wger.de","status":"2","description":"<p>Stelle die Halterung der Langhantel auf so eine Höhe ein, dass du sie bequem raus- und wieder reinbringen kannst. Bereite dich vor:</p>\n<ul>\n<li>die Stange ist etwas tiefer als Schulterhöhe</li>\n<li>die Füße sind ziemlich auseinander und zeigen leicht nach außen</li>\n<li>der Kopf ist im Nacken und schaut nach vorne/oben.</li>\n<li>die Brust wird nach außen gebracht</li>\n</ul>\n<p>Gehe nun langsam runter, bis der Oberschenkel einen rechten Winkel bildet, nicht tiefer. Die Knie zeigen leicht nach außen, dein Gesäß nach hinten. Mache eine kleine Pause und gehe mit so viel Energie wie du aufbringen kannst, wieder nach oben. Nach 2 Sekunden Pause gehe wieder runter.</p>","name":"Kniebeuge","name_original":"Kniebeuge","creation_date":null,"uuid":"36c27886-b10b-41b6-ac60-f02ee3784041","license":1,"category":9,"language":1,"muscles":[10],"muscles_secondary":[8],"equipment":[1]},{"id":402,"license_author":"wger.de","status":"2","description":"<p>Setze dich in die Maschine und drücke deine Schultern auf das Polster. Deine Füße sind etwa Schulterbreit auseinander und zeigen leicht nach außen. Gehe nun langsam nach unten in die Knie bis sich, wie bei der regulären Kniebeuge, einen Winken von ca. 90° ergibt. Drücke dich wieder nach oben und wiederhole die Bewegung. Wichtig ist hier, dass du die Knie nicht ganz ausstreckst.</p>","name":"Kniebeuge an Hackenschmidtmaschine","name_original":"Kniebeuge an Hackenschmidtmaschine","creation_date":"2016-06-12","uuid":"634dcf89-c346-4af8-8b09-61f238798877","license":2,"category":9,"language":1,"muscles":[8,10],"muscles_secondary":[],"equipment":[]},{"id":200,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Kniebeuge an Multipresse - Eng","name_original":"Kniebeuge an Multipresse - eng","creation_date":"2013-11-09","uuid":"c8acba02-61be-4005-ba4f-028cc21b1565","license":1,"category":9,"language":1,"muscles":[10],"muscles_secondary":[8],"equipment":[]},{"id":9,"license_author":"wger.de","status":"2","description":"<p>Stelle dich mit etwas mehr als schulterbreitem Stand vor der Stange, die Füße zeigen leicht nach außen, die Stange ist direkt darüber und sehr nahe am Schienbein. Beuge die Knie (zeigen ebenfalls etwas nach außen) und neige den Oberkörper (bleibt während der ganzen Übung gerade). Greife die Stange schulterbreit mit einem Unter- und einem Obergriff.</p>\n<p>Ziehe nun die Stange nach oben. An der höchsten Stelle mache ein leichtes Hohlkreuz und drücke die Schultern nach hinten. Gehe wieder runter, wobei du darauf achtest, dass der Rücken gerade bleibt und sich nicht krümmt. Du kannst unten angekommen eine kleine Pause einlegen oder sofort weitermachen.</p>","name":"Kreuzheben","name_original":"Kreuzheben","creation_date":null,"uuid":"521a5e4f-6f35-43e5-9d1c-6e75c4956e96","license":1,"category":12,"language":1,"muscles":[12,10],"muscles_secondary":[8],"equipment":[1]},{"id":546,"license_author":"Brian Alsruhe","status":"1","description":"<p>Placing a barbell in the landmine or in a corner, grasp the head of the barbell besides your body while looking away from the barbell. Twist the barbell as if you were swinging a golf club. Repeat.</p>","name":"Landmine Twists","name_original":"Landmine Twists","creation_date":"2018-01-31","uuid":"e5e17f4e-b5a5-4892-bf91-e7a16bd1684f","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=15","previous":"https://wger.de/api/v2/exercise/?page=13","results":[{"id":148,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Lateral Raises","name_original":"Lateral raises","creation_date":"2013-05-05","uuid":"5345766a-c092-457a-aa21-8ee6ffa855d4","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[3]},{"id":149,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Lateral Raises on Cable, One Armed","name_original":"Lateral raises on cable, one armed","creation_date":"2013-05-05","uuid":"79a3a34c-262f-4cae-b827-b5a85b11b860","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":306,"license_author":"nate303303","status":"2","description":"<p>-(1) Perform a lateral raise, pausing at the top of the lift (2).</p>\n<p>-Instead of lowering the weight, bring it to the front of your body so that you appear to be at the top position of a front raise.  You will do this by using a Pec Fly motion, maintaining straight arms. (3)</p>\n<p>-Now lower the weight to your quadriceps, or, in other words, lower the dumbbells as though you are completing a Front Raise repetition. (4)</p>\n<p>-Reverse the motion:  Perform a front raise (5), at the apex of the lift use a Reverse Fly motion to position the weights at the top of a Lateral Raise (6), and finally, lower the weights until your palms are essentially touching the sides of your thighs (7).  THIS IS ONE REP.</p>\n<p>(1) l  <em>front view  </em>(2) -l- <em> FV  </em>  (3) l-  <em>side view</em>   (4) l  <em>SV/FV</em>   (5) l-  <em>SV  </em> (6) -l-  <em>FV  </em>  (7)  l  <em>FV/SV</em></p>","name":"Lateral-to-Front Raises","name_original":"Lateral-to-Front Raises","creation_date":"2015-02-06","uuid":"aba7ba7a-6ff0-47d4-ab66-8952e21e38c5","license":2,"category":13,"language":2,"muscles":[2,9],"muscles_secondary":[],"equipment":[3]},{"id":158,"license_author":"flori","status":"2","description":"<ul>\n<li>Rücken gerade</li>\n<li>Griffe bis auf Kinnhöhe herunter ziehen</li>\n<li>Arme langsam zurückgehen lassen bis sie fast ausgestreckt sind</li>\n</ul>","name":"Lat Pulldown","name_original":"Lat Pulldown","creation_date":"2013-05-24","uuid":"b78d22f4-b5f8-4789-8e42-07464d82718f","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[1],"equipment":[]},{"id":188,"license_author":"drthurlow","status":"2","description":"<p>Lean Back, Pull into chest</p>","name":"Lat Pull Down (Leaning Back)","name_original":"Lat Pull Down (Leaning back)","creation_date":"2013-08-04","uuid":"dbe77958-51a8-4412-9927-4b24d80ed44f","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":187,"license_author":"drthurlow","status":"2","description":"<p>Pull bar down to strenum and keep straight back.</p>","name":"Lat Pull Down (Straight Back)","name_original":"Lat Pull Down (Straight Back)","creation_date":"2013-08-04","uuid":"1f2d6fd6-bb93-424b-834e-e91dee52dcf3","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":491,"license_author":"Bonniechica","status":"1","description":"<p>In Seitlage den gestreckten Arm über den Kopf führen und mit angespannten Lat in Richtung Taille ziehen.</p>","name":"Lat Übung in Seitlage","name_original":"Lat Übung in Seitlage","creation_date":"2017-11-05","uuid":"2c785d19-730d-4814-9b1a-460bd408117c","license":2,"category":12,"language":1,"muscles":[2,12],"muscles_secondary":[1,3,15,9],"equipment":[3,10]},{"id":226,"license_author":"mhs_79","status":"2","description":"<ul>\n<li>Sie stehen mit leicht gegrätschten Beinen vor dem Gerät und umfassen die Stange in Schulterbreite von oben, die Arme sind getreckt.</li>\n<li>beim Einatmen die Stange bis zu den Oberschenkeln führen, wobei die Arme gesteckt bleiben (die Ellbogen können ganz leicht gebeugt sein)</li>\n<li>Dabei halten Sie den Rücken gerade und spannen die Bauchmuskeln an.</li>\n<li>Am Ende der Bewegung ausatmen</li>\n</ul>","name":"Lat-Ziehen Mit Gesteckten Armen am Seilzug","name_original":"Lat-Ziehen mit gesteckten Armen am Seilzug","creation_date":"2014-03-01","uuid":"0fdc6c45-5212-413a-8a6d-058675afab3b","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":243,"license_author":"Konsumopfer","status":"2","description":"<p>Aufrechte Sitzposition</p>\n<p>Oberkörper leicht nach hinten beugen</p>\n<p>Stange im Obergriff fassen</p>\n<p>Stange vor dem Kopf nach unten zum Brustbein ziehen</p>\n<p>Stange zurückführen, bis Ellenbogen leicht gebeugt</p>","name":"Latzug Breit Zur Brust","name_original":"Latzug breit zur Brust","creation_date":"2014-04-10","uuid":"705adbb9-0f94-4943-9247-64c555c352ca","license":1,"category":12,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":244,"license_author":"Konsumopfer","status":"2","description":"<p>Körper leicht nach hinten geneigt</p>\n<p>kein Hohlkreuz</p>\n<p>Rumpfmuskulatur angespannt</p>\n<p>schulterbreiter Untergriff</p>\n<p>Stange vor dem Kopf auf Brust herunterziehen</p>\n<p>Ellenbogen möglichst eng am Körper</p>\n<p>Stange soweit zurück, dass Ellenbogen leicht gebeugt</p>","name":"Latzug Eng im Untergriff Zur Brust","name_original":"Latzug eng im Untergriff zur Brust","creation_date":"2014-04-11","uuid":"3e7413d3-3105-49da-91cd-b136d63c395b","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[1],"equipment":[]},{"id":154,"license_author":"wger.de","status":"2","description":"<p>Lay on a bench and put your calves behind the leg holder (better if they are hold on around the lower calves). Hold a grip on the bars to make sure the body is firmly in place. Bend your legs bringing the weight up, go slowly back. During the exercise the body should not move, all work is done by the legs.</p>","name":"Leg Curls (laying)","name_original":"Leg curls (laying)","creation_date":"2013-05-08","uuid":"cd4fac32-48fb-4237-a263-a44c5108790a","license":1,"category":9,"language":2,"muscles":[11],"muscles_secondary":[],"equipment":[]},{"id":117,"license_author":"wger.de","status":"2","description":"","name":"Leg Curls (sitting)","name_original":"Leg curls (sitting)","creation_date":null,"uuid":"61950a59-be4e-43cc-abc1-cb52abd15354","license":1,"category":9,"language":2,"muscles":[11],"muscles_secondary":[],"equipment":[]},{"id":118,"license_author":"wger.de","status":"2","description":"","name":"Leg Curls (standing)","name_original":"Leg curls (standing)","creation_date":null,"uuid":"89c98117-dd53-4334-bfa6-72a96525629a","license":1,"category":9,"language":2,"muscles":[11],"muscles_secondary":[],"equipment":[]},{"id":177,"license_author":"kwrindy","status":"2","description":"<p>Seated Leg Extension Machine</p>","name":"Leg Extension","name_original":"Leg Extension","creation_date":"2013-07-19","uuid":"a24a0521-6391-419c-bd89-795bba0eb5ee","license":1,"category":9,"language":2,"muscles":[10],"muscles_secondary":[],"equipment":[]},{"id":115,"license_author":"wger.de","status":"2","description":"<p>The exercise is very similar to the wide leg press:</p>\n<p>Sit on the machine and put your feet on the platform so far apart  that you could just put another foot in between them. The feet are parallel and point up.</p>\n<p>Lower the weight so much, that the knees form a right angle. Push immediately the platform up again, without any pause. When in the lower position, the knees point a bit outwards and the movement should be always fluid.</p>","name":"Leg Presses (narrow)","name_original":"Leg presses (narrow)","creation_date":null,"uuid":"560e1a20-33e1-45db-ba5b-63f8c51af76d","license":1,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8],"equipment":[]},{"id":114,"license_author":"wger.de","status":"2","description":"<p>Sit on the machine and put your feet on the platform, a bit more than shoulder wide. The feet are turned outwards by a few degrees.</p>\n<p>Lower the weight so much, that the knees form a right angle. Push immediately the platform up again, without any pause. When in the lower position, the knees point a bit outwards and the movement should be always fluid.</p>","name":"Leg Presses (wide)","name_original":"Leg presses (wide)","creation_date":null,"uuid":"3caed096-c65e-434d-9792-33db636743e7","license":1,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8],"equipment":[]},{"id":130,"license_author":"wger.de","status":"2","description":"","name":"Leg Press on Hackenschmidt Machine","name_original":"Leg press on hackenschmidt machine","creation_date":null,"uuid":"2966e4a2-4306-4cb5-a2dc-8951cd192555","license":1,"category":9,"language":2,"muscles":[10],"muscles_secondary":[],"equipment":[]},{"id":125,"license_author":"wger.de","status":"2","description":"<p>Lay down on a bench and hold onto the recliner with your hands to keep you stable. Hold your legs straight and lift them till they make an angle of about 45°. Make a short pause of 1 sec. and go slowly down to the initial position. To increase the intensity you can make a longer pause of 7 sec. every 5th time.</p>","name":"Leg Raises, Lying","name_original":"Leg raises, lying","creation_date":null,"uuid":"7c3cc0ce-e335-4f5c-aa32-1576a908a539","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[3],"equipment":[4]},{"id":126,"license_author":"wger.de","status":"2","description":"<p>Put your forearms on the pads on the leg raise machine, the body is hanging freely. Lift now your legs with a fast movement as high as you can, make a short pause of 1sec at the top, and bring them down again. Make sure that during the exercise your body does not swing, only the legs should move.</p>","name":"Leg Raises, Standing","name_original":"Leg raises, standing","creation_date":null,"uuid":"3d8273d2-1fbe-4a8f-99a6-d2b5e204cb41","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[3],"equipment":[]},{"id":211,"license_author":"tuckerm","status":"2","description":"<p>Be sure to adjust seat height so that the handles are towards the bottom of your pectorals.</p>","name":"Leverage Machine Chest Press","name_original":"Leverage machine chest press","creation_date":"2014-02-01","uuid":"a36e5cec-3b9d-4dd5-a3fb-cbcc78a97c3b","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=16","previous":"https://wger.de/api/v2/exercise/?page=14","results":[{"id":214,"license_author":"tuckerm","status":"2","description":"<p>Adjust seat height so that the handles are at the bottom of your pectorals or just below.</p>","name":"Leverage Machine Iso Row","name_original":"Leverage machine iso row","creation_date":"2014-02-01","uuid":"212e98e1-3917-422c-a030-8b312e6b1812","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":281,"license_author":"bizyguy","status":"2","description":"<p>Hold the L position for as long as possible</p>","name":"L Hold","name_original":"L hold","creation_date":"2014-10-30","uuid":"e1881607-9418-4bcc-8c69-2301a579637e","license":1,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":172,"license_author":"flori","status":"2","description":"<p>Ausgangsposition des Liegestütz ist die Bauchlage, der Körper ist gestreckt. Die Hände befinden sich etwas über schulterbreit voneinander entfernt am Boden. Die Finger zeigen nach vorne, die Daumen nach innen. Durch gleichzeitiges Anspannen der Arme werden diese gestreckt und der Oberkörper hebt vom Boden ab. Das Gewicht wird gleichmäßfig auf Zehenspitzen und Händen verteilt. Kopf, Hals, Wirbelsäule, Gesäß und Knie bilden eine Linie und die Bauchmuskulatur ist angespannt. Nun werden beide Arme gleichzeitig gebeugt und der Oberkörper somit abgesenkt, bis die Nasenspitze fast den Boden berührt. Der Körper bleibt dabei gestreckt.</p>\n<ul>\n<li>Der Kopf muss beim Liegestütz in einer Linie mit dem Körper sein, der Blick ist auf den Boden gerichtet.</li>\n<li>Der Kopf darf nicht in den Nacken genommen werden, sonst drohen Zerrungen.</li>\n<li>Der Po sollte weder nach unten durchhängen, noch weit nach oben gestreckt sein. Durch Körperspannung wird eine Hohlkreuzbildung vermieden.</li>\n<li>Um die Brustmuskulatur vollständig zu trainieren, muss die Übung mit größtmöglichen Bewegungsradius durchgeführt werden. Die Trainingswirkung ist intensiver, je tiefer der Oberkörper zum Boden gebracht wird.</li>\n<li>Keine ruckartigen, sondern gleichmäßige Bewegungen durchführen.</li>\n<li>Die Arme werden nicht ganz durchgestreckt sondern bleiben auch in der höchsten Position leicht angewinkelt, um die Spannung in Brust, Schultern und Trizeps konstant zu halten.</li>\n<li>Beim Hochdrüccken ausatmen, beim Absinken einatmen.</li>\n</ul>","name":"Liegestütz","name_original":"Liegestütz","creation_date":"2013-07-18","uuid":"35871103-6cfe-493f-afe1-8401f88fed84","license":1,"category":8,"language":1,"muscles":[2,1,4],"muscles_secondary":[8,10,6,3,9],"equipment":[7]},{"id":295,"license_author":"notdefine","status":"2","description":"<p>Liegestütze mit Händen zusammen. Die Hände werden so nebeneinander gelegt, das Daumen und Zeigefinger eine Raute (Diamant) bilden</p>","name":"Liegestüzten Diamond","name_original":"Liegestüzten Diamond","creation_date":"2014-12-21","uuid":"ec1db965-6315-438c-84dd-d52677e65c62","license":2,"category":11,"language":1,"muscles":[4],"muscles_secondary":[5],"equipment":[7]},{"id":380,"license_author":"Photo of machine user information","status":"1","description":"Seated calf extension machine by LifeFitness","name":"LifeFitness Calf Extension Machine","name_original":"LifeFitness Calf Extension machine","creation_date":"2016-02-06","uuid":"9fadff1d-bab4-4c84-812c-737dd69ffc0f","license":2,"category":14,"language":2,"muscles":[7],"muscles_secondary":[15],"equipment":[]},{"id":438,"license_author":"Limbert","status":"1","description":"<p>Lay down on a bench, the bar should be directly above your eyes, the knees are somewhat angled and the feet are firmly on the floor. Concentrate, breath deeply and grab the bar more than shoulder wide. Bring it slowly down till it briefly touches your chest at the height of your nipples. Push the bar up.</p>\n<p>If you train with a high weight it is advisable to have a <em>spotter</em> that can help you up if you can't lift the weight on your own.</p>\n<p>With the width of the grip you can also control which part of the chest is trained more:</p>\n<ul>\n<li>wide grip: outer chest muscles</li>\n<li>narrow grip: inner chest muscles and triceps</li>\n<li>Don't stretch your arms completly</li>\n</ul>","name":"Limbert","name_original":"Limbert","creation_date":"2016-12-15","uuid":"35d51ae3-0549-45aa-9a48-016cb84d4060","license":2,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":37,"license_author":"wger.de","status":"2","description":"<p>Setze dich hin, stelle die F&uuml;&szlig;e auf die St&uuml;tzstellen ab und greife die Stange mit breitem Griff. Ziehe nun die H&auml;nde auf den Nabel, nicht h&ouml;her. Dabei sollten die Arme nahe am K&ouml;rper bleiben und die Schultern so weit wie m&ouml;glich zusammengezogen werden. Lasse langsam und kontrolliert das Gewicht wieder nach vorne bis die Arme vollst&auml;ndig ausgestreckt sind.</p>","name":"Long-Pulley","name_original":"Long-Pulley","creation_date":null,"uuid":"91fa0487-b137-4bef-86cf-39816cd5ee48","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[1,13],"equipment":[]},{"id":136,"license_author":"wger.de","status":"2","description":"<p>Der Bewegungsablauf ist wie der vom Long-Pulley mit breitem Griff.</p>\r\n<p>Setze dich hin, stelle die F&uuml;&szlig;e auf die St&uuml;tzstellen ab und greife die Stange. Ziehe nun die H&auml;nde auf den Nabel, nicht h&ouml;her. Dabei sollten die Arme nahe am K&ouml;rper bleiben und die Schultern so weit wie m&ouml;glich zusammengezogen werden. Lasse langsam und kontrolliert das Gewicht wieder nach vorne bis die Arme vollst&auml;ndig ausgestreckt sind.</p>","name":"Long-Pulley (eng)","name_original":"Long-Pulley (eng)","creation_date":null,"uuid":"490a615c-4185-4560-88a5-020f3aa40be2","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[1,13],"equipment":[]},{"id":143,"license_author":"wger.de","status":"2","description":"<p>Sit down, put your feet on the supporting points and grab the bar with a wide grip. Pull the weight with a rapid movement towards your belly button, not upper. Keep your arms and elbows during the movement close to your body. Your shoulders are pulled together. Let the weight slowly down till your arms are completely stretched.</p>","name":"Long-Pulley (low Row)","name_original":"Long-Pulley (low row)","creation_date":"2013-05-05","uuid":"b192c4eb-31c6-458e-b566-d3f38b5aa30c","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[1,13],"equipment":[]},{"id":144,"license_author":"wger.de","status":"2","description":"<p>The exercise is the same as the regular long pulley, but with a narrow grip:</p>\n<p>Sit down, put your feet on the supporting points and grab the bar with a wide grip. Pull the weight with a rapid movement towards your belly button, not upper. Keep your arms and elbows during the movement close to your body. Your shoulders are pulled together. Let the weight slowly down till your arms are completely stretched.</p>","name":"Long-Pulley, Narrow","name_original":"Long-Pulley, narrow","creation_date":"2013-05-05","uuid":"bcabc8cf-c005-4630-8853-ef4922e7fd91","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[1,13],"equipment":[]},{"id":389,"license_author":"taylorbarbell","status":"2","description":"<p>Unrack the bar and set your stance wide, beyond your hips.  Push your hips back and sit down to a box that takes you below parallel.  Sit completely down, do not touch and go.  Then explosively stand up.  Stay tight in your upper back and torso throughout the movement.</p>","name":"Low Box Squat - Wide Stance","name_original":"Low Box Squat - Wide Stance","creation_date":"2016-03-11","uuid":"222e10a6-e3ba-40fd-9598-6c1d664b450a","license":2,"category":9,"language":2,"muscles":[8,10],"muscles_secondary":[],"equipment":[1]},{"id":254,"license_author":"aza11","status":"1","description":"<p>Specific product for building strength in the trunk and latissimus dorsi muscles. The exercise involves pulling the two independent levers towards the chest, keeping the arms out in front and the elbows low, parallel to the shoulders. Resistance is provided by a weight stack which enables the workload to be adjusted to suit each type of user.</p>\n<p>- http://www.technogym.com/gb/products/strength-training-equipment/core-exercise-equipment/selection/low-row/427</p>\n<p> </p>\n<p>Muscels:</p>\n<ul>\n<li>Rhomboid</li>\n</ul>","name":"Low Row Machine","name_original":"Low Row Machine","creation_date":"2014-06-05","uuid":"4dbed9f2-6956-4ebd-9d89-609415670e37","license":1,"category":12,"language":2,"muscles":[],"muscles_secondary":[1,12],"equipment":[]},{"id":456,"license_author":"Tomv","status":"1","description":"<p>With the palms of your hands pointed forward set shoulder-width apart, push your body off the ground, locking your elbows as if you’re at the top of a dip exercise. Make sure to keep your shoulders down as you lock your knees and hold your legs together tightly, forming a 90-degree angle with your torso. Your legs should be parallel to the ground. hold for time.</p>","name":"L-sit","name_original":"L-sit","creation_date":"2017-03-28","uuid":"127351c9-0565-4284-8f43-412e0caf13ba","license":2,"category":10,"language":2,"muscles":[6,9,5],"muscles_secondary":[2,13,14,10,3],"equipment":[7]},{"id":458,"license_author":"Frandangius","status":"1","description":"<p>https://www.youtube.com/watch?v=IUZJoSP66HI</p>","name":"L-sit (full)","name_original":"L-sit (full)","creation_date":"2017-04-07","uuid":"4cd1e6e6-f329-4dc6-8721-bf6b9f6e3456","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":459,"license_author":"Frandangius","status":"1","description":"<p>https://www.youtube.com/watch?v=IUZJoSP66HI</p>","name":"L-sit (tucked)","name_original":"L-sit (tucked)","creation_date":"2017-04-07","uuid":"982f8db1-83a0-449c-9e65-e78719777b0e","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":276,"license_author":"Naatje","status":"2","description":"<p>met de rug plat op de grond, benen in een hoek van 90 graden. armen naast het lichaam.</p>\n<p> </p>\n<p>1 breng de schouders iets naar boven.</p>\n<p>2 buig het bovenlichaam iets naar rechts terwijl je met de rechterhand de rechterhiel aantikt.</p>\n<p>3 ga terug naar startpositie. </p>\n<p>4 herhaal aan de linkerkant.</p>","name":"Lying Heel Touches","name_original":"lying heel touches","creation_date":"2014-10-06","uuid":"8ebe030b-7182-49a8-9eb2-1dafb05f5fc9","license":1,"category":10,"language":6,"muscles":[14],"muscles_secondary":[6],"equipment":[4]},{"id":312,"license_author":"Trix","status":"2","description":"<p>This is an excercise for problems with the levator muscles. Primary  Infraspinatus, secondary Teres Minor.</p>\n<p>Lying on side. Keep elbow on waist and in 90 dgr angle. Rotate towards stomach. Add weight as fit.</p>","name":"Lying Rotator Cuff Exercise","name_original":"Lying rotator cuff exercise","creation_date":"2015-02-22","uuid":"5708d3c5-0016-446b-b3f4-54b2120e8297","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[3]},{"id":533,"license_author":"trippe","status":"1","description":"<p>Lay down and pull a dumbbell over your head.</p>","name":"Lying Triceps Extension","name_original":"Lying Triceps Extension","creation_date":"2018-01-10","uuid":"a92aee3f-5d8b-4bed-bdfc-562034ae31ba","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[8]},{"id":515,"license_author":"Bonniechica","status":"1","description":"<p>Cardio-Übung: Auf der Stelle marschieren</p>","name":"Marschieren Auf Der Stelle","name_original":"Marschieren auf der Stelle","creation_date":"2017-11-18","uuid":"53982139-48d9-49c2-9632-0959f4b5a710","license":2,"category":9,"language":1,"muscles":[11,8,10],"muscles_secondary":[14,6],"equipment":[7]},{"id":534,"license_author":"GrosseHund","status":"1","description":"Grab dumbbells and extend arms to side and hold as long","name":"Metin","name_original":"Metin","creation_date":"2018-01-15","uuid":"ba3273b0-d782-4e9e-bdf4-8003d6b7428f","license":1,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=17","previous":"https://wger.de/api/v2/exercise/?page=15","results":[{"id":537,"license_author":"Metin","status":"1","description":"lehneme na podložku. Medicinbal do ruky natáhneme jí před sebe a provádíme zkracovačky .","name":"Metka","name_original":"metka","creation_date":"2018-01-15","uuid":"92fe6a10-7cc2-439a-90cb-36e75140ea88","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":141,"license_author":"wger.de","status":"2","description":"","name":"MGM Machine","name_original":"MGM machine","creation_date":"2013-05-05","uuid":"a81d18a0-6280-44f8-ab5a-166d016e858e","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":49,"license_author":"wger.de","status":"2","description":"","name":"MGM-Maschine","name_original":"MGM-Maschine","creation_date":null,"uuid":"5af2ca13-8f3e-4a14-b70d-0e7655a1b6dd","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":256,"license_author":"mbozi1","status":"2","description":"<p>On an SZ-bar grip your hands on the outside of each bend and stand with your arms straight down, palms facing your legs. Pull the bar (bending your arms at the elbow) to your chest, and the push the bar above your head (arms as straight as possible). Return the bar to your chest by dropping your arms at the elbows. Return the bar to it's origional position (stand with your arms straight down, palms facing your legs.)</p>","name":"Military Press","name_original":"Military Press","creation_date":"2014-06-12","uuid":"8aadcd68-f085-44a0-a897-8b6ecf827ed0","license":1,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[2]},{"id":229,"license_author":"Wikipedia","status":"2","description":"<p>The military press is a variation of the overhead press weight training exercise using very strict form and no pre-movement momentum.The military press targets the deltoid muscles in the shoulders as well as the triceps. Additionally, it works the core and legs, which the lifter uses to help stabilize the weight.The lift begins with the lifter standing and the barbell on the anterior deltoids. The lifter then raises the barbell overhead by pressing the palms of the hands against the underside of the barbell.</p>","name":"Military Press","name_original":"Military Press","creation_date":"2014-03-09","uuid":"89e6d2ea-9a17-4a77-9a52-d5bcf39d57fd","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[4,5],"equipment":[1]},{"id":447,"license_author":"anzeige","status":"1","description":"<p>Gehe zuerst in die Liegestützposition. Der Rumpf ist grade zu halten. Das rechte Knie wird nun zum rechten Ellenbogen gezogen, berührt ihn jedoch nicht. Anschließend wird das Bein wieder in die Ausgangsposition geführt und gleichzeitig, dass linke Knie nach vorne gezogen. Diese Übung wird nun abwechselnd ausgeführt. </p>","name":"Mountain Climbers","name_original":"Mountain Climbers","creation_date":"2017-02-16","uuid":"9edb662a-eed9-4a85-9ed4-aa0c5b8dd7aa","license":2,"category":9,"language":1,"muscles":[11,8,10,6],"muscles_secondary":[7],"equipment":[7]},{"id":196,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Nackenziehen","name_original":"Nackenziehen","creation_date":"2013-09-08","uuid":"2ec697b5-0a69-4727-b842-3c78432253be","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":17,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf die Negativbank hin, die Oberschenkel und der Rücken legen fest auf der drauf. Greife die Stange breit und lasse sie langsam und kontrolliert runter, dabei sollte die Stange kurz auf Brustwarzenhöhe den Körper berühren. Dann das Gewicht wieder hochdrücken bis die Arme durchgestreckt sind.</p>","name":"Negativ Bankdrücken","name_original":"Negativ Bankdrücken","creation_date":null,"uuid":"3ef8a516-d0d4-4078-9b4a-d7783da0fcf7","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[2,12,5],"equipment":[1]},{"id":93,"license_author":"wger.de","status":"2","description":"<p>Sit yourself on the decline bench and fix your legs. Cross your arms over the chest and bring with a rolling movement your upper body up, go now without a pause and with a slow movement down again. Don't let your head move during the exercise.</p>","name":"Negative Crunches","name_original":"Negative crunches","creation_date":null,"uuid":"4bd55b0a-559a-4458-aabd-e66619b63610","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":552,"license_author":"mvyrbdy","status":"1","description":"<p>Ganzkörper-Workout: Kraft Ausdauer Training </p>","name":"Nordic Walking","name_original":"Nordic Walking","creation_date":"2018-02-26","uuid":"c321c6f9-546a-4ff1-a182-019e6f1c7e7b","license":2,"category":9,"language":1,"muscles":[11,13,7,8,4,10,5],"muscles_secondary":[],"equipment":[]},{"id":562,"license_author":"gustavo","status":"1","description":"she has dndnud cd cuc dndnud cd cuc dncmdncjd7dncnc dhdhdnsjdndndnd MD djdn","name":"Nuevo","name_original":"nuevo","creation_date":"2018-03-31","uuid":"8cb87f97-a82b-4cd6-a057-cfdfb56b9b7c","license":1,"category":13,"language":2,"muscles":[13],"muscles_secondary":[13],"equipment":[6]},{"id":315,"license_author":"schmiddytimes","status":"2","description":"<p>Seitlich den Griff vom Kabelzug mit gestrecktem Arm von oben nach unten drücken bis der Griff vor dem Oberschenkel ist.</p>","name":"Oberer Kabelzug","name_original":"Oberer Kabelzug","creation_date":"2015-03-07","uuid":"bd453a9f-b3c6-4719-a947-10e4891691dc","license":2,"category":11,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":556,"license_author":"jamie.coleman9","status":"1","description":"<ol>\n<li>The standing oblique cable crunch hits the abs and obliques. Set up the high pulley cable machine by attaching a grip attachment and selecting the weight you want to use.</li>\n<li>Grasp the handle with your left hand and face your body at a right angle to the cable pulley with your feet firmly on the floor and shoulder width apart.</li>\n<li>Your forearm should be at a right angle to your upper arm.</li>\n<li>Pull down with your left oblique as far as possible.</li>\n<li>Pause, then lower the weight back down.</li>\n<li>Don't let the weight drop to the stack at any time throughout the exercise.</li>\n<li>Repeat this movement for the desired number of reps and then switch to your other side. </li>\n</ol>","name":"Oblique Cable Crunch","name_original":"Oblique Cable Crunch","creation_date":"2018-03-08","uuid":"0e16851c-9b0b-4c0d-9e52-58499929291f","license":2,"category":10,"language":2,"muscles":[14],"muscles_secondary":[],"equipment":[]},{"id":374,"license_author":"wger.de","status":"2","description":"Lehneme si na záda, k lavici, nebo na lavici. Chytneme se za hlavou a pak zvedáme nohy do svíčky tak, aby se lehce nadzvedla pánev.  Rozsah pohybu není velký, přibližně okolo 10 cm maximálně však 15 cm a závisí na ohebnosti a zdatnosti. Je dobré vycítit, kdy už nepracují svaly břicha a práci přebírají ohýbače kyčlí.","name":"Obrácené Zkracovačky","name_original":"Obrácené zkracovačky","creation_date":"2016-01-14","uuid":"31061d58-abab-4053-bd19-96e0ebb1c49d","license":2,"category":10,"language":9,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":197,"license_author":"ThisGirl0819","status":"2","description":"<p>Hands at shoulder height, curl arms in toward head, then back out.</p>","name":"Overhand Cable Curl","name_original":"Overhand Cable Curl","creation_date":"2013-09-22","uuid":"e7fdd8fb-5e07-4a29-9d56-a005338b2e19","license":1,"category":10,"language":2,"muscles":[1],"muscles_secondary":[],"equipment":[]},{"id":355,"license_author":"geraldbaeck","status":"2","description":"<p>The barbell is held overhead in a wide-arm snatch grip; however, it is also possible to use a closer grip if balance allows.</p>","name":"Overhead Squat","name_original":"Overhead Squat","creation_date":"2015-11-22","uuid":"b9c97cec-ffc7-4e9a-8ecc-08b285aed3b4","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":455,"license_author":"Etulf","status":"1","description":"<p>In this version of the squat you hold the bar overhead as you perform the exercise.</p>\nSteps\n<ol>\n<li>Stand with your feet a bit wider than shoulder width apart with your toes pointed slightly outward.</li>\n<li>Grasp a barbell using a wide side snatch grip with your arms and elbows fully extended.</li>\n<li>Keeping the bar overhead, bend your knees and lower your body until your thighs are parallel with the floor.</li>\n<li>Return to starting position</li>\n</ol>","name":"Overhead Squat With Barbell","name_original":"Overhead Squat with Barbell","creation_date":"2017-03-13","uuid":"399f50bc-dbb8-4fd4-ab3e-d6b2ad34a8a6","license":2,"category":9,"language":2,"muscles":[10],"muscles_secondary":[2,7,15,9],"equipment":[1]},{"id":270,"license_author":"Mens Fitness","status":"2","description":"<p>Lower the bar to your chest and pause (but do not rest) there for 2 seconds. Press back up. use the same weight you would on bench press, but perform only single reps. Total the number of reps you did in one set of bench press (if you did 3 sets of 8 do 8 sinlge pause bench reps.</p>","name":"Pause Bench","name_original":"Pause Bench","creation_date":"2014-09-08","uuid":"625aefd5-7ba2-40e9-bdc3-7d3ab1bcf3b8","license":3,"category":11,"language":2,"muscles":[4],"muscles_secondary":[5],"equipment":[1,8]},{"id":549,"license_author":"Gerardo Saborio","status":"1","description":"<p>A machine fly, alternatively called a seated lever fly or \"Pec Dec\" fly is a strength training exercise based on the free weight chest fly. As with the chest fly, the hand and arm move through an arc while the elbow is kept at a constant angle. Flyes are used to work the muscles of the upper body, primarily the sternal head of the pectoralis major. Because these exercises use the arms as levers at their longest possible length, the amount of weight that can be moved is significantly less than equivalent press exercises for the same muscles (the military press and bench press for the shoulder and chest respectively).</p>","name":"Pec Deck Flyes","name_original":"Pec Deck Flyes","creation_date":"2018-02-21","uuid":"8e19e272-d80e-4166-be89-8a083ef8d1eb","license":2,"category":11,"language":2,"muscles":[4],"muscles_secondary":[1],"equipment":[1]},{"id":299,"license_author":"ekgdc","status":"1","description":"<p>Lay on your back and lift your buttocks off the floor. Feet are flat on the floor. </p>","name":"Pelvic Tilting Medium Risk","name_original":"Pelvic Tilting Medium Risk","creation_date":"2015-01-04","uuid":"471c0011-5b05-48e4-8dd4-4e730631d053","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[6],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=18","previous":"https://wger.de/api/v2/exercise/?page=16","results":[{"id":202,"license_author":"Nallitnas","status":"2","description":"<p>Back excercise with a barbell with a starting position which is in a bent over position with the back paralell to the ground. The barbell is on the ground at chest level.For the movement grab the barbell at shoulder width grip and pull towards your chest without losing the bent over position and without moving anything but your arms</p>","name":"Pendelay Rows","name_original":"Pendelay rows","creation_date":"2014-01-06","uuid":"eed05679-d1cb-44a2-a17d-dd5b0097c874","license":1,"category":12,"language":2,"muscles":[12,9],"muscles_secondary":[1,5],"equipment":[1]},{"id":182,"license_author":"OGhTebfCxhexZXuf35mUxV9C--A","status":"2","description":"<p>Push up with perfect push up</p>","name":"Perfect Push Up","name_original":"Perfect Push Up","creation_date":"2013-07-30","uuid":"53b6a314-df50-4ef8-9b3d-ce290562df5b","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[],"equipment":[]},{"id":361,"license_author":"Nash","status":"2","description":"<p>Push Up performed from a pike position (optional to have feet elevated).</p>","name":"Pike Push Ups","name_original":"Pike Push Ups","creation_date":"2016-01-04","uuid":"00be3262-2783-4670-8cf4-70cacbff5ca1","license":2,"category":8,"language":2,"muscles":[4],"muscles_secondary":[5],"equipment":[7]},{"id":160,"license_author":"minifigmaster125","status":"2","description":"<p>One legged squat</p>","name":"Pistol Squat","name_original":"Pistol Squat","creation_date":"2013-05-28","uuid":"b1d6d536-7f4a-4dd3-8b76-62d7a984e115","license":1,"category":9,"language":2,"muscles":[11,8],"muscles_secondary":[2,1,13],"equipment":[]},{"id":540,"license_author":"Metin","status":"1","description":"The plank is one of the most common core exercises, ever, but most guys get it wrong. Creating tension in your abs primes your body to maximally contract all of its muscles. \"This is a very useful ability when sprinting, jumping, and lifting weights,\" Dunham says","name":"Plank","name_original":"Plank","creation_date":"2018-01-15","uuid":"b1476958-08fb-4a3f-976e-a10b7cf07a82","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":238,"license_author":"YYCfit","status":"2","description":"<p>Get into a position on the floor supporting your weight on your forearms and toes. Arms are bent and directly below the shoulder. </p>\n<p>Keep your body straight at all times and hold this position as long as possible. To increase difficulty an arm or leg can be raised while performing this exercise.  </p>","name":"Plank","name_original":"Plank","creation_date":"2014-03-31","uuid":"7729ffe5-a896-4deb-80e0-f4e6163c0c09","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[],"equipment":[7]},{"id":505,"license_author":"Bonniechica","status":"1","description":"<p>Aus Planke in den Liegestütz wechseln und wieder zurück</p>","name":"Planke zu Liegestütz","name_original":"Planke zu Liegestütz","creation_date":"2017-11-17","uuid":"5cdec3f0-7b0c-4bfb-9ec2-981e6f57b2d8","license":2,"category":11,"language":1,"muscles":[13,4],"muscles_secondary":[6,5],"equipment":[7]},{"id":443,"license_author":"dnotari","status":"1","description":"<p>Hand Plank Position then walk up til butt is the air.</p>","name":"Plank Walk Up","name_original":"Plank Walk Up","creation_date":"2017-01-09","uuid":"0dfeff24-7416-4544-afd9-d7f1c68191f1","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":392,"license_author":"GauthierFlichy","status":"1","description":"<p>Mettez vous sur le ventre, soulevez vous à la force de vos bras...</p>","name":"Pompes","name_original":"Pompes","creation_date":"2016-04-13","uuid":"12ad6930-d123-4603-95bd-d7120825bcb4","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":189,"license_author":"sistab2","status":"2","description":"<p>Olympic weight lifting</p>","name":"Power Clean","name_original":"Power Clean","creation_date":"2013-08-11","uuid":"742334a0-9a6e-4668-9883-fa578ead2a64","license":1,"category":13,"language":2,"muscles":[4],"muscles_secondary":[10],"equipment":[]},{"id":193,"license_author":"cgoob883","status":"2","description":"<p> Place the EZ curl bar on the rest handles in front of the preacher bench. Lean over the bench and grab the EZ curl bar with palms up. Sit down on the preacher bench seat so your upper arms rest on top of the pad and your chest is pressed against the pad. Lower the weight until your elbows are extended and arms are straight. Bring the weights back up to the starting point by contracting biceps. Repeat</p>","name":"Preacher Curls","name_original":"Preacher Curls","creation_date":"2013-08-12","uuid":"84b4e711-8b29-4541-ad58-dad967f82390","license":1,"category":8,"language":2,"muscles":[13],"muscles_secondary":[13],"equipment":[]},{"id":371,"license_author":"http://kulturistika.ronnie.cz/c-17541-zasobnik-cvi","status":"2","description":"Přítahy jednoručky lze provádět buď vkleče na lavici, nebo ve stoji s nakročením jedné nohy (bez opření nebo s opřením volné ruky o pevný bod - stojan, lavičku apod.). Zaujměte výchozí polohu s jednoručkou drženou v napnuté paži neutrálním úchopem (dlaň směřuje k tělu). Zpevněte tělo a držte rovná záda - bederní, hrudní i krční část páteře v přirozené poloze.\nObloukovitým pohybem přitahujte činku směrem k pasu. Loket se pohybuje blízko k tělu, rameno dolů (směrem od uší) a mírně směrem vzad za tělo. V závěrečné fázi cviku můžete mírným vytočením trupu na straně činky směrem vzhůru docílit větší kontrakce svalů. Po dosažení této fáze činku kontrolovaně spouštějte do výchozí polohy.\nNádech je při excentrické fázi cviku (spouštění činky), výdech v koncentrické fázi (přítah činky k pasu).\nVarianta, kdy se loket pohybuje dále od těla a úchop se místo neutrálního (dlaní k tělu) přibližuje úchopu nadhmatem a osa činky tak jde kolmo k tělu, více zatěžuje zadní část deltového svalu a horní a střední část svalu trapézového.","name":"Přítahy v Kleče Jednoručkou","name_original":"Přítahy v kleče jednoručkou","creation_date":"2016-01-13","uuid":"f70761d1-5003-4ffc-b6fe-9c1d024d0562","license":2,"category":12,"language":9,"muscles":[12],"muscles_secondary":[],"equipment":[3]},{"id":365,"license_author":"perteus","status":"2","description":"Při cvičení ramena držte na místě, nezvedejte je nahoru, při kontrakci táhněte lopatky k sobě a dolů, nadloktí podél těla dozadu. Soustřeďte se na zádové svaly a ne na svaly rukou.","name":"Přítahy v Sedě s Oporou","name_original":"Přítahy v sedě s oporou","creation_date":"2016-01-13","uuid":"d92fd2b6-d5c0-4422-b565-34b0f24b4be1","license":2,"category":12,"language":9,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":429,"license_author":"donaddon","status":"2","description":"<p>Lying on stomach with head on towel.</p>\n<p>Stretch arms straight out to your sides.</p>\n<p>Slowly lift your arms, pulling your shoulderblades together, hold for 3 seconds.</p>\n<p> </p>","name":"Prone Scapular Retraction - Arms at Side","name_original":"Prone Scapular Retraction - Arms at side","creation_date":"2016-10-26","uuid":"82a0a7e2-2d4d-4336-9412-f9878575f709","license":2,"category":12,"language":2,"muscles":[9],"muscles_secondary":[],"equipment":[]},{"id":246,"license_author":"Topi88","status":"1","description":"<p>Grudi</p>","name":"Propadanje","name_original":"Propadanje","creation_date":"2014-04-12","uuid":"ee9c9541-aa0b-4bc2-b655-69d358714117","license":1,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":441,"license_author":"Jair_LB","status":"1","description":"<ul>\n<li>Stand up, take the pull bar and pull down with extended arms.</li>\n<li>Going back to the original position</li>\n</ul>","name":"Pull-over  (Extended Arms)","name_original":"Pull-over  (Extended Arms)","creation_date":"2017-01-05","uuid":"e1d2b072-2791-4a63-a41e-1c43914a4886","license":2,"category":12,"language":2,"muscles":[12],"muscles_secondary":[4,5],"equipment":[6]},{"id":225,"license_author":"mhs_79","status":"2","description":"<ul>\n<li>Sie Liegen auf einer Bank, die Füße stehen am Boden, die Arme sind nach oben gesteckt.</li>\n<li>Beide Hände halten eine Kurzhantel so, dass die Scheibe auf den Handflächen liegt, Daumen und Zeigefinger umschließen den Griff der Hantel</li>\n</ul>\n<ul>\n<li>beim Einatmen die Hantel hinter den Kopf sinken lassen und dabei leicht die Ellbogen beugen</li>\n</ul>\n<ul>\n<li>beim Zurückkehren in die Ausgangsposition ausatmen</li>\n</ul>","name":"Pull-Over KH","name_original":"Pull-Over KH","creation_date":"2014-03-01","uuid":"82de8ce3-8ea4-4154-8119-dd37cb5cdec5","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[],"equipment":[3]},{"id":440,"license_author":"Jair_LB","status":"1","description":"<p>Bajar la mancuerna por detras de la cabeza</p>\n<p>Volver a la posición inicial</p>","name":"Pullover With Dumbbell","name_original":"Pullover with Dumbbell","creation_date":"2017-01-05","uuid":"babe8e63-5d94-4119-ba28-ff748c4cc551","license":2,"category":11,"language":2,"muscles":[4],"muscles_secondary":[3,5],"equipment":[3]},{"id":107,"license_author":"wger.de","status":"2","description":"<p>Grab the pull up bar with a wide grip, the body is hanging freely. Keep your chest out and pull yourself up till your chin reaches the bar or it touches your neck, if you want to pull behind you. Go with a slow and controlled movement down, always keeping the chest out.</p>","name":"Pull-ups","name_original":"Pull-ups","creation_date":null,"uuid":"7ce6b090-5099-4cd0-83ae-1a02725c868b","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[2,1,9],"equipment":[6]},{"id":140,"license_author":"wger.de","status":"2","description":"","name":"Pull Ups on Machine","name_original":"Pull ups on machine","creation_date":"2013-05-05","uuid":"d46adbda-7c60-42a0-b1fd-9ec111b35956","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[2,1,9],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=19","previous":"https://wger.de/api/v2/exercise/?page=17","results":[{"id":190,"license_author":"sistab2","status":"2","description":"<p>olympic weight lifting</p>","name":"Push Press","name_original":"Push Press","creation_date":"2013-08-11","uuid":"b22cfb08-66ab-4e2d-9757-9dea7c5d47f8","license":1,"category":13,"language":2,"muscles":[9],"muscles_secondary":[8],"equipment":[]},{"id":195,"license_author":"maxamillion1414","status":"2","description":"<p>Start with your body streched, your hands are shoulder-wide appart on the ground. Push yourself off the ground till you strech your arms. The back is always straight and as well as the neck (always look to the ground). Lower yourself to the initial position and repeat.</p>","name":"Push Ups","name_original":"Push ups","creation_date":"2013-08-28","uuid":"9d756e84-6b77-4f17-b21d-7d266d6a8bd2","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[2,4,6],"equipment":[7]},{"id":161,"license_author":"Mahoney","status":"2","description":"<p>Deadlift to be done using a Smith machine or a free rack. Bar or barbell hould be just right under the knee cap level. Lift using the glutes and through the heels, then come back to starting postion with a control movement of 2 seconds.</p>\n<p>This exercise targets mainly the lower back and glutes.</p>","name":"Rack Deadlift","name_original":"Rack deadlift","creation_date":"2013-06-21","uuid":"2738e6e0-2158-4a7e-8fbd-32657d043a65","license":1,"category":12,"language":2,"muscles":[8],"muscles_secondary":[1],"equipment":[]},{"id":413,"license_author":"vvmourik","status":"1","description":"<p>Grondgevecht.</p>\n<p>Gebruik van armen, benen, buikspieren, rugspieren.</p>\n<p>Verwurgingen, armklemmen, houdgrepen.</p>\n<p>Felxibiliteit en controle.</p>","name":"Randoir NeWaza","name_original":"Randoir NeWaza","creation_date":"2016-09-05","uuid":"ebdd2cd2-ca2f-4a3f-922f-4952019e9b5e","license":2,"category":10,"language":6,"muscles":[2,1,11,13,7,8,12,14,4,10,6,3,15,9,5],"muscles_secondary":[2],"equipment":[]},{"id":248,"license_author":"Topi88","status":"1","description":"<p>Razboj</p>","name":"Razboj","name_original":"Razboj","creation_date":"2014-04-12","uuid":"4d54a3c8-eb11-4844-8828-38286423c8fc","license":1,"category":11,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":237,"license_author":"YYCfit","status":"2","description":"<p>Seated on a bench bWith the dumbbells on the floor bend over at 45 Degrees and then slowly raise each dumbbell to shoulder height and hold for a couple seconds before lowering to the starting position. </p>\n<p> </p>","name":"Rear Delt Raises","name_original":"Rear Delt Raises","creation_date":"2014-03-30","uuid":"69f271a6-5408-49d9-8a3a-1f6088835f30","license":1,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[3]},{"id":460,"license_author":"exrx.net","status":"1","description":"<p><strong>Preparation</strong></p>\n<p> </p>\n\nStand facing rope attachment on high pulley cable. Grasp each end of rope just above enlarged ends. Step back with one foot so arms and shoulders are positioned straight forward with cable taut. Point elbows outward.\n\n<p> </p>\n<p><strong>Execution</strong></p>\n<p> </p>\n\nPull rope to upper chest or neck, keeping elbows at shoulder height until elbows travel slightly behind back. Keep upper arms perpendicular to trunk. Return until arms are extended forward. Repeat.\n\n<p>Target</p>\n<p>             Posterior Deltoid</p>","name":"Rear Delt Rope Pull","name_original":"Rear Delt Rope Pull","creation_date":"2017-04-15","uuid":"251ef1f0-0a96-4b7b-80f9-5af949fbe112","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":500,"license_author":"Bonniechica","status":"1","description":"<p>Ausfallschritt nach hinten ausführen</p>","name":"Rev. Ausfallschritt","name_original":"Rev. Ausfallschritt","creation_date":"2017-11-17","uuid":"62ad57ec-d5b5-4a42-b3cb-92c6b3e1b45d","license":2,"category":9,"language":1,"muscles":[8,10],"muscles_secondary":[],"equipment":[1,3,10]},{"id":208,"license_author":"tuckerm","status":"2","description":"<p>Hold bar with reverse (or \"overhand\") grip, palms facing the floor.</p>","name":"Reverse Bar Curl","name_original":"Reverse bar curl","creation_date":"2014-01-15","uuid":"438678dc-5a62-4496-9458-341af0616626","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[],"equipment":[2]},{"id":555,"license_author":"jamie.coleman9","status":"1","description":"<p>1. Lie on your back with your knees together and your legs bent to 90 degrees, feet planted on the floor. Place your palms face down on the floor for support.</p>\n<p>2.Tighten your abs to lift your hips off the floor as you crunch your knees inward to your chest. Pause at the top for a moment, then lower back down without allowing your lower back to arch and lose contact with the floor.</p>","name":"Reverse Crunch","name_original":"Reverse Crunch","creation_date":"2018-03-08","uuid":"0504d15b-e243-4070-96d9-06307682703e","license":2,"category":10,"language":2,"muscles":[6],"muscles_secondary":[],"equipment":[7]},{"id":395,"license_author":"hilather","status":"1","description":"<p>Works posterior deltoid muscle group does not appear in muscle list. Start with lower weight.</p>","name":"Reverse Dumbbell Flyes","name_original":"Reverse Dumbbell Flyes","creation_date":"2016-05-01","uuid":"21cd4f16-5bf2-4f8b-84eb-0cf93fdfca54","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[3]},{"id":399,"license_author":"bl0sh","status":"2","description":"<p>Upper chest focuses exercise that also works triceps</p>","name":"Reverse Grip Bench Press","name_original":"Reverse Grip Bench Press","creation_date":"2016-05-25","uuid":"30a8ef85-a24c-4f44-b558-55d3279b29c5","license":2,"category":11,"language":2,"muscles":[4,5],"muscles_secondary":[2],"equipment":[1,8]},{"id":409,"license_author":"spacetowaste","status":"2","description":"<p>Plank with stomach towards ceiling</p>","name":"Reverse Plank","name_original":"Reverse Plank","creation_date":"2016-07-31","uuid":"75ec610d-216a-49fe-b395-c5fd8ee14b53","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":360,"license_author":"Nash","status":"2","description":"<p>Dips peformed on gymnastic rings.</p>","name":"Ring Dips","name_original":"Ring Dips","creation_date":"2016-01-04","uuid":"f7b6a6b0-6dd8-4648-9a32-83039f5e28e1","license":2,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":579,"license_author":"Rubén Santos","status":"1","description":"<p>Start by holding the rings with a supine grip at chest level. The elbows are held behind the back, applying inward force.</p>\n<p>The eccentric phase begins by extending the arms as slowly as possible, keeping the whole body tight and trying to oversupine the forearms.</p>\n<p>The concentric phase is executed by flexing the arms to return to the starting position, trying to keep the elbows static throughout the movement.</p>\n<p>The difficulty can be increased by placing the rings at a lower height.</p>","name":"Ring Pelican Curl","name_original":"Ring pelican curl","creation_date":"2018-07-02","uuid":"c7e2830c-69e1-407e-897e-1e7455870549","license":2,"category":8,"language":4,"muscles":[1],"muscles_secondary":[2],"equipment":[7]},{"id":263,"license_author":"MaddieBeasley","status":"2","description":"<p>Crunches on roman chair</p>","name":"Roman Chair","name_original":"Roman Chair","creation_date":"2014-07-22","uuid":"9f622058-85a4-4272-ad99-e5696e772137","license":1,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":446,"license_author":"mrsarcasm","status":"1","description":"<p>Use Hyperextension chair.  Sit on chair, arms crossed on over your chest. then situp slowly and back</p>","name":"Roman Chair Crunch","name_original":"Roman Chair Crunch","creation_date":"2017-01-21","uuid":"b325a755-1cb3-4e6b-8501-d2607d91aab3","license":2,"category":10,"language":2,"muscles":[14],"muscles_secondary":[],"equipment":[]},{"id":351,"license_author":"pjwirth","status":"2","description":"<p>DL from top to pos 2: https://www.youtube.com/watch?v=WtWtjViRsKo</p>","name":"Romanian Deadlift","name_original":"Romanian Deadlift","creation_date":"2015-10-19","uuid":"e35528f9-1785-41b5-860a-3408a6c02b2d","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]},{"id":477,"license_author":"Big Mo","status":"1","description":"<p>To use a rowing machine</p>\n<p>1. Wrap fingers lightly around the handle and keep wrists straight.</p>\n<p>2. extend arms in front of you, keeping shoulders relaxed—no hunching!</p>\n<p>3. hinge forward from the hips and bend knees until they’re over ankles </p>\n<p>4. push through feet, extend legs, and lean back slightly; keep shoulders relaxed.</p>\n<p>5. draw elbows straight back to sides until hands reach ribs.</p>\n<p>6. to start the next stroke, extend arms, and then bend knees to slide the seat forward.</p>","name":"Rowing","name_original":"Rowing","creation_date":"2017-08-07","uuid":"83538ecf-c907-4213-821f-8cd7ea7ff221","license":2,"category":9,"language":2,"muscles":[7,10,15],"muscles_secondary":[1,6,9,5],"equipment":[]},{"id":142,"license_author":"wger.de","status":"2","description":"","name":"Rowing, Lying on Bench","name_original":"Rowing, lying on bench","creation_date":"2013-05-05","uuid":"1ad8e721-9297-46c2-a983-7297ca4dfa52","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=20","previous":"https://wger.de/api/v2/exercise/?page=18","results":[{"id":575,"license_author":"gary_hili","status":"1","description":"<p>Use rowing machine, trying to keep a steady speed</p>","name":"Rowing Machine","name_original":"Rowing Machine","creation_date":"2018-05-29","uuid":"a11364ad-88a6-47a0-9a25-800634d6dff5","license":3,"category":10,"language":2,"muscles":[1,11,14,4,10,6,5],"muscles_secondary":[],"equipment":[]},{"id":108,"license_author":"wger.de","status":"2","description":"","name":"Rowing, Seated","name_original":"Rowing, seated","creation_date":null,"uuid":"57747eb3-411a-4efd-8842-a45e562320ee","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":106,"license_author":"wger.de","status":"2","description":"<p>The execution of this exercise is very similar to the regular bent over rowing, only that the bar is fixed here.</p>\n<p>Grab the barbell with a wide grip (slightly more than shoulder wide) and lean forward. Your upper body is not quite parallel to the floor, but forms a slight angle. The chest's out during the whole exercise. Pull now the barbell with a fast movement towards your belly button, not further up. Go slowly down to the initial position. Don't swing with your body and keep your arms next to your body.</p>","name":"Rowing, T-bar","name_original":"Rowing, T-bar","creation_date":null,"uuid":"3c3f23b5-b523-4a69-8c79-1106a4ce9b6d","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[2,1,13],"equipment":[]},{"id":201,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Rückenmaschine","name_original":"Rückenmaschine","creation_date":"2013-12-27","uuid":"b3eb5e26-5e55-41d8-901a-2af56f1fffe0","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":448,"license_author":"anzeige","status":"1","description":"<p>Die Übung trainert den Rückenstrecker (musculus erector spinae). Bei der Übung legt man sich mit dem Bauch auf den Boden und streckt Arme nach Vorne aus.</p>\n<p>Hebe zuerst dein rechten Arm und linkes Bein und halte die Position. Nach jedem Schritt geht es in die Ausgangsposition zurück. Danach werden beide Arme angehoben und gehalten. Anschließend werden beide Beine angehoben und gehalten. Zu guter letzt werden linker Arm und rechtes Bein angehoben. Danach kann die Übung von vorne begonnen werden.</p>","name":"Rückenstrecken im Liegen (Superman) / Lying Back Extension","name_original":"Rückenstrecken im Liegen (Superman) / Lying Back Extension","creation_date":"2017-02-16","uuid":"24076780-d4a6-45d6-b64b-e46c640c5d46","license":2,"category":12,"language":1,"muscles":[],"muscles_secondary":[11,8],"equipment":[4]},{"id":511,"license_author":"Bonniechica","status":"1","description":"<p>Im Vierfüßlerstand im Wechsel diagonal Arm und Bein anheben</p>","name":"Rückenübung","name_original":"Rückenübung","creation_date":"2017-11-17","uuid":"e285a273-3d8e-4f08-b658-628bd7e86621","license":2,"category":12,"language":1,"muscles":[8,12],"muscles_secondary":[13,6,5],"equipment":[7]},{"id":224,"license_author":"mhs_79","status":"2","description":"<p>beim Einatmen den Haltegriff zum Schwertfortsatz des Brustbeins führen. während der Rücken aufgerichtet und die Ellbogen so weit wie möglich nach hinten gezogen werden</p>","name":"Rudern am Tiefen Block (Seilzug)","name_original":"Rudern am tiefen Block (Seilzug)","creation_date":"2014-03-01","uuid":"da935415-da89-40a0-820b-136f95a747f8","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":42,"license_author":"wger.de","status":"2","description":"","name":"Rudern Aufgelegt","name_original":"Rudern aufgelegt","creation_date":null,"uuid":"9dc1a227-5343-4675-ba59-40cad41803d3","license":1,"category":13,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":79,"license_author":"wger.de","status":"2","description":"<p>Der Bewegungsablauf ist derselbe wie bei Ausf&uuml;hrung mit einer &szlig;-Stange.</p>\r\n<p>Stelle dich gerade hin, die F&uuml;&szlig;e etwa schulterbreit. Halte die Stange mit einem Obergriff vor den Oberschenkel, die Arme ausgestreckt. Ziehe dann die Stange dicht am K&ouml;rper hoch, bis etwa zum Kinn. Die Ellenbogen zeigen nach oben, so, dass in der h&ouml;chsten Position die Arme ein leichtes V machen. Mache nach M&ouml;glichkeit hier eine kurze Pause und gehe dann langsam wieder runter.</p>","name":"Rudern Aufrecht MP","name_original":"Rudern aufrecht MP","creation_date":null,"uuid":"87423a4f-3216-4c9b-b735-9074e0f664ee","license":1,"category":13,"language":1,"muscles":[2,9],"muscles_secondary":[1],"equipment":[]},{"id":62,"license_author":"wger.de","status":"2","description":"<p>Stelle dich gerade hin, die Füße etwa schulterbreit. Halte die ß-Stange mit einem Obergriff vor den Oberschenkel, die Arme ausgestreckt. Ziehe dann die Stange dicht am Körper hoch, bis etwa zum Kinn. Die Ellenbogen zeigen nach oben, so, dass in der höchsten Position die Arme ein leichtes V machen. Mache nach Möglichkeit hier eine kurze Pause und gehe dann langsam wieder runter.</p>","name":"Rudern Aufrecht ß-Stange","name_original":"Rudern aufrecht ß-Stange","creation_date":null,"uuid":"82be7262-2c5d-4c38-a433-61160fd22a0b","license":1,"category":13,"language":1,"muscles":[2,9],"muscles_secondary":[1],"equipment":[1]},{"id":245,"license_author":"Paul.Sichwardt","status":"2","description":"<p>Geraden Rücken lassen</p>","name":"Rudern Eng Zum Bauch","name_original":"Rudern eng zum Bauch","creation_date":"2014-04-12","uuid":"788ef0a5-492f-48a7-87dc-b15dda185bb8","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":59,"license_author":"wger.de","status":"2","description":"<p>Greife die Langhantel mit breitem (etwas mehr als Schulterbreit) Griff und beuge dich nach vorne. Dabei ist der Oberkörper nicht ganz Waagerecht, sonder ein bisschen steiler, der Kopf schaut nach vorn und die Brust is rausgestreckt.</p>\n<p>Ziehe nun das Gewicht in richtung Bauchnabel. Schwinge während der Bewegung den Oberkörper nicht und halte die Arme dicht am Körper wenn du sie hochziehst. Bringe die Hantel langsam wieder nach unten.</p>","name":"Rudern Vorgebeugt LH","name_original":"Rudern vorgebeugt LH","creation_date":null,"uuid":"126d719a-4b59-4458-b182-d578cdcfee1a","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[2,1],"equipment":[3]},{"id":70,"license_author":"wger.de","status":"2","description":"<p>Bewegungsablauf wie beim normalen vorgebeugtem Rudern, nur die Handstellung ist <em>reverse</em>, also die Handfläche zeigen nach hinten.</p>\n<p>Greife die Langhantel mit breitem (etwas mehr als Schulterbreit) Griff und beuge dich nach vorne. Dabei ist der Oberkörper nicht ganz Waagerecht, sonder ein bisschen steiler, der Kopf schaut nach vorn und die Brust is rausgestreckt.</p>\n<p>Ziehe nun das Gewicht in richtung Bauchnabel. Schwinge während der Bewegung den Oberkörper nicht und halte die Arme dicht am Körper wenn du sie hochziehst. Bringe die Hantel langsam wieder nach unten.</p>","name":"Rudern Vorgebeugt LH Reverse","name_original":"Rudern vorgebeugt LH reverse","creation_date":null,"uuid":"5da0cb07-6e05-4ca5-95e2-e44ad67e6757","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[2,1],"equipment":[1]},{"id":370,"license_author":"perteus","status":"2","description":"volíme velmi úzký postoj(mezi chodidly pouze několik cm) a nohy necháváme při provádění cviku napnuté. Činku držíme pevně oběma rukama a s napnutými nohami vytahujeme nahoru. Při tomto cviku pracují především hamstringy a vzpřimovače zad. Je velice důležité, abychom činku po celou dobu drželi co nejblíže těla. Pokud ji totiž dáme od těla daleko, tak na spodní záda působí obrovská páka a hrozí velké riziko zranění.\n\nhttp://mrtvytah.eu/rumunsky-mrtvy-tah/ ","name":"Rumunský Mrtvý Tah","name_original":"Rumunský mrtvý tah","creation_date":"2016-01-13","uuid":"f18f3080-8495-4986-aff6-5b5e6504894c","license":2,"category":12,"language":9,"muscles":[],"muscles_secondary":[],"equipment":[1]},{"id":397,"license_author":"BeLikeWater","status":"2","description":"<p>Running or jogging outside in a park, on the tracks,...</p>","name":"Run","name_original":"Run","creation_date":"2016-05-11","uuid":"bbee856a-abe0-4a5f-a622-d5f85ee1d1f1","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":337,"license_author":"kclark","status":"1","description":"<p>3-5 Mi. Run </p>\n<p>Record Distance per Workout</p>","name":"Run","name_original":"Run","creation_date":"2015-07-14","uuid":"c568adc4-a305-4766-b71f-f79c8c7a9a05","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":398,"license_author":"BeLikeWater","status":"2","description":"<p>Run and do some interval trainings such as hill repat, fartlek,..</p>","name":"Run - Interval Training ","name_original":"Run - Interval Training ","creation_date":"2016-05-11","uuid":"2359347e-0561-4d03-b050-b3c18f9d7b37","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":269,"license_author":"foguinho.peruca","status":"2","description":"<p>Run on a treadmill</p>","name":"Run - Treadmill","name_original":"Run - treadmill","creation_date":"2014-09-03","uuid":"51d56238-31a1-4e5a-b747-da30eece4871","license":1,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":357,"license_author":"miguelaprovencio","status":"1","description":"<p>Run and Walk</p>\n<p>------------------------------------------------------------</p>","name":"Run/Walk","name_original":"Run/Walk","creation_date":"2015-12-12","uuid":"3e88d7db-19c6-48e6-9cf2-715a40ddde0f","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":527,"license_author":"test0001","status":"1","description":"<p>First, one should sit on the floor with knees bent as in a \"sit-up\" position. The feet should be kept together and slightly above the ground or put under a stable surface. The torso should be kept straight with the back kept off the ground at a 45 degree angle. Arms should be held together away from the body in a straight fashion and hands kept locked together like a ball or one can hold a weight to increase the difficulty. Next, the arms should be swung from one side to another in a twisting motion, with each swing to a side counting as one repetition. The slower one moves the arms from side to side, the harder the exercise becomes, working the abdomen that much better. When moving one's arms during the exercise, it is crucial to not stop between repetitions or else one will lose the effect of working the abdomen. Constant breathing in and out during the exercise is important as one should not hold one's breath</p>\n<p>- Wikipedia</p>","name":"Russian Twist","name_original":"Russian Twist","creation_date":"2017-12-03","uuid":"05857de7-b503-447f-a66c-a90ab5adf399","license":3,"category":10,"language":2,"muscles":[14],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=21","previous":"https://wger.de/api/v2/exercise/?page=19","results":[{"id":427,"license_author":"bodybuildin.com","status":"1","description":"<ol>\n<li>Lie down on the floor placing your feet either under something that will not move or by having a partner hold them. Your legs should be bent at the knees.</li>\n<li>Elevate your upper body so that it creates an imaginary V-shape with your thighs. Your arms should be fully extended in front of you perpendicular to your torso and with the hands clasped. This is the starting position.</li>\n<li>Twist your torso to the right side until your arms are parallel with the floor while breathing out.</li>\n<li>Hold the contraction for a second and move back to the starting position while breathing out. Now move to the opposite side performing the same techniques you applied to the right side.</li>\n<li>Repeat for the recommended amount of repetitions.</li>\n</ol>","name":"Russian Twist","name_original":"Russian Twist","creation_date":"2016-10-25","uuid":"3eb06d8e-fabe-4d4b-8119-b83cc1dadb7c","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":488,"license_author":"https://en.wikipedia.org/wiki/Russian_twist","status":"1","description":"<p>https://en.wikipedia.org/wiki/Russian_twist</p>","name":"Russian Twist","name_original":"Russian Twist","creation_date":"2017-10-29","uuid":"072d6687-8e26-464e-a284-6ca44106c798","license":2,"category":10,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":498,"license_author":"Bonniechica","status":"1","description":"<p>Beine gebeugt anheben den Oberkörper twisten</p>","name":"Russisch Twist","name_original":"russisch Twist","creation_date":"2017-11-17","uuid":"d7a4d35b-005d-48c2-a8fb-d3c30a687bb6","license":2,"category":10,"language":1,"muscles":[14,6],"muscles_secondary":[10],"equipment":[10]},{"id":16,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf die Bank, die Füße sind fest auf dem Boden und geben Halt, der Kopf liegt auf der Bank. Nehme die Hanteln in die Hand und drücke sie nach oben. Bringe die Hanteln nach unten, bis sie neben der Brust sind. Drücke das Gewicht wieder nach oben.</p>","name":"Schrägbankdrücken KH","name_original":"Schrägbankdrücken KH","creation_date":null,"uuid":"af491dbd-311f-4648-a4f4-ab293329fcdb","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[2,5],"equipment":[3,9]},{"id":41,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf die Bank, die Füße sind fest auf dem Boden und geben Halt der Kopf liegt auf der Bank. Nehme die Hantel etwas mehr als Schulterbreit aus der Halterung raus und drücke sie nach oben. Bringe die Hantel nach unten, bis sie die Brust kurz berührt. Drücke das Gewicht wieder nach oben.</p>","name":"Schrägbankdrücken LH","name_original":"Schrägbankdrücken LH","creation_date":null,"uuid":"fe7f0a02-3675-4cf2-9726-e762f0b2309e","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[2,5],"equipment":[1,9]},{"id":61,"license_author":"wger.de","status":"2","description":"<p>Selbe Ausführung wie beim Schrägbankdrücken mit der Langhantel, aber in der Multipresse eben: Setze dich auf die Bank, die Füße sind fest auf dem Boden und geben Halt der Kopf liegt auf der Bank. Nehme die Stange etwas mehr als Schulterbreit aus der Halterung raus und drücke sie nach oben. Bringe die Stange nach unten, bis sie die Brust kurz berührt. Drücke das Gewicht wieder nach oben.</p>","name":"Schrägbankdrücken MP","name_original":"Schrägbankdrücken MP","creation_date":null,"uuid":"d9319e68-b2a2-4306-9f7d-4d53242dd6b0","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[2,5],"equipment":[]},{"id":241,"license_author":"klabautermann","status":"2","description":"<ul>\n<li>Übung kann im Sitzen oder im Stehen ausgeführt werden</li>\n<li>Rücken durchgestreckt, Blick geradeaus, unteren Rücken und Bauchmuskulatur anspannen</li>\n<li>Ellenbogen nicht zu weit absenken, idealerweise bis maximal zur Schulterhöhe</li>\n</ul>","name":"Schulterdrücken KH","name_original":"Schulterdrücken KH","creation_date":"2014-04-08","uuid":"0d4390ea-51dc-42dc-94af-ba0e94a73484","license":1,"category":13,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[3]},{"id":266,"license_author":"Konsumopfer","status":"2","description":"<p>Schulterdrücken im Sitzen mit der Langhantel</p>","name":"Schulterdrücken LH","name_original":"Schulterdrücken LH","creation_date":"2014-08-14","uuid":"197600e7-9bb2-448c-baca-244d679e7b07","license":1,"category":13,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":467,"license_author":"xDaphil","status":"1","description":"<p> </p>\n\n\n<p>Schulterdrücken im Sitzen mit der Langhantel hinter dem Kopf</p>\n\n","name":"Schulterdrücken LH Hinter Dem Kopf","name_original":"Schulterdrücken LH hinter dem Kopf","creation_date":"2017-05-12","uuid":"f95d5f5e-37fc-4011-a680-ef5f788f1e68","license":2,"category":13,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":53,"license_author":"wger.de","status":"2","description":"","name":"Schultermaschine","name_original":"Schultermaschine","creation_date":null,"uuid":"069c8dfb-b5ce-42e9-9659-89d2d73e63e5","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[5],"equipment":[]},{"id":503,"license_author":"Bonniechica","status":"1","description":"<p>In Bauchlage im Wechsel Arm Beim diagonal heben</p>","name":"Schwimmer","name_original":"Schwimmer","creation_date":"2017-11-17","uuid":"81b90e60-6335-4302-ba67-fbb71f3d5cab","license":2,"category":12,"language":1,"muscles":[6],"muscles_secondary":[8],"equipment":[7]},{"id":222,"license_author":"hamihamann","status":"2","description":"<p>Über dem Brett zur Isolation des Bizeps</p>","name":"Scott Curl KH","name_original":"Scott Curl KH","creation_date":"2014-02-21","uuid":"bf5973a3-6434-46a6-babd-80367866eac7","license":1,"category":8,"language":1,"muscles":[1],"muscles_secondary":[13],"equipment":[3]},{"id":569,"license_author":"stsoerens","status":"1","description":"<p>jump from seated position onto box</p>","name":"Seated Box Jump","name_original":"seated box jump","creation_date":"2018-05-08","uuid":"f4a993f4-c631-4172-9024-e84b5e9732df","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":377,"license_author":"Araaosf","status":"2","description":"Preparation\nSit on seat and lift one leg onto padded lever. Lean back onto back pad. Grasp handles attatched to leg levers. Push handles together and raise other leg onto other padded lever. Release leg lever handles and grasp other handles to each side.\n\nExecution\nMove legs together until leg levers make contact. Allow legs to seperate far apart until slight stretch and repeat.","name":"Seated Hip Adduction","name_original":"Seated Hip Adduction","creation_date":"2016-01-30","uuid":"4b3025a9-b717-4577-9e92-b1c200fe5f1c","license":2,"category":9,"language":7,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":386,"license_author":"richmr2174@gmail.com","status":"2","description":"<p>Sit down on a back (better with back support). Take a dumbbell firmly with both hands and hold it with extended arms over your head. With your palms facing upward and holding the weight of the dumbbell, slowly lower the weight behind your head.</p>\n<p> </p>","name":"Seated Triceps Press","name_original":"Seated Triceps Press","creation_date":"2016-02-26","uuid":"76964898-192c-4e93-b24c-914ea542002b","license":2,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[8,3]},{"id":465,"license_author":"kjoe","status":"1","description":"<p>put your feet on a high level and pull your self</p>","name":"Seatups","name_original":"Seatups","creation_date":"2017-05-02","uuid":"5d373fe0-32ec-4e5d-9ffa-8a588913b7bc","license":2,"category":10,"language":2,"muscles":[6],"muscles_secondary":[3],"equipment":[]},{"id":132,"license_author":"wger.de","status":"2","description":"<p>Stelle dich aufrecht neben einem Kabelzug und halte dich mit der einen Hand fest, mit der anderen nimmst du den Kabelgriff. Hebe nun den Arm mit dem Gewicht seitlich, strecke ihn aber nicht aus. Bewege während der Übung nur diesen Arm, schwinge nicht mit und drehe deinen Rumpf auch nicht mit. Auf dem höchsten Punkt machst du 1sek. Pause und gehst dann langsam runter. Wenn deine Hand kurz vor deinem Körper ist, bringst du das Gewicht wieder rauf.</p>","name":"Seitheben am Kabel, Einarmig","name_original":"Seitheben am Kabel, einarmig","creation_date":null,"uuid":"382731d2-ae07-4a3c-a055-09dadd5f12e0","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":20,"license_author":"wger.de","status":"2","description":"<p>Stelle dich mit schulterbreiten Beinen und leicht nach außen zeigende Füße mit zwei Hanteln auf. Die Arme sind fast vollständig ausgestreckt. Hebe nun die Hanteln seitlich nach oben, auf dem höchsten Punkt kannst du eine kurze (1-2 sek.) Pause machen.</p>\n<p>Achte darauf, dass die Handflächen sich während der Bewegung nicht drehen, sie sollten also immer zum Boden oder zum Körper zeigen.</p>","name":"Seitheben KH","name_original":"Seitheben KH","creation_date":null,"uuid":"72e78f4d-65f7-4ddd-9247-cdc1e133fa80","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[],"equipment":[3]},{"id":551,"license_author":"mvyrbdy","status":"1","description":"<p>Mit einem Fuß das Thermalbad auf dem Boden fixieren und Seitheben ausführen. </p>","name":"Seitheben Mit Theraband","name_original":"Seitheben mit Theraband","creation_date":"2018-02-26","uuid":"b1d33741-d838-49df-bbc9-f0e505be13d2","license":2,"category":13,"language":1,"muscles":[2,9],"muscles_secondary":[],"equipment":[]},{"id":496,"license_author":"Bonniechica","status":"1","description":"<p>Cardio-Übung: schnelle Wechselsprünge mit Kniebeuge</p>","name":"Seitliche Ausfallschritt-Sprünge","name_original":"seitliche Ausfallschritt-Sprünge","creation_date":"2017-11-17","uuid":"52c096ea-05d5-4ee9-aefd-257495409855","license":2,"category":9,"language":1,"muscles":[10],"muscles_secondary":[8],"equipment":[7]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=22","previous":"https://wger.de/api/v2/exercise/?page=20","results":[{"id":240,"license_author":"klabautermann","status":"2","description":"<p>Zielmuskeln: Schräger Bauchmuskel</p>\n<p>Unterstützende Muskulatur: Gerader Bauchmuskel</p>\n<p>Erforderliches Equipment: Roman Chair</p>\n<ul>\n<li>Gerader Körper in der Ausgangsposition</li>\n<li>Oberkörper in Richtung Boden beugen</li>\n<li>Wenn der Oberkörper ungefähr parallel zum Boden ist, mit der Aufwärtsbewegung beginnen</li>\n<li>Hände wahlweise hinter dem Kopf oder vor der Brust</li>\n</ul>","name":"Seitliches Oberkörperbeugen am Gerät","name_original":"Seitliches Oberkörperbeugen am Gerät","creation_date":"2014-04-08","uuid":"0f464c32-90c5-4698-8f97-eae0ae663a74","license":1,"category":10,"language":1,"muscles":[14],"muscles_secondary":[6],"equipment":[]},{"id":239,"license_author":"klabautermann,walker","status":"2","description":"<p>Zielmuskeln: Schräger Bauchmuskel</p>\n<p>Unterstützende Muskulatur: Gerader Bauchmuskel</p>\n<p> </p>","name":"Seitliches Oberkörperbeugen Mit KH","name_original":"Seitliches Oberkörperbeugen mit KH","creation_date":"2014-04-08","uuid":"a2ac7d09-20f1-4c52-a5de-381882088803","license":1,"category":10,"language":1,"muscles":[14],"muscles_secondary":[6],"equipment":[3]},{"id":464,"license_author":"juppsen","status":"1","description":"<p>Oberkürper setlich auf Unterarm stützen, Beine ausgestreckt. Oberkörper drehen.</p>","name":"Seitstütz Mit Rotation","name_original":"Seitstütz mit Rotation","creation_date":"2017-04-27","uuid":"822fae61-63ef-4abb-8728-81ca79e5e6f1","license":2,"category":10,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":430,"license_author":"trungns","status":"1","description":"<p>đây là một động tác ăn vào cơ Lưng Giữa, những nhóm cơ ăn theo cũng rất nhiều là cơ lưng dưới, cơ xô và cơ tay trước.</p>","name":"Selectorized Seated Cable Row,","name_original":"Selectorized Seated Cable Row,","creation_date":"2016-10-30","uuid":"b22c5d87-e3c8-4025-aa76-667126682bf2","license":2,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":339,"license_author":"cal.zabel","status":"2","description":"<ol>\n<li>Attach a single handle to a low cable.</li>\n<li>After selecting the correct weight, stand a couple feet back with a wide-split stance. Your arm should be extended and your shoulder forward. This will be your starting position.</li>\n<li>Perform the movement by retracting the shoulder and flexing the elbow. As you pull, supinate the wrist, turning the palm upward as you go.</li>\n<li>After a brief pause, return to the starting position.</li>\n</ol>","name":"Shotgun Row","name_original":"Shotgun Row","creation_date":"2015-07-21","uuid":"b6492677-07df-4399-bc90-20b58e4dba35","license":2,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":547,"license_author":"Whythebigpaws","status":"1","description":"<p>Hold a bar or broomstick on either end. Raise the bar above the head and slowly lower the bar behind you to rest on the hips/back/butt. This exercise is to improve pasture and mobility of the shoulders. </p>","name":"Shoulder Dislocations","name_original":"Shoulder dislocations","creation_date":"2018-02-07","uuid":"9bb294b3-2bbe-494b-ac9d-c27b95f5b02f","license":2,"category":13,"language":2,"muscles":[2,12,9],"muscles_secondary":[],"equipment":[1]},{"id":119,"license_author":"wger.de","status":"2","description":"<p>Sit on a bench, the back rest should be almost vertical. Take a barbell with a shoulder wide grip and bring it up to chest height. Press the weight up, but don't stretch the arms completely. Go slowly down and repeat.</p>","name":"Shoulder Press, Barbell","name_original":"Shoulder press, barbell","creation_date":null,"uuid":"9926e18f-4e2b-4c20-9477-9bfb08d229bc","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[1]},{"id":123,"license_author":"wger.de","status":"2","description":"<p>Sit on a bench, the back rest should be almost vertical. Take two dumbbells and bring them up to shoulder height, the palms and the elbows point during the whole exercise to the front. Press the weights up, at the highest point they come very near but don't touch. Go slowly down and repeat.</p>","name":"Shoulder Press, Dumbbells","name_original":"Shoulder press, dumbbells","creation_date":null,"uuid":"1df6a1b5-7bd2-402f-9d5e-94f9ed6d8b54","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[3]},{"id":152,"license_author":"wger.de","status":"2","description":"","name":"Shoulder Press, on Machine","name_original":"Shoulder press, on machine","creation_date":"2013-05-05","uuid":"7389be43-215b-4db8-8b69-75dc77004d74","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":155,"license_author":"wger.de","status":"2","description":"<p>The exercise is basically the same as with a free barbell:</p>\n<p>Sit on a bench, the back rest should be almost vertical. Take a bar with a shoulder wide grip and bring it down to chest height. Press the weight up, but don't stretch the arms completely. Go slowly down and repeat.</p>","name":"Shoulder Press, on Multi Press","name_original":"Shoulder press, on multi press","creation_date":"2013-05-08","uuid":"68d505ec-5416-4153-b228-eb1545d5c89f","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[]},{"id":150,"license_author":"wger.de","status":"2","description":"<p>Take a barbell and stand with a straight body, the arms are hanging freely in front of you. Lift from this position the shoulders as high as you can, but don't bend the arms during the movement. On the highest point, make a short pause of 1 or 2 seconds before returning slowly to the initial position.</p>\n<p>When training with a higher weight, make sure that you still do the whole movement!</p>","name":"Shrugs, Barbells","name_original":"Shrugs, barbells","creation_date":"2013-05-05","uuid":"3721be0c-2a59-4bb9-90d3-695faaf028af","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[1]},{"id":151,"license_author":"wger.de","status":"2","description":"<p>Stand with straight body, the hands are hanging freely on the side and hold each a dumbbell. Lift from this position the shoulders as high as you can, but don't bend the arms during the movement. On the highest point, make a short pause of 1 or 2 seconds before returning slowly to the initial position.</p>\n<p>When training with a higher weight, make sure that you still do the whole movement!</p>","name":"Shrugs, Dumbbells","name_original":"Shrugs, dumbbells","creation_date":"2013-05-05","uuid":"ee61aef0-f0c7-4a7a-882a-3b39312dfffd","license":1,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[3]},{"id":8,"license_author":"wger.de","status":"2","description":"<p>Stelle dich mit geradem Oberkörper hin, die Hände hängen frei nach unten und halten je eine Kurzhantel. Hebe aus dieser Position die Schultern so weit nach oben, wie es geht, beuge aber die Arme während der Übung nicht. Am höchsten Punkt kannst du eine oder zwei Sekunden Pause machen bevor du langsam wieder runtergehst.</p>\n<p>Bei größerem Gewicht, beachte immer, dass du immer noch die volle Bewegungsamplitude durchführen kannst.</p>","name":"Shrugs (Schulterheben) Mit KH","name_original":"Shrugs (Schulterheben) mit KH","creation_date":null,"uuid":"6dde45fc-7fdf-4523-a039-9c373677a750","license":1,"category":13,"language":1,"muscles":[9],"muscles_secondary":[5],"equipment":[3]},{"id":137,"license_author":"wger.de","status":"2","description":"<p>Stelle dich mit geradem Oberkörper hin, die Hände hängen frei nach unten und halten die Langhantel. Hebe aus dieser Position die Schultern so weit nach oben, wie es geht, beuge aber die Arme während der Übung nicht. Am höchsten Punkt kannst du eine oder zwei Sekunden Pause machen bevor du langsam wieder runtergehst.</p>\n<p>Bei größerem Gewicht, beachte immer, dass du immer noch die volle Bewegungsamplitude durchführen kannst.</p>","name":"Shrugs (Schulterheben) Mit LH","name_original":"Shrugs (Schulterheben) mit LH","creation_date":null,"uuid":"a63d40df-a872-44e7-87d2-9b58b67d5406","license":1,"category":13,"language":1,"muscles":[9],"muscles_secondary":[5],"equipment":[1]},{"id":67,"license_author":"wger.de","status":"2","description":"<p>Greife die Stange der Multipresse, stelle dich mit Schulterbreitem Stand und sehr leicht gebeugte Beine auf und lasse den Blick nach vorn. Die Arme hängen am Körper. Aus dieser Position hebst du nun das Gewicht, indem du die Schultern nach oben ziehst. Beuge dabei die Arme nicht. Auf dem höchsten Punkt kannst du 1 oder 2 Sekunden ausharren, bringe dann die Schultern langsam nach unten.</p>","name":"Shrugs (Schulterheben) Mit MP","name_original":"Shrugs (Schulterheben) mit MP","creation_date":null,"uuid":"475a9665-2044-4c76-be29-cabbbef126bd","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[5],"equipment":[]},{"id":176,"license_author":"kwrindy","status":"2","description":"<p>Hold weight in one hand. Bend side ways to the knee. Pull upo to upright position using your obliquus.</p>","name":"Side Crunch","name_original":"Side Crunch","creation_date":"2013-07-19","uuid":"53a9f95e-914c-4790-940f-f5346159ea72","license":1,"category":10,"language":2,"muscles":[14],"muscles_secondary":[6],"equipment":[4]},{"id":278,"license_author":"GiglioRosso","status":"2","description":"<p>AKA dumbbell side bends. Stand in line with the hips with slightly bent knees, maintain the natural curvature of the spine, hand stretched by the body, grip the barbell with one hand. <em> </em>Make slow and controlled torso side flexions till you reach the angle of approximately 45°.</p>","name":"Side Dumbbell Trunk Flexion","name_original":"Side dumbbell trunk flexion","creation_date":"2014-10-22","uuid":"0203c27e-e3f0-4ae2-b5c3-f11c45336f54","license":1,"category":12,"language":2,"muscles":[14],"muscles_secondary":[6],"equipment":[3]},{"id":422,"license_author":"apeschel","status":"2","description":"<p>With a weight in one hand, lie on your side opposite the weight. Keep your knees slightly bent. Hold your elbow against your side, and extend your upper arm straight ahead of you. While continuing to hold your elbow against your side, rotate your upper arm 90 degrees upwards.</p>\n<p>It is helpful to place a towel under your armpit to help with the form on this exercise. Placing a support under your head for the duration of the exercise is also a good idea.</p>","name":"Side-lying External Rotation","name_original":"Side-lying External Rotation","creation_date":"2016-09-29","uuid":"9f705970-cba3-4cef-a582-c2cc69ae9b5f","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":325,"license_author":"http://www.bodybuilding.com/","status":"2","description":"<p>Works your obliques and helps stabilize your spine. Lie on your side and support your body between your forearm and knee to your feet.</p>","name":"Side Plank","name_original":"Side Plank","creation_date":"2015-05-21","uuid":"a36f852f-a29f-4f93-81b6-1012047ac1ee","license":2,"category":10,"language":2,"muscles":[6],"muscles_secondary":[14],"equipment":[7]},{"id":319,"license_author":"tobahl","status":"2","description":"<p>Stand up or sit , keep both weights in front against legs or at side. Keep arms at around a 90 degree angle. Lift elbows up slowly and squeese traps when at topmost position. Lower the weights slowly back to starting position.</p>\n<p>2 seconds up, 2 seconds down</p>","name":"Side Raise","name_original":"Side raise","creation_date":"2015-03-15","uuid":"bd892f71-2b19-41c4-90e2-2cd4df82c621","license":3,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=23","previous":"https://wger.de/api/v2/exercise/?page=21","results":[{"id":302,"license_author":"nate303303","status":"2","description":"<p>-start in push up position</p>\n<p>-lean the body weight to the right side, and complete a push up with the chest over the right hand</p>\n<p>-come back to the centered position</p>\n<p>-on rep 2, lean to the left side</p>","name":"Side to Side Push Ups","name_original":"Side to Side Push Ups","creation_date":"2015-02-06","uuid":"fc63159a-3939-426c-b236-d4b39adbf28c","license":2,"category":11,"language":2,"muscles":[2,14,4,5],"muscles_secondary":[],"equipment":[]},{"id":205,"license_author":"tuckerm","status":"2","description":"<p>Sit on the preacher curl bench and perform a bicep curl with a dumbbell in one hand. Your other hand can be at rest, or beneath your curling arm's elbow.</p>","name":"Single-arm Preacher Curl","name_original":"Single-arm preacher curl","creation_date":"2014-01-15","uuid":"83e079a9-b61c-413b-b055-f9cf515904f1","license":1,"category":8,"language":2,"muscles":[1],"muscles_secondary":[],"equipment":[3]},{"id":103,"license_author":"wger.de","status":"2","description":"<p>Sit on a bench for calf raises and check that the feet are half free and that you can completely stretch the calf muscles down. Pull your calves up, going as far (up) as you can. Make at the highest point a short pause of 1 or 2 seconds and go down.</p>","name":"Sitting Calf Raises","name_original":"Sitting calf raises","creation_date":null,"uuid":"399666e7-30a7-4b86-833d-4422e4c72b61","license":1,"category":14,"language":2,"muscles":[15],"muscles_secondary":[7],"equipment":[]},{"id":95,"license_author":"wger.de","status":"2","description":"<p>Sit on a mat, your calves are resting on a bench, the knees make a right angle. Hold your hands behind your neck. Go now up with a rolling movement of your back, you should feel how the individual vertebrae lose contact with the mat. At the highest point, contract your abs as much as you can and hold there for 2 sec. Go now down, unrolling your back.</p>\n<p> </p>","name":"Sit-ups","name_original":"Sit-ups","creation_date":null,"uuid":"fb750082-7034-4c51-b1e4-dfa0fe2dac8e","license":1,"category":10,"language":2,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":57,"license_author":"wger.de","status":"2","description":"<p>Lege dich auf eine Matte, die Knie sind rechtwiklig angewinkelt und die Fersen liegen auf eine Bank. Die Hände sind hinter dem Nacken. Das Hochgehen wird mit einer rollenden Bewegung durchgeführt: die Wirbelsäule sollte sich Wirbel für Wirbel von der Matte lösen. Ein Hohlkreuz ist stets zu vermeiden. Auf der höchsten Stelle sollten die Muskeln etwa 2 sek. maximal angespannt werden bevor die rollende Bewegung in der Gegenrichtung durchgeführt wird.</p>","name":"Sit Ups","name_original":"Sit Ups","creation_date":null,"uuid":"60f329dd-f8ab-469a-8a88-39f80275b3a7","license":1,"category":10,"language":1,"muscles":[6],"muscles_secondary":[],"equipment":[]},{"id":411,"license_author":"Cerin","status":"2","description":"<p>Do a single, double footed jump for each swing of the rope.</p>\n<p>Work on a smooth, rhythmical movement, bouncing lightly on the balls of your feet.</p>","name":"Skipping - Standard","name_original":"Skipping - Standard","creation_date":"2016-08-15","uuid":"2c864448-288d-4e79-9da6-a3c99af3c1fb","license":2,"category":14,"language":2,"muscles":[7],"muscles_secondary":[],"equipment":[]},{"id":218,"license_author":"tuckerm","status":"2","description":"<p>Perform a standard bench press on the smith machine, but have your hands on the bar about shoulder width apart, and keep your elbows close to your body.</p>","name":"Smith Machine Close-grip Bench Press","name_original":"Smith machine close-grip bench press","creation_date":"2014-02-01","uuid":"9d1c13b0-2e9b-4585-b1d7-fc48ba4c692f","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[4],"equipment":[]},{"id":271,"license_author":"Mens Fitness","status":"2","description":"<p>Stand with your feet at hip width and your shins against the bar. Grasp the bar at double shoulder width and, keeping your lower back flat, drive your heels into the floor to begin lifting the bar. When it's above your knees, explosively extend your hips and shrug your shoulders. Let the momentum carry the weight overhead.</p>","name":"Snach","name_original":"Snach","creation_date":"2014-09-08","uuid":"3490d1c7-c9ce-4a08-acd3-e0bdada71c37","license":3,"category":13,"language":2,"muscles":[2],"muscles_secondary":[],"equipment":[1]},{"id":532,"license_author":"somger","status":"1","description":"<p>öööaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa</p>","name":"Snatch","name_original":"Snatch","creation_date":"2018-01-02","uuid":"c8717be0-6466-4d47-8041-77556e2365df","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]},{"id":454,"license_author":"Voman85","status":"1","description":"This exercise entails anything involving soccer, including any exercises that are soccer-related.","name":"Soccer","name_original":"Soccer","creation_date":"2017-03-06","uuid":"b1f37312-2123-4d44-a629-f59bd293fa3d","license":2,"category":9,"language":2,"muscles":[2],"muscles_secondary":[12],"equipment":[]},{"id":328,"license_author":"MrSteele","status":"2","description":"<p>Deadlift with short (&lt;1min) rest between sets.</p>","name":"Speed Deadlift","name_original":"Speed Deadlift","creation_date":"2015-06-11","uuid":"273f9563-948a-44c8-9353-b7213703f502","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":504,"license_author":"Bonniechica","status":"1","description":"<p>Liegestütz in Verbindung mit Kletterbeweinglas ausführen</p>","name":"Spiderman Liegestütz","name_original":"Spiderman Liegestütz","creation_date":"2017-11-17","uuid":"666e2d52-b3d0-4241-b5ed-54815775cc06","license":2,"category":11,"language":1,"muscles":[4,5],"muscles_secondary":[14,10,6],"equipment":[7]},{"id":385,"license_author":"techbearable","status":"1","description":"<p>The main muscles used in a spinning exercise are the quadriceps.</p>","name":"Spinning","name_original":"Spinning","creation_date":"2016-02-20","uuid":"fddd6249-8c6b-4053-ad98-37924facd6fc","license":2,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8,6],"equipment":[]},{"id":170,"license_author":"djblitzd","status":"2","description":"<p>Lie on your back with your legs straight and arms at your sides, keeping your elbows bent at 90 degrees. As you sit up, twist your upper body to the left and bring your left knee toward your right elbow while you swing your left arm back. Lower your body to the starting position, and repeat to your right. That's 1 rep.</p>","name":"Splinter Sit-ups","name_original":"Splinter Sit-ups","creation_date":"2013-07-06","uuid":"ec706f20-6ea7-40f9-96f4-994c66554e17","license":1,"category":10,"language":2,"muscles":[14],"muscles_secondary":[],"equipment":[]},{"id":474,"license_author":"tapiwan","status":"1","description":"<p>High-bar squats with a barbell on your back.</p>","name":"Squat","name_original":"Squat","creation_date":"2017-07-14","uuid":"9bf001d2-c174-4d59-beb1-e6d96e3b003f","license":2,"category":9,"language":1,"muscles":[11,7,8,10,15],"muscles_secondary":[],"equipment":[1]},{"id":492,"license_author":"Hirvesh","status":"1","description":"<p>Squat is something everyone does!</p>","name":"Squat","name_original":"Squat","creation_date":"2017-11-10","uuid":"6dfef934-9b15-4842-9ff5-daf9af298f2f","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":185,"license_author":"OGhTebfCxhexZXuf35mUxV9C--A","status":"2","description":"<p>Jump wide, then close</p>","name":"Squat Jumps","name_original":"Squat Jumps","creation_date":"2013-07-30","uuid":"bdb7bdbb-8930-46e5-8b98-eb13e604553f","license":1,"category":9,"language":2,"muscles":[10],"muscles_secondary":[],"equipment":[]},{"id":111,"license_author":"wger.de","status":"2","description":"<p>Make sure you have put the barbell at a height where you can comfortably take it out and put it back in. Take it out and make yourself ready:</p>\n<ul>\n<li>The bar is somewhat lower than your shoulders</li>\n<li>The feet are quite apart and point out</li>\n<li>The head is in your neck and looks up</li>\n<li>The chest is out</li>\n</ul>\n<p>Go now slowly down, till your thighs are parallel with the floor, not lower. The knees point outwards, your butt, out. Make a small pause of 1 second and with as much energy as you can, push the weight up. Make a pause of 2 seconds and repeat.</p>","name":"Squats","name_original":"Squats","creation_date":null,"uuid":"c4856da3-8454-4857-8997-336d06df590f","license":1,"category":9,"language":2,"muscles":[10],"muscles_secondary":[8],"equipment":[1]},{"id":372,"license_author":"wger.de","status":"2","description":"* Posaďte se čelem ke kladce, zapřete stehna o opěrku a uchopte nadhmatem horní kladku. Úchop zvolte širší než na šířku ramen. Střed těla udržujte zpevněný, hrudník je vypnutý vzhůru, pohled směřuje vzhůru tak, aby krční páteř zůstala v neutrální poloze.\n\n* Stahujte kladku k horní části hrudníku. Ramena stahujte směrem dolů. Lokty jsou v ose těla, nebo se pohybují mírně za tělo. Soustřeďte se na fixaci lopatek směrem k páteři. Tím docílíte maximálního zapojení cílových svalů. Po dosažení maximální kontrakce pomalu pouštějte kladku do výchozí polohy.\n\n* Úchop můžete zvolit palcový (palec proti ostatním prstům), nebo bezpalcový (palec zároveň s ostatními prsty) podle toho, který Vám více vyhovuje. Nádech je v excentrické fázi cviku (pohyb kladky vzhůru), výdech v koncentrické fázi (přitažení kladky k hrudníku).\n\nhttp://kulturistika.ronnie.cz/c-17653-zasobnik-cviku-10-zada-pritahy-horni-kladky.html","name":"Stahování Horní Kladky Nadhmatem","name_original":"Stahování horní kladky nadhmatem","creation_date":"2016-01-14","uuid":"6e72cd75-2ff7-4ee9-b43b-90ba82bdc6ae","license":2,"category":12,"language":9,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":366,"license_author":"perteus","status":"2","description":"Výchozí poloha cviku je opět vsedě čelem ke kladce. Šířka úchopu je zhruba na šířku ramen. Trup je zpevněný a v mírném záklonu. Kladku s výdechem stahujte k horní části hrudníku, lokty se pohybují blízko k tělu. Nádech je při pohybu kladky vzhůru.","name":"Stahování Horní Kladky Podhmatem","name_original":"Stahování horní kladky podhmatem","creation_date":"2016-01-13","uuid":"87ea2a91-3276-4fd2-abdf-4dcd68ef5842","license":2,"category":12,"language":9,"muscles":[12,9],"muscles_secondary":[1,5],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=24","previous":"https://wger.de/api/v2/exercise/?page=22","results":[{"id":102,"license_author":"wger.de","status":"2","description":"<p>Get onto the calf raises machine, you should able to completely push your calves down. Stand straight, don't make a hollow back and don't bend your legs. Pull yourself up as high as you can. Make a small pause of 1 - 2 seconds and go slowly down.</p>","name":"Standing Calf Raises","name_original":"Standing calf raises","creation_date":null,"uuid":"abc4c62e-27b2-4c31-8766-40f8dca84cab","license":1,"category":14,"language":2,"muscles":[7],"muscles_secondary":[15],"equipment":[]},{"id":382,"license_author":"pwiltrout","status":"2","description":"<p>Grab a wrist roller tool with both hands while standing with your feet about shoulder width apart. If your gym does not have a wrist roller tool, you can easily put one together. All you need is a 5 or 10 pound weight plate, a strong thin rope about 3 feet long and a 6-8 inch stick or bar. Securely fasten the rope to the middle of the bar/stick and tie the other end of the rope to the weight plate. To begin this exercise, grab the bar/stick with both hands using an overhand grip. Extend both arms straight out in front of you, parallel to the floor. Next, roll the weight up from the floor by rapidly twisting the bar/stick with your hands and wrists. Once the weight reaches the top, slowly lower the plate back to the floor by reversing the motion of your hands and wrists. Repeat (if you can!).</p>","name":"Standing Rope Forearm","name_original":"Standing Rope Forearm","creation_date":"2016-02-15","uuid":"22eb7cf6-bf6c-42c3-a1c8-85c2fc2ed931","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":293,"license_author":"intelman","status":"2","description":"<p>Ride a Stationary Bike with various tensions.</p>","name":"Stationary Bike","name_original":"Stationary Bike","creation_date":"2014-12-17","uuid":"a35655c8-6b2a-4606-b1d6-b57425986e2e","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":502,"license_author":"Bonniechica","status":"1","description":"<p>Sternsprung ausführen: Sprung in die Grätsche mit V-förmig geöffneten Armen und wieder zurück</p>","name":"Sternsprung","name_original":"Sternsprung","creation_date":"2017-11-17","uuid":"1bae7a1d-258c-4238-9474-100db9a129d1","license":2,"category":9,"language":1,"muscles":[10],"muscles_secondary":[7],"equipment":[7]},{"id":209,"license_author":"tuckerm","status":"2","description":"<ul>\n<li>Keep legs straight</li>\n<li>Keep back straight</li>\n</ul>","name":"Stiff-legged Deadlifts","name_original":"Stiff-legged deadlifts","creation_date":"2014-01-16","uuid":"335d0042-7cb3-41c3-af23-c22c8cb858ad","license":1,"category":9,"language":2,"muscles":[11],"muscles_secondary":[8],"equipment":[1]},{"id":216,"license_author":"tuckerm","status":"2","description":"<p>Use the straight bar attachment on a high pulley. Grasp the two ends of the bar with your palms facing downward and your arms straight out in front of you. Pull your hands down towards your hips, while keeping your arms straight, then raise them back up to the starting position.</p>","name":"Straight-arm Pull Down (bar Attachment)","name_original":"Straight-arm pull down (bar attachment)","creation_date":"2014-02-01","uuid":"034a4dcd-d085-43fa-a2b5-6d54b444ac20","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[5],"equipment":[]},{"id":215,"license_author":"tuckerm","status":"2","description":"<p>Use the rope attachment on a high pulley. Grasp the two ends of the rope with your arms straight out in front of you. Pull your hands down towards your hips, while keeping your arms straight, then raise them back up to the starting position.</p>","name":"Straight-arm Pull Down (rope Attachment)","name_original":"Straight-arm pull down (rope attachment)","creation_date":"2014-02-01","uuid":"dc53ad5b-bd04-46d0-9499-28e9965f0e6d","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[5],"equipment":[]},{"id":557,"license_author":"magdy","status":"1","description":"<ol>\n<li>Begin with a bar loaded on the ground. Approach the bar so that the bar intersects the middle of the feet. The feet should be set very wide, near the collars. Bend at the hips to grip the bar. The arms should be directly below the shoulders, inside the legs, and you can use a pronated grip, a mixed grip, or hook grip. Relax the shoulders, which in effect lengthens your arms.</li>\n<li>Take a breath, and then lower your hips, looking forward with your head with your chest up. Drive through the floor, spreading your feet apart, with your weight on the back half of your feet. Extend through the hips and knees.</li>\n<li>As the bar passes through the knees, lean back and drive the hips into the bar, pulling your shoulder blades together.</li>\n<li>Return the weight to the ground by bending at the hips and controlling the weight on the way down.</li>\n</ol>","name":"Sumo Deadlift","name_original":"sumo deadlift","creation_date":"2018-03-13","uuid":"73b4ef1a-1a3b-4328-b455-fcd27a100c0a","license":2,"category":9,"language":2,"muscles":[10],"muscles_secondary":[],"equipment":[]},{"id":508,"license_author":"Bonniechica","status":"1","description":"<p>Sehr breite Kniebeuge mit Tip Toe, trainiert Oberschenkel, Po und Waden</p>","name":"Sumo-Pliee-kniebeuge","name_original":"Sumo-Pliee-kniebeuge","creation_date":"2017-11-17","uuid":"30385035-dcca-4b6f-8973-5a4451e29104","license":2,"category":9,"language":1,"muscles":[11,7,8],"muscles_secondary":[],"equipment":[7]},{"id":570,"license_author":"sophialj","status":"1","description":"<p>Stand with your feet wider than your shoulders, with your toes pointed out at a 45 degree angle and barbell on your shoulder.</p>\n<p>While keeping your back straight, descend slowly by bending at the knees and hips as if you are sitting down (squatting).</p>\n<p>Lower yourself until your quadriceps and hamstrings are parallel to the floor.</p>\n<p>Return to the starting position by pressing upwards and extending your legs while maintaining an equal distribution of weight on your forefoot and heel.</p>","name":"Sumo Squats","name_original":"Sumo Squats","creation_date":"2018-05-09","uuid":"f4dd363c-b49c-419a-b8ae-0d8e18728d8e","license":2,"category":9,"language":2,"muscles":[8,10],"muscles_secondary":[],"equipment":[1]},{"id":497,"license_author":"Bonniechica","status":"1","description":"<p>In Bauchlage unter Körperspannung gleichzeitig den Oberkörper mit gestreckten Armen und Beine heben. Die Muskelspannung für 2 Sekunden halten</p>","name":"Superman","name_original":"Superman","creation_date":"2017-11-17","uuid":"8aed917d-23b5-43e3-bb9b-487cc79ced7e","license":2,"category":12,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":330,"license_author":"baldurmen","status":"2","description":"<p>Lay flat on your stomach with your arms extended in front of you on the ground as your legs are lying flat. Lift both your arms and legs at the same time, as if you were flying, and contract the lower back. Make sure that you are breathing and, depending on your fitness level, hold the movement for at least two to five seconds per repetition.</p>","name":"Superman","name_original":"Superman","creation_date":"2015-06-22","uuid":"6572a8e9-083c-4622-8f0c-6107a013a490","license":2,"category":12,"language":2,"muscles":[8,12],"muscles_secondary":[],"equipment":[4]},{"id":219,"license_author":"Cubeh","status":"1","description":"<p>Yep</p>","name":"Super Squat","name_original":"Super Squat","creation_date":"2014-02-02","uuid":"44f5d1cb-7f35-4926-85d3-ab8f9504abc2","license":1,"category":12,"language":2,"muscles":[10,6],"muscles_secondary":[11],"equipment":[1]},{"id":76,"license_author":"wger.de","status":"2","description":"<p>Die Ausführung ist sehr ähnlich wie beim freien vorgebeugtem Rudern, nur ist hier die Stange fest.</p>\n<p>Stelle dich auf das Gerät in die entsprechende Stelle und greife die Gewichtsstange mit mittelbreitem Griff. Gehe etwas in die Knie, bringe die Brust raus und führe den Oberkörper nach vorne. Hebe das Gewicht und ziehe es in Richtung Bauchnabel hoch (Ellenbogen am Körper lassen). Lasse es dann langsam wieder runter und spüre die Dehnung in den Kreuzmuskeln.</p>","name":"T-Bar Rudern (breit)","name_original":"T-Bar rudern (breit)","creation_date":null,"uuid":"25cbe148-a9f0-4720-bf2f-bcc07e6d2874","license":1,"category":12,"language":1,"muscles":[12],"muscles_secondary":[2,1,13],"equipment":[]},{"id":439,"license_author":"demo1","status":"1","description":"<p>Oh yes i forgot about this thanks!</p>","name":"Test","name_original":"Test","creation_date":"2016-12-16","uuid":"e5e736a0-8ccd-45b2-85b3-4ee0cff7a15a","license":2,"category":10,"language":2,"muscles":[1],"muscles_secondary":[1],"equipment":[8,3,4]},{"id":442,"license_author":"dannybit","status":"1","description":"<p>test123jdhjkahdkajhjhjkdahjkahdjakhdak</p>","name":"Test","name_original":"Test","creation_date":"2017-01-08","uuid":"700cf38d-e250-4a9a-a590-fb3f36431318","license":2,"category":10,"language":2,"muscles":[11],"muscles_secondary":[11],"equipment":[1]},{"id":493,"license_author":"matsmyhre","status":"1","description":"<p>This is a test for my API, this will check if the exercise actually comes up in my application!</p>","name":"TestBicep","name_original":"TestBicep","creation_date":"2017-11-17","uuid":"8564c45b-6896-4493-93e7-388b4747b075","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]},{"id":462,"license_author":"RomaqueMaximo","status":"1","description":"<p>descrição asasasasasssssssssssssssssssssssssssssssssssssssssssssss</p>","name":"Teste","name_original":"teste","creation_date":"2017-04-22","uuid":"8d4e2fe8-bd9a-4218-99cc-c4237c978946","license":2,"category":10,"language":7,"muscles":[1,7],"muscles_secondary":[7,8],"equipment":[]},{"id":396,"license_author":"BeLikeWater","status":"2","description":"<ol>\n<li>Start by doing a front squat</li>\n<li>At the top position, push the bar above your head (similar to a press)</li>\n<li>Lower the bar to the shoulders</li>\n</ol>","name":"Thruster","name_original":"Thruster","creation_date":"2016-05-11","uuid":"2fb46a71-adf6-4197-ac17-d4bdb63f69b0","license":3,"category":9,"language":2,"muscles":[2,10],"muscles_secondary":[11,8,9,5],"equipment":[1]},{"id":296,"license_author":"McMarcel13","status":"2","description":"<p>5 Sekunden parallel zum Boden mit den Oberschenkeln. Dann hoch springen und in Anfangsphase begeben. Arme verschränkt hinter dem Kopf die ganze Zeit.</p>","name":"Tiefe Hocksprünge","name_original":"Tiefe Hocksprünge","creation_date":"2014-12-26","uuid":"032a38cf-b15a-4761-b684-577e41893f54","license":2,"category":9,"language":1,"muscles":[11,7,8,10,6],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=25","previous":"https://wger.de/api/v2/exercise/?page=23","results":[{"id":179,"license_author":"oliser67","status":"1","description":"<p>Trazioni alla sbarra presa inversa</p>","name":"Trazioni Alla Sbarra Presa Inversa","name_original":"Trazioni alla sbarra presa inversa","creation_date":"2013-07-24","uuid":"6d454a34-09ed-4f94-b8c1-18966907b5bb","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":457,"license_author":"teste","status":"1","description":"<p>sasasasas</p>\n<p>as</p>\n<p>asas</p>\n<p>as</p>\n<p>a</p>\n<p>sa</p>\n<p>s</p>\n<p>a</p>\n<p>sa</p>","name":"Treino Teste","name_original":"Treino teste","creation_date":"2017-04-07","uuid":"1798da1c-4f93-498d-8959-282dbe94cdec","license":2,"category":8,"language":7,"muscles":[1],"muscles_secondary":[9],"equipment":[8]},{"id":279,"license_author":"http://www.bodybuilding.com/","status":"2","description":"<ol>\n<li>Start with a dumbbell in each hand and your palms facing your torso. Keep your back straight with a slight bend in the knees and bend forward at the waist. Your torso should be almost parallel to the floor. Make sure to keep your head up. Your upper arms should be close to your torso and parallel to the floor. Your forearms should be pointed towards the floor as you hold the weights. There should be a 90-degree angle formed between your forearm and upper arm. This is your starting position.</li>\n<li>Now, while keeping your upper arms stationary, exhale and use your triceps to lift the weights until the arm is fully extended. Focus on moving the forearm.</li>\n<li>After a brief pause at the top contraction, inhale and slowly lower the dumbbells back down to the starting position.</li>\n<li>Repeat the movement for the prescribed amount of repetitions.</li>\n</ol>\n<p><strong>Variations:</strong> This exercise can be executed also one arm at a time much like the one arm rows are performed.</p>\n<p>Also, if you like the one arm variety, you can use a low pulley handle instead of a dumbbell for better peak contraction. In this case, the palms should be facing up (supinated grip) as opposed to the torso (neutral grip).</p>","name":"Tricep Dumbbell Kickback","name_original":"Tricep Dumbbell Kickback","creation_date":"2014-10-22","uuid":"88568115-5e88-4afc-b005-e2f7d453ac13","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[3]},{"id":375,"license_author":"chris","status":"1","description":"<p>Tricep Press down machine with free weights in free weight section</p>","name":"Tricep Push Down FreeWieghts","name_original":"Tricep Push Down FreeWieghts","creation_date":"2016-01-18","uuid":"ae7d5a85-c76d-4016-b1d2-a9f9e666f9ea","license":2,"category":8,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":186,"license_author":"Horal_cz","status":"2","description":"<p>Činka v jedné ruce v úrovni ramene. Zvedat do výšky napnuté paže a zpět. Provádět pomalu.</p>","name":"Triceps Bench Press One Barbell","name_original":"Triceps bench press one barbell","creation_date":"2013-07-31","uuid":"1855c71b-b005-4615-b90c-b2fed8e10342","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[2],"equipment":[]},{"id":162,"license_author":"Mahoney","status":"2","description":"<p>lift on parallel bars hold for 1 second, and lower slowly and control for 4 seconds, then come back with no rest (tempo: 4010)</p>","name":"Triceps Dips","name_original":"Triceps dips","creation_date":"2013-06-21","uuid":"5a29197f-e159-4a98-9b40-534c41ab34a1","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":89,"license_author":"wger.de","status":"2","description":"<p>Grab the cable, stand with your feet shoulder wide, keep your back straight and lean forward a little. Push the bar down, making sure the elbows don't move during the exercise. Rotate your hands outwards at the very end and go back to the initial position without pause.</p>","name":"Triceps Extensions on Cable","name_original":"Triceps extensions on cable","creation_date":null,"uuid":"f1b5e525-6232-4d60-a243-9b2cd6c55298","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":90,"license_author":"wger.de","status":"2","description":"<p>Grab the bar, stand with your feet shoulder wide, keep your back straight and lean forward a little. Push the bar down, making sure the elbows don't move during the exercise. Without pause go back to the initial position.</p>","name":"Triceps Extensions on Cable With Bar","name_original":"Triceps extensions on cable with bar","creation_date":null,"uuid":"20a76bd0-1e56-4a4e-bd79-0ab118552bde","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":139,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Triceps Machine","name_original":"Triceps machine","creation_date":"2013-05-05","uuid":"88bbdbde-c9b6-45a1-aee9-efc6f02cfab3","license":1,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":578,"license_author":"kojack70","status":"1","description":"<p>Triangular Bar pressdown on cable tower</p>","name":"Triceps Press Down","name_original":"Triceps Press Down","creation_date":"2018-06-11","uuid":"4665516b-9e78-4120-8a5d-4a4cae71d78d","license":2,"category":8,"language":2,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":45,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf eine Bank und nehme eine Kurzhantel in die Hand. Strecke den Arm fast vollständig aus und lasse nun das Gewicht langsam bis hinter dem Kopf herunter. Während der Übung darf nur der Trizeps die Arbeit machen, achte darauf, dass sich die Ellenbogen nicht bewegen. Zur Stabilisierung kannst du den freien Arm nehmen.</p>","name":"Trizepsdrücken KH Über Kopf","name_original":"Trizepsdrücken KH über Kopf","creation_date":null,"uuid":"1f255866-ea06-45fa-9183-03e9ea6c0ec1","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[3]},{"id":27,"license_author":"wger.de","status":"2","description":"<p>Setze dich hin und greife die Stange fest mit den Händen. Drücke nun das Gewicht nach oben (Arme nicht ganz ausstrecken) und bringe es langsam wieder runter. Wie bei den anderen Trizepsübungen ist es wichtig, dass du die Oberarme nicht mitbewegst.</p>","name":"Trizepsmaschine","name_original":"Trizepsmaschine","creation_date":null,"uuid":"ca03dd79-4a92-47ef-a461-e67ccc406f82","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":1,"license_author":"wger.de","status":"2","description":"<p>Stelle dich mit schulterbreitem Stand vor dem Kabelzug, beuge den Rücken sehr leicht nach vorn und greife das Seil. Ziehe nun nach unten, wobei die Ellenbogen sich während der ganzen Übung nicht von der Stelle bewegen sollen. Wenn die Arme ausgestreckt sind, drehe die Hände nach außen. Gehe langsam zur Ausgansposition zurück.</p>","name":"Trizeps Seildrücken","name_original":"Trizeps Seildrücken","creation_date":null,"uuid":"b83e3d85-a53d-4939-a61c-7baa2e94d358","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":63,"license_author":"wger.de","status":"2","description":"<p>Stelle dich mit schulterbreitem Stand vor dem Kabelzug, beuge den Rücken sehr leicht nach vorn und greife das die Stange. Drücke das Gewicht nach unten, wobei die Ellenbogen sich während der ganzen Übung nicht von der Stelle bewegen sollen. Gehe langsam und ohne Pause zur Ausgansposition zurück.</p>","name":"Trizeps Seildrücken Mit Stange","name_original":"Trizeps Seildrücken mit Stange","creation_date":null,"uuid":"60aab5bf-ff7a-4e50-9e92-1f4813c3da75","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[]},{"id":292,"license_author":"JonnFox","status":"2","description":"<p>- Arm senkrecht nach oben halten</p>\n<p>- Arm beugen und Hantel hinter den Nacken führen, dabei einatmen</p>\n<p>- Hantel wieder nach oben führen bis Arm wieder gestreckt ist, dabei ausatmen</p>\n<p>! Darauf achten, dass Oberarm fixiert bleibt und sich nicht bewegt</p>\n<p> </p>\n<p>-&gt; Angesprochene Muskeln: lateraler Kopf des Trizeps; langer Kopf des Trizeps</p>","name":"Trizeps Unterarm Heben Über Kopf","name_original":"Trizeps Unterarm heben über Kopf","creation_date":"2014-12-01","uuid":"867917d6-6688-4bf9-a43b-b3ab9a5a9ec3","license":1,"category":8,"language":1,"muscles":[5],"muscles_secondary":[],"equipment":[3]},{"id":310,"license_author":"Robertcoop","status":"2","description":"<p>Seated trunk rotation with cable </p>","name":"Trunk Rotation With Cable ","name_original":"Trunk rotation with cable ","creation_date":"2015-02-07","uuid":"e17db782-6e28-48ef-9324-4c01672ffc54","license":2,"category":10,"language":2,"muscles":[14],"muscles_secondary":[12],"equipment":[]},{"id":400,"license_author":"Skadi","status":"2","description":"<p>Rudern mit Schlingentrainer - Körpergewichtsübung</p>","name":"TRX Rudern","name_original":"TRX Rudern","creation_date":"2016-06-03","uuid":"178eb027-fb5e-4fb3-84a9-6a3c229a92f1","license":2,"category":12,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[7]},{"id":318,"license_author":"dookie1481","status":"2","description":"<p>Starting on back, move to the standing position with dumbbell in one hand.  Switch hands between reps.</p>","name":"Turkish Get-Up","name_original":"Turkish Get-Up","creation_date":"2015-03-09","uuid":"bd07fc6b-db86-4139-b6de-e328cea0f694","license":2,"category":10,"language":2,"muscles":[2,8,14,3],"muscles_secondary":[2,8,14,3],"equipment":[3]},{"id":516,"license_author":"Bonniechica","status":"1","description":"<p>Füßen unter der Klinke platzieren, Knie beugen und den Oberkörper in Richtung Klinke ziehen. Die Schulterblätter angespannt zusammen und unten ziehen. Die Spannung für 2 Sekunden halten. In der Gegenbewegung die Schulterblätter von der Wirbelsäule weg ziehen.</p>\n<p> </p>","name":"Türrudern","name_original":"Türrudern","creation_date":"2017-11-20","uuid":"e5c27724-8a55-4b40-b31f-730e53b44cd5","license":2,"category":13,"language":1,"muscles":[1,13,3,9],"muscles_secondary":[11,10],"equipment":[7]},{"id":294,"license_author":"woern777","status":"1","description":"<p> </p>\n<p>How to Clean and Press</p>\n<p> </p>\n<p>As I mentioned, the technique for a dumbbell clean isn't quite as simple as doing a barbell clean while holding a pair of dumbbells.</p>\n<p> </p>\n<p>First of all, a seven-foot long bar forces you to take a pronated grip (palms down, knuckles facing front). That's how we clean or snatch; it's usually how we deadlift; it's how we instinctually grab the bar when we're about to do almost anything with it.</p>\n<p> </p>\n<p>A pair of dumbbells not only don't force you to have any particular hand position, other than the one you find most comfortable or powerful, it actually makes it unnaturally clumsy to try to maintain a barbell-esque pronated grip at the start of the exercise. The most efficient way of doing a dumbbell clean is to not think about doing a clean at all. Think of doing a \"power hammer curl from the floor.\"</p>\n<p> </p>\n<p>Begin with the dumbbells on the ground just outside your feet, with the left dumbbell pointing roughly \"1 and 7\" on a clock and the right dumbbell pointing roughly \"11 and 5.\" Squat down, feet being a comfortable width apart, and grab both dumbbells. Your arms should be able to slide down along the outside of your legs, without the legs interfering in keeping the arms locked at the start.</p>\n<p> </p>\n<p>Keeping a flat back, begin the dumbbell clean using the same lower body and torso position as with a barbell, allowing the dumbbells to rise next to or slightly in front of your legs. As the weights approach your knees, explode up with maximum force and control the weights enough to keep them from looping too far forward, while also maintaining a predominantly thumbs-up, hammer curl-type orientation.</p>\n<p> </p>\n<p>Receive the weight by catching it with a slight dip as it comes to rest in front of your shoulders, elbows pushed forward so you look like a slightly-awkward midpoint of a legit hammer curl.</p>\n<p> </p>\n<p>Congrats, you've just completed the first half of a dumbbell clean and press. Unfortunately, it's like wrapping up foreplay with Khloe Kardashian. If you thought that was tough to get through, you're not gonna enjoy the next part, either.</p>\n<p> </p>\n<p>Immediately take a quick breath in, brace your abs and glutes, and press the weights overhead. No jerky or jumping leg drive. This isn't a clean and push press, so keep it strict. If you're pressing for any substantial number of reps, you'll find it easiest to maintain a mostly-neutral grip, rather than externally rotating the arms to get the dumbbells into \"regular\" press position (palms facing forward).</p>\n<p> </p>\n<p>Preserving muscular energy whenever possible goes a long way with such a big exercise. While a neutral-grip overhead press will slightly increase the front delt and triceps activation, you'll also be starting the press from a stronger biomechanical position (with the elbows brought in rather than rotated out), which will maintain joint health and could improve pressing strength – a pretty solid tradeoff in my book.</p>\n<p> </p>\n<p>Once both arms are locked out overhead, take another quick breath before lowering the weights to your shoulders (either hand orientation, neutral or pronated, is fine), then lower them to the waist as in the negative of a quick hammer curl, catching them with a knee dip and a flat back to lessen the impact on the wrist, elbow, shoulder, and low back, and then squat to place them on the ground.</p>\n<p> </p>\n<p>All of that makes one rep, and you're doing how many more this set?</p>","name":"Two Dumbbell Clean And Press","name_original":"Two Dumbbell clean and press","creation_date":"2014-12-17","uuid":"a4dc0099-1e07-4731-835a-9b7bb8d05685","license":2,"category":13,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[3]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=26","previous":"https://wger.de/api/v2/exercise/?page=24","results":[{"id":487,"license_author":"Bonnie","status":"1","description":"<p>Im aufrechten Stand unter Körperspannung - Bauch und Po -</p>\n<p>das gespannte Theraband bis zum Nacken herunterziehen</p>","name":"Über Kopf \"Pullover Down\"","name_original":"Über Kopf \"Pullover down\"","creation_date":"2017-10-20","uuid":"fd2af38e-d000-4dfc-ba2f-83210daa20a4","license":2,"category":12,"language":1,"muscles":[1,12,15],"muscles_secondary":[8,6],"equipment":[]},{"id":40,"license_author":"wger.de","status":"2","description":"","name":"Überzugmaschine","name_original":"Überzugmaschine","creation_date":null,"uuid":"b2b04771-5032-44bc-8a18-cede3c82947b","license":1,"category":11,"language":1,"muscles":[12,4,3],"muscles_secondary":[5],"equipment":[]},{"id":369,"license_author":"perteus","status":"2","description":"Vezmeme činku do jedné ruky a děláme úklony na stranu, kde držíme činku se zaměřením na táhnutí bočními břišními svaly.","name":"Úklony do Strany s Čínkou","name_original":"Úklony do strany s čínkou","creation_date":"2016-01-13","uuid":"73537127-d96f-45ba-a36b-427b634dfe21","license":2,"category":10,"language":9,"muscles":[14],"muscles_secondary":[],"equipment":[3]},{"id":506,"license_author":"Bonniechica","status":"1","description":"<p>Plankstellung umgekehrt ausführen</p>","name":"Umgekehrte Planke","name_original":"umgekehrte Planke","creation_date":"2017-11-17","uuid":"0ebde95b-ba92-449b-a94b-e345c37badc7","license":2,"category":12,"language":1,"muscles":[13,6],"muscles_secondary":[7,8,10],"equipment":[7]},{"id":31,"license_author":"wger.de","status":"2","description":"<p>.</p>","name":"Umsetzen","name_original":"Umsetzen","creation_date":null,"uuid":"2e6a2f01-15c9-4985-8a01-1b412ec79400","license":1,"category":11,"language":1,"muscles":[4],"muscles_secondary":[],"equipment":[1]},{"id":212,"license_author":"tuckerm","status":"2","description":"<p>Grip the pull-down bar with your palms facing you and your hands closer than shoulder-width apart. Lean back slightly and keep your back straight. Pull the bar down towards your chest, pulling your shoulders back slightly at the end of the motion.</p>","name":"Underhand Lat Pull Down","name_original":"Underhand lat pull down","creation_date":"2014-02-01","uuid":"bf618c32-b4b1-4bbb-a74f-73485e4143ed","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[1],"equipment":[]},{"id":250,"license_author":"tanatos","status":"2","description":"<p>DIE UNTERARME IM SITZEN AUF DIE KNIE ABSTÜTZEN DIE HANDFLÄCHE  NACH OBEN DIE LANGHANTEL ANHEBEN</p>","name":"Unterarm Heben","name_original":"unterarm heben","creation_date":"2014-05-09","uuid":"18f955d4-6344-4d19-ae96-dca71e8ad787","license":1,"category":8,"language":1,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":417,"license_author":"Sepplx","status":"2","description":"<p>Mit dem Bauch auf den Boden legen und den Körper mit Unterarmen und Zehen abstützen. Beine, Rücken und Kopf sollten eine gerade Linie bilden.</p>","name":"Unterarmstütze - Plank","name_original":"Unterarmstütze - Plank","creation_date":"2016-09-15","uuid":"257cdb33-ba8b-410a-9396-5132b08dc912","license":2,"category":10,"language":1,"muscles":[6],"muscles_secondary":[7,8,4,10,3,9],"equipment":[7]},{"id":393,"license_author":"Vazco","status":"2","description":"<p>Full workout of the upper arms body n chest. Focusing on the core</p>","name":"Upper Body","name_original":"Upper Body","creation_date":"2016-04-18","uuid":"6ae341ba-f941-44b5-9d59-b0fba42c0980","license":2,"category":11,"language":2,"muscles":[2,1,11,14,4,10,6,3,15,9,5],"muscles_secondary":[2,1,11,13,7,8,12,14,4,10,6,3,15,9,5],"equipment":[1,8,3,4,9,7]},{"id":258,"license_author":"http://www.carinatum.com/","status":"2","description":"<p>Exercise for upper external oblique muscles</p>","name":"Upper External Oblique","name_original":"Upper External Oblique","creation_date":"2014-07-01","uuid":"deb02a12-37ce-43d6-b3f2-c77ed2b4259f","license":1,"category":11,"language":2,"muscles":[14],"muscles_secondary":[],"equipment":[6]},{"id":472,"license_author":"kavtya","status":"1","description":"<p>Grasp bar with shoulder width or slightly narrower overhand grip.</p>\n<p>Pull the bar to neck with elbows leading. Allow wrists to flex as bar rises.</p>\n<p>Lower and repeat.</p>","name":"Upright Row","name_original":"Upright Row","creation_date":"2017-07-13","uuid":"53650843-f476-4ea3-9794-a4d5cb587197","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]},{"id":147,"license_author":"wger.de","status":"2","description":"<p>The movements are basically the same as with an SZ-bar, but you use the bar on the multi press:</p>\n<p>Stand straight, your feet are shoulder-width apart. Hold the bar with an overhand grip on your thighs, the arms are stretched. Lift the bar close to the body till your chin. The elbows point out so that at the highest point they form a V. Make here a short pause before going slowly down and repeating the movement.</p>","name":"Upright Row, on Multi Press","name_original":"Upright row, on multi press","creation_date":"2013-05-05","uuid":"26c72fd7-d5b9-497b-be5e-cdfe9715ddac","license":1,"category":13,"language":2,"muscles":[2,9],"muscles_secondary":[1],"equipment":[]},{"id":554,"license_author":"jamie.coleman9","status":"1","description":"<ol>\n<li>Select the desired weight and load it onto a barbell.</li>\n<li>Unrack the bar by rotating the safety latches off the j-hooks.</li>\n<li>Inhale, brace your abs, and then lead the movement by driving the elbows high as you pull the bar to chest height.</li>\n<li>When the bar has reached its peak, reverse the movement slowly while controlling the bar back to the starting position.</li>\n<li>Repeat for the desired number of repetitions.</li>\n</ol>","name":"Upright Row, Smith Machine","name_original":"Upright Row, Smith Machine","creation_date":"2018-03-08","uuid":"b0bd1f4c-f4f2-4ba4-b66b-bccb0d743d6e","license":2,"category":13,"language":2,"muscles":[9],"muscles_secondary":[],"equipment":[]},{"id":127,"license_author":"wger.de","status":"2","description":"<p>Stand straight, your feet are shoulder-width apart. Hold the SZ-bar with an overhand grip on your thighs, the arms are stretched. Lift the bar close to the body till your chin. The elbows point out so that at the highest point they form a V. Make here a short pause before going slowly down and repeating the movement.</p>","name":"Upright Row, SZ-bar","name_original":"Upright row, SZ-bar","creation_date":null,"uuid":"61271a8e-6a00-4898-8dc3-ea9ef913f25e","license":1,"category":13,"language":2,"muscles":[2,9],"muscles_secondary":[1],"equipment":[2]},{"id":311,"license_author":"koreyhinton","status":"2","description":"<p>Feet apart at shoulder width. Nice and Slow!</p>","name":"Upright Row w/ Dumbbells","name_original":"Upright Row w/ Dumbbells","creation_date":"2015-02-11","uuid":"97d7eba2-681f-4b14-8e78-7d9b5865d336","license":2,"category":13,"language":2,"muscles":[2,9],"muscles_secondary":[1],"equipment":[3]},{"id":424,"license_author":"apeschel","status":"2","description":"<p>Pulldowns using close grip v-bar.</p>","name":"V-Bar Pulldown","name_original":"V-Bar Pulldown","creation_date":"2016-10-06","uuid":"36f940ff-6352-4480-b763-1234438f6624","license":2,"category":12,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":47,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf dem Rand einer Flachbank und beuge den Körper so weit nach vorne, dass er parallel zum Boden ist. Nehme nun die Hanteln und hebe sie seitwärts bis etwas über schulterhöhe. Gehe langsam wieder runter.</p>\n<p>Es ist wichtig, während der Übung, die Arme nicht nach vorn oder nach hinten zu bewegen, sie sollten stets einen rechten Winkel mit dem Körper haben. Wie beim Seitheben im Stehen, sollten sich die Handflächen nicht drehen, sie zeigen also immer zum Boden oder zum Körper.</p>","name":"Vorgebeugtes Seitheben","name_original":"Vorgebeugtes Seitheben","creation_date":null,"uuid":"e701de98-32c6-4e9d-956d-434cf5bcaaf0","license":1,"category":13,"language":1,"muscles":[2],"muscles_secondary":[9],"equipment":[8,3]},{"id":363,"license_author":"perteus","status":"2","description":"Tento cvik, známý i jako dřepy ve výpadu, patří mezi základní variace. Je zacílen na svalstvo hýždí, hamstringů a kvadricepsů, ale jelikož nemusíte měnit při jeho provádění pozici chodidel, jeví se tato variace z hlediska udržení rovnováhy jako méně náročná.","name":"Výpad Statický","name_original":"Výpad statický","creation_date":"2016-01-11","uuid":"c38e34a7-5560-46a1-bae4-c4fce9619e55","license":2,"category":12,"language":9,"muscles":[8],"muscles_secondary":[10],"equipment":[1,3]},{"id":373,"license_author":"wger.de","status":"2","description":"1) Sedneme si do leg-pressu\n2) Špičky dáme na okraj plochy na chodidla\n3) Provádíme výpony\n4) V horní poloze je třeba podržet a koncentrovat se a stejně, i v dolní poloze a dělat to v plném rozsahu pohybu\n5) Pohyb opakujeme","name":"Výpony na Horu Leg-Press","name_original":"Výpony na horu Leg-Press","creation_date":"2016-01-14","uuid":"648ef50c-1697-485c-b018-82964474c379","license":2,"category":14,"language":9,"muscles":[7],"muscles_secondary":[],"equipment":[]},{"id":23,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf die Maschine mit dem Rücken fest gegen die Lehne und stelle die Füße auf die Plattform für Wadenheben etwa schulterbreit. Prüfe dass etwa die Hälfte noch drauf sind und du die Wadenmuskeln nach unten komplett austrecken kannst.</p>\n<p>Mit geraden Knien strecke dann die Waden und gehe so hoch wie möglich. Gehe dann runter bis die Waden komplet ausgestreckt sind und wiederhole die Bewegung.</p>","name":"Wadenheben an Hackenschmidt","name_original":"Wadenheben an Hackenschmidt","creation_date":null,"uuid":"c7b98fb5-7723-471a-92a1-7b4e892a5468","license":1,"category":14,"language":1,"muscles":[7],"muscles_secondary":[15],"equipment":[]}]},{"count":523,"next":null,"previous":"https://wger.de/api/v2/exercise/?page=26","results":[{"id":261,"license_author":"dewian000","status":"2","description":"<p>Бег предоставляет хорошие условия в качестве аэробной тренировки, которая увеличивает порог выносливости, положительно влияет на сердечно-сосудистую систему, повышает обмен веществ в организме и, таким образом, помогает осуществлять контроль за весом тела. Бег позитивно влияет на иммунную систему и улучшает тонус кожи. Укрепление мускулатуры ног и улучшение обмена веществ помогает предотвратить и устранить целлюлит.</p>\n<p>https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%B3</p>","name":"Бег","name_original":"Бег","creation_date":"2014-07-20","uuid":"c59e493d-4331-4a86-b16f-9b399996ecd5","license":1,"category":9,"language":5,"muscles":[11,7,8,10],"muscles_secondary":[],"equipment":[]},{"id":236,"license_author":"wger.de","status":"2","description":"<p>занятие на велотренажоре</p>","name":"Велотренажор","name_original":"Велотренажор","creation_date":"2014-03-27","uuid":"206fe75c-ede9-4a80-b050-9ec62c5759e3","license":1,"category":9,"language":5,"muscles":[],"muscles_secondary":[],"equipment":[7]},{"id":235,"license_author":"ввв","status":"2","description":"<p>фыв фывыфыф вы</p>","name":"Велотренажор","name_original":"Велотренажор","creation_date":"2014-03-27","uuid":"340ce1d3-fa8f-417d-8bda-abcc486aef77","license":1,"category":8,"language":5,"muscles":[],"muscles_secondary":[],"equipment":[]}]},{"count":523,"next":"https://wger.de/api/v2/exercise/?page=27","previous":"https://wger.de/api/v2/exercise/?page=25","results":[{"id":297,"license_author":"McMarcel13","status":"2","description":"<p>Wenn man möchte mit extra Gewicht</p>","name":"Wadenheben, Einbenig","name_original":"Wadenheben, einbenig","creation_date":"2014-12-26","uuid":"8e65edc1-9693-4364-ade6-6dd863b22307","license":2,"category":14,"language":1,"muscles":[7],"muscles_secondary":[],"equipment":[]},{"id":14,"license_author":"wger.de","status":"2","description":"<p>Setze dich auf die Bank und stelle die Fußspitzen so auf den Rand, dass du die Waden komplett nach unten austrecken kannst. Ziehe nun die Wadenmuskeln zusammen und gehe so hoch es geht. Mache auf dem höchsten Punkt eine kurze Pause (1-2 sek.) und gehe dann runter.</p>","name":"Wadenheben Sitzend","name_original":"Wadenheben sitzend","creation_date":null,"uuid":"47b4d57a-3bb3-4a03-a522-a0559a254730","license":1,"category":14,"language":1,"muscles":[15],"muscles_secondary":[7],"equipment":[]},{"id":13,"license_author":"wger.de","status":"2","description":"<p>Die Füße werden auf die in der Maschine dafür vorgesehene Stelle positioniert, wobei man die Fersen (und damit die Wadenmuskeln) komplett nach unten austrecken kann. Halte den Körper gerade, mache kein Hohlkreuz und beuge die Beine nicht.</p>\r\n<p>Ziehe nun die Wadenmuskeln zusammen und gehe so hoch es geht. Mache auf dem höchsten Punkt eine kurze Pause (1-2 sek.) und gehe dann runter.</p>","name":"Wadenheben Stehend","name_original":"Wadenheben stehend","creation_date":null,"uuid":"283d4ec5-1b29-41bb-997d-74c30e7a68b5","license":1,"category":14,"language":1,"muscles":[7],"muscles_secondary":[15],"equipment":[]},{"id":379,"license_author":"Chippo","status":"1","description":"Walking, distance and time. Should allow a range of inputs (running, etc)","name":"Walking","name_original":"Walking","creation_date":"2016-02-06","uuid":"8ddb04c0-2490-4fd2-9289-ebd6766e734e","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":518,"license_author":"dannjager","status":"1","description":"<p>throw a medicine ball against a 3m high target and squat down.</p>\n<p>9kg medicine ball for man</p>\n<p>6kg for women </p>","name":"Wallballs","name_original":"wallballs","creation_date":"2017-11-28","uuid":"7de7dffb-c814-4228-b41b-ffd133093637","license":2,"category":9,"language":6,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":359,"license_author":"Nash","status":"2","description":"<p>Handstand against a wall for support (chest facing wall).</p>","name":"Wall Handstand","name_original":"Wall Handstand","creation_date":"2016-01-04","uuid":"472d117c-c2a9-47cf-a5c7-fdb9fbac23a9","license":2,"category":13,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[7]},{"id":203,"license_author":"Dexter","status":"2","description":"<p>Pushup against a wall</p>","name":"Wall Pushup","name_original":"Wall pushup","creation_date":"2014-01-12","uuid":"504c91f8-5a76-4faa-943f-13799357a426","license":1,"category":8,"language":2,"muscles":[2,4,5],"muscles_secondary":[8,6,3,9],"equipment":[7]},{"id":548,"license_author":"Whythebigpaws","status":"1","description":"<p>Stand with heels,  shoulders, back of head,  and hips touching the wall. Start with biceps straight out and elbows at a 90 degree angle. Straighten the arms while remaining againstthe wall without arching the back off of the wall, mimicking a shoulder press movement. </p>","name":"Wall Slides","name_original":"Wall slides","creation_date":"2018-02-07","uuid":"e934e2b2-abe7-411d-b753-8ce298391b9e","license":2,"category":12,"language":2,"muscles":[1,11,4,9,5],"muscles_secondary":[],"equipment":[7]},{"id":387,"license_author":"Blablabla","status":"2","description":"<p>Find a nice flat piece of wall and stand with your back leaning against the wall. Slowly slide down the wall while moving your feet away from it, until your thighs are parallel to the ground and both your knees and your hips are bent at a 90° angle. Cross your arms in front of your chest and hold this position for 30 seconds.</p>\n<p>Variant: put a big inflated rubber ball (like a small basketball) between your knees and squeeze the ball while holding the squat position</p>","name":"Wall Squat","name_original":"Wall Squat","creation_date":"2016-02-29","uuid":"b229c57f-5363-41e2-add7-c2501a31de0b","license":3,"category":9,"language":2,"muscles":[11,10],"muscles_secondary":[],"equipment":[7]},{"id":512,"license_author":"Bonniechica","status":"1","description":"<p>An der Wand eine Kniebeuge ausführen und die Position unter Spannung halten</p>","name":"Wandsitz","name_original":"Wandsitz","creation_date":"2017-11-17","uuid":"737da282-4200-4480-b573-b538b41e4c38","license":2,"category":9,"language":1,"muscles":[11,8,10],"muscles_secondary":[],"equipment":[7]},{"id":450,"license_author":"anzeige","status":"1","description":"<p>Die Arme werden am Ellenbogen gebeugt und die Kettlebells nach oben bewegt.</p>","name":"Wechselseitiges Rudern Mit Kettlebells","name_original":"Wechselseitiges Rudern mit Kettlebells","creation_date":"2017-02-17","uuid":"9e24d038-2916-4eef-88a2-2de33cb3a459","license":2,"category":12,"language":1,"muscles":[12],"muscles_secondary":[1],"equipment":[10]},{"id":320,"license_author":"jigglychipmunk","status":"2","description":"<p>Box step-ups w/ barbell, 45's on each side</p>","name":"Weighted Step","name_original":"weighted step","creation_date":"2015-04-07","uuid":"4aecc570-d535-4ec1-8290-2e1a5c482f48","license":2,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[1]},{"id":321,"license_author":"jigglychipmunk","status":"2","description":"<p>box step ups w/ barbell and 45's on each side</p>","name":"Weighted Step-ups","name_original":"weighted step-ups","creation_date":"2015-04-07","uuid":"1076ed41-6f7c-46c9-a28f-ab13fc1ab92c","license":3,"category":9,"language":2,"muscles":[],"muscles_secondary":[],"equipment":[]},{"id":204,"license_author":"tuckerm","status":"2","description":"<p>Lat pulldowns with a wide grip on the bar.</p>","name":"Wide-grip Pulldown","name_original":"Wide-grip pulldown","creation_date":"2014-01-13","uuid":"34fc154f-cc8d-4e52-adb7-ff0dad2d0770","license":1,"category":12,"language":2,"muscles":[12],"muscles_secondary":[],"equipment":[]},{"id":479,"license_author":"Jojek","status":"1","description":"<p>Like normal pull-ups but wider grip.</p>","name":"Wide Pull-ups","name_original":"Wide Pull-ups","creation_date":"2017-08-23","uuid":"bc328eab-41ec-4940-8092-19059b58d05d","license":2,"category":12,"language":2,"muscles":[12,9],"muscles_secondary":[2,13,4],"equipment":[6]},{"id":485,"license_author":"SamBman889","status":"1","description":"<p>Forearm wrist Curls. </p>\n<p> </p>\n<ol>\n<li>Sit on a flat bench with a dumbbell in your right hand.</li>\n<li>Place your feet flat on the floor, at a distance that is slightly wider than shoulder width apart.</li>\n<li>Lean forward and place your right forearm on top of your upper right thigh with your palm up. <strong>Tip:</strong> Make sure that the front of the wrist lies on top of your knees. This will be your starting position.</li>\n<li>Lower the dumbbell as far as possible as you keep a tight grip on the dumbbell. Inhale as you perform this movement.</li>\n<li>Now curl the dumbbell as high as possible as you contract the forearms</li>\n<li>Perform for the recommended amount of repetitions, switch arms and repeat the movement.</li>\n</ol>\n<p> </p>","name":"Wrist Curl","name_original":"Wrist Curl","creation_date":"2017-10-17","uuid":"963d302f-9c1a-49d7-91a1-47a2e755c0a4","license":3,"category":8,"language":2,"muscles":[13],"muscles_secondary":[],"equipment":[1]},{"id":159,"license_author":"WrmZ","status":"1","description":"<p>wyciskanie skośne głowa w górę</p>","name":"Wyciskanie Skos","name_original":"Wyciskanie Skos","creation_date":"2013-05-27","uuid":"c3d9747a-6c09-46aa-9d6f-bf058b981d48","license":1,"category":11,"language":2,"muscles":[4],"muscles_secondary":[5],"equipment":[]},{"id":288,"license_author":"GrosseHund","status":"1","description":"<p>Grab barbell and place on shoulders then walk</p>","name":"Yolk Walks","name_original":"yolk walks","creation_date":"2014-11-02","uuid":"8d5d8cc1-3ea5-4ca1-bb43-4bfaef9e7098","license":1,"category":13,"language":2,"muscles":[2,9],"muscles_secondary":[14,6],"equipment":[1]},{"id":305,"license_author":"nate303303","status":"2","description":"<p>-Perform a traditional dumbbell biceps curl, pausing at the top of the motion.</p>\n<p>-Twist your hands until your palms are facing away from your shoulders (in reverse curl position).  Basically, twist your right wrist inwards to the left, and vice versa.</p>\n<p>-In a slow, controlled movement, lower the Dbells with your palms facing the ground.  At the bottom of the motion, twist your wrists back into the traditional curl grip (palms facing up, towards shoulder).</p>\n<p>-That is 1 rep</p>\n<p> </p>","name":"Z Curls","name_original":"Z Curls","creation_date":"2015-02-06","uuid":"7738fb4e-8f17-4aeb-84ef-2ee3e12eaff7","license":2,"category":8,"language":2,"muscles":[1,13],"muscles_secondary":[],"equipment":[]},{"id":368,"license_author":"perteus","status":"2","description":"lehneme na podložku. Medicinbal do ruky natáhneme jí před sebe a provádíme zkracovačky .","name":"Zkracovačky s Medicinbalem ","name_original":"Zkracovačky s medicinbalem ","creation_date":"2016-01-13","uuid":"1d0e502a-d31b-4e38-a4bf-543fbb31f0a2","license":2,"category":10,"language":9,"muscles":[6],"muscles_secondary":[],"equipment":[7]}]}]